r: \"Column 2\",\n      accessor: \"col2\",\n    },\n    ButtonColumn(\"Click\", \"primary\", clickMeCallback, \"testId\"),\n    DateColumn(\"Date\", (cell) => cell.row.original.createdAt),\n    PlaintextColumn(\"Log\", (cell) => cell.row.original.log),\n  ];\n\n  test(\"button appears in the table and triggers callback on click\", async () => {\n    render(<"+"OurTable columns={columns} data={threeRows} />);\n\n    expect(\n      await screen.findByTestId(\"testId-cell-row-0-col-Click-button\"),\n    ).toBeInTheDocument();\n    const button = screen.getByTestId(\"testId-cell-row-0-col-Click-button\");\n    fireEvent.click(button);\n    await waitFor(() => expect(clickMeCallback).toBeCalledTimes(1));\n  });\n\n  test(\"default testid is testId\", async () => {\n    render(<"+"OurTable columns={columns} data={threeRows} />);\n    expect(await screen.findByTestId(\"testid-header-col1\")).toBeInTheDocument();\n  });\n\n  test(\"click on a header and a sort caret should appear\", async () => {\n    render(\n      <"+"OurTable columns={columns} data={threeRows} testid={\"sampleTestId\"} />,\n    );\n\n    expect(\n      await screen.findByTestId(\"sampleTestId-header-col1\"),\n    ).toBeInTheDocument();\n    const col1Header = screen.getByTestId(\"sampleTestId-header-col1\");\n\n    const col1SortCarets = screen.getByTestId(\n      \"sampleTestId-header-col1-sort-carets\",\n    );\n    expect(col1SortCarets).toHaveTextContent(\"\");\n\n    const col1Row0 = screen.getByTestId(\"sampleTestId-cell-row-0-col-col1\");\n    expect(col1Row0).toHaveTextContent(\"Hello\");\n\n    fireEvent.click(col1Header);\n    expect(await screen.findByText(\"\")).toBeInTheDocument();\n\n    fireEvent.click(col1Header);\n    expect(await screen.findByText(\"\")).toBeInTheDocument();\n  });\n\n  test(\"pagination isn't visible when there is no data\", async () => {\n    render(<"+"OurTable columns={columns} data={[]} />);\n    expect(screen.queryByTestId(\"testid-prev-page-button\")).toBe(null);\n    expect(screen.queryByTestId(\"testid-next-page-button\")).toBe(null);\n    expect(screen.queryByTestId(\"testid-current-page-button\")).toBe(null);\n  });\n\n  test(\"renders a table with 3 rows and tests that pagination isn't visible when there are less rows than rows per page\", async () => {\n    render(<"+"OurTable columns={columns} data={threeRows} />);\n\n    expect(screen.queryByTestId(\"testid-prev-page-button\")).toBe(null);\n    expect(screen.queryByTestId(\"testid-next-page-button\")).toBe(null);\n    expect(screen.queryByTestId(\"testid-current-page-button\")).toBe(null);\n  });\n\n  test(\"renders a table with 10 rows and tests that pagination isn't visible when there are exactly as many rows as rows per page\", async () => {\n    render(<"+"OurTable columns={columns} data={tenRows} />);\n\n    expect(screen.queryByTestId(\"testid-prev-page-button\")).toBe(null);\n    expect(screen.queryByTestId(\"testid-next-page-button\")).toBe(null);\n    expect(screen.queryByTestId(\"testid-current-page-button\")).toBe(null);\n  });\n\n  test(\"renders a table with 11 rows and tests that pagination is visible when there are more rows than rows per page\", async () => {\n    render(<"+"OurTable columns={columns} data={elevenRows} />);\n\n    expect(\n      await screen.findByTestId(\"testid-prev-page-button\"),\n    ).toBeInTheDocument();\n    expect(\n      await screen.findByTestId(\"testid-next-page-button\"),\n    ).toBeInTheDocument();\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toBeInTheDocument();\n  });\n\n  test(\"renders a table with 11 rows and clicks on the next page button and previous page button\", async () => {\n    render(<"+"OurTable columns={columns} data={elevenRows} />);\n\n    expect(\n      await screen.findByTestId(\"testid-next-page-button\"),\n    ).toBeInTheDocument();\n    const item = screen\n      .getAllByRole(\"listitem\")\n      .filter((item) => within(item).queryByText(\"Previous\"))[0];\n    expect(item).toHaveClass(\"disabled\");\n    const nextButtonItem = screen\n      .getAllByRole(\"listitem\")\n      .filter((item) => within(item).queryByText(\"Next\"))[0];\n    expect(nextButtonItem).not.toHaveClass(\"disabled\");\n    const nextButton = screen.getByTestId(\"testid-next-page-button\");\n    expect(await screen.findByText(`Hello 10`)).toBeInTheDocument();\n    expect(screen.queryByText(`Hello 11`)).not.toBeInTheDocument();\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"1\");\n    fireEvent.click(nextButton);\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"2\");\n    const newPrevious = screen\n      .getAllByRole(\"listitem\")\n      .filter((item) => within(item).queryByText(\"Previous\"))[0];\n    expect(newPrevious).not.toHaveClass(\"disabled\");\n    const newNext = screen\n      .getAllByRole(\"listitem\")\n      .filter((item) => within(item).queryByText(\"Next\"))[0];\n    expect(newNext).toHaveClass(\"disabled\");\n    expect(await screen.findByText(`Hello 11`)).toBeInTheDocument();\n    const prevButton = screen.getByTestId(\"testid-prev-page-button\");\n    fireEvent.click(prevButton);\n    expect(await screen.findByText(`Hello 1`)).toBeInTheDocument();\n  });\n\n  test(\"renders a table with 51 rows and tests the first page\", async () => {\n    render(<"+"OurTable columns={columns} data={fiftyOneRows} />);\n    expect(\n      await screen.findByTestId(\"testid-next-page-button\"),\n    ).toBeInTheDocument();\n    expect(screen.queryByTestId(\"testid-left-ellipsis\")).toBe(null);\n    expect(screen.queryByTestId(\"testid-back-three-page-button\")).toBe(null);\n    expect(screen.queryByTestId(\"testid-back-two-page-button\")).toBe(null);\n    expect(screen.queryByTestId(\"testid-back-one-page-button\")).toBe(null);\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"1\");\n    expect(\n      await screen.findByTestId(\"testid-forward-one-page-button\"),\n    ).toContainHTML(\"2\");\n    expect(\n      await screen.findByTestId(\"testid-forward-two-page-button\"),\n    ).toContainHTML(\"3\");\n    expect(screen.queryByTestId(\"testid-forward-three-page-button\")).toBe(null);\n    expect(\n      await screen.findByTestId(\"testid-right-ellipsis\"),\n    ).toBeInTheDocument();\n    expect(await screen.findByTestId(\"testid-last-page-button\")).toContainHTML(\n      \"6\",\n    );\n    expect(await screen.findByText(`Hello 10`)).toBeInTheDocument();\n  });\n\n  test(\"renders a table with 51 rows and tests moving forward and back one page\", async () => {\n    render(<"+"OurTable columns={columns} data={fiftyOneRows} />);\n\n    expect(\n      await screen.findByTestId(\"testid-forward-one-page-button\"),\n    ).toBeInTheDocument();\n    const item = screen\n      .getAllByRole(\"listitem\")\n      .filter((item) => within(item).queryByText(\"Previous\"))[0];\n    expect(item).toHaveClass(\"disabled\");\n    const nextButtonItem = screen\n      .getAllByRole(\"listitem\")\n      .filter((item) => within(item).queryByText(\"Next\"))[0];\n    expect(nextButtonItem).not.toHaveClass(\"disabled\");\n    const forwardOneButton = screen.getByTestId(\n      \"testid-forward-one-page-button\",\n    );\n    fireEvent.click(forwardOneButton);\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"2\");\n    expect(\n      await screen.findByTestId(\"testid-forward-one-page-button\"),\n    ).toContainHTML(\"3\");\n    expect(\n      await screen.findByTestId(\"testid-forward-one-page-button\"),\n    ).toBeInTheDocument();\n    expect(\n      await screen.findByTestId(\"testid-back-one-page-button\"),\n    ).toContainHTML(\"1\");\n    const backOneButton = screen.getByTestId(\"testid-back-one-page-button\");\n    fireEvent.click(backOneButton);\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"1\");\n    expect(\n      await screen.findByTestId(\"testid-forward-one-page-button\"),\n    ).toContainHTML(\"2\");\n    const lastButton = screen.getByTestId(\"testid-last-page-button\");\n    fireEvent.click(lastButton);\n    const newPrevious = screen\n      .getAllByRole(\"listitem\")\n      .filter((item) => within(item).queryByText(\"Previous\"))[0];\n    expect(newPrevious).not.toHaveClass(\"disabled\");\n    const newNext = screen\n      .getAllByRole(\"listitem\")\n      .filter((item) => within(item).queryByText(\"Next\"))[0];\n    expect(newNext).toHaveClass(\"disabled\");\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"6\");\n    expect(await screen.findByText(`Hello 51`)).toBeInTheDocument();\n    expect(screen.queryByText(`Hello 11`)).not.toBeInTheDocument();\n    expect(\n      await screen.findByTestId(\"testid-back-one-page-button\"),\n    ).toContainHTML(\"5\");\n  });\n\n  test(\"renders a table with 51 rows and tests the first and last page buttons\", async () => {\n    render(<"+"OurTable columns={columns} data={fiftyOneRows} />);\n\n    expect(\n      await screen.findByTestId(\"testid-next-page-button\"),\n    ).toBeInTheDocument();\n    const item = screen\n      .getAllByRole(\"listitem\")\n      .filter((item) => within(item).queryByText(\"Previous\"))[0];\n    expect(item).toHaveClass(\"disabled\");\n    const nextButtonItem = screen\n      .getAllByRole(\"listitem\")\n      .filter((item) => within(item).queryByText(\"Next\"))[0];\n    expect(nextButtonItem).not.toHaveClass(\"disabled\");\n    const lastButton = screen.getByTestId(\"testid-last-page-button\");\n    const rightEllipsis = screen.getByTestId(\"testid-right-ellipsis\");\n    fireEvent.click(lastButton);\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"6\");\n    expect(await screen.findByText(`Hello 51`)).toBeInTheDocument();\n    expect(rightEllipsis).not.toBeInTheDocument();\n    expect(lastButton).not.toBeInTheDocument();\n    expect(\n      await screen.findByTestId(\"testid-left-ellipsis\"),\n    ).toBeInTheDocument();\n    expect(\n      await screen.findByTestId(\"testid-back-two-page-button\"),\n    ).toContainHTML(\"4\");\n    expect(\n      await screen.findByTestId(\"testid-back-one-page-button\"),\n    ).toContainHTML(\"5\");\n    expect(await screen.findByTestId(\"testid-first-page-button\")).toContainHTML(\n      \"1\",\n    );\n    const firstButton = screen.getByTestId(\"testid-first-page-button\");\n    fireEvent.click(firstButton);\n    expect(firstButton).not.toBeInTheDocument();\n  });\n\n  test(\"renders a table with 51 rows and moving forward and back two pages\", async () => {\n    render(<"+"OurTable columns={columns} data={fiftyOneRows} />);\n\n    expect(\n      await screen.findByTestId(\"testid-next-page-button\"),\n    ).toBeInTheDocument();\n    expect(\n      await screen.findByTestId(\"testid-forward-two-page-button\"),\n    ).toContainHTML(\"3\");\n    const forwardTwoButton = screen.getByTestId(\n      \"testid-forward-two-page-button\",\n    );\n    fireEvent.click(forwardTwoButton);\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"3\");\n    const backTwoButton = screen.getByTestId(\"testid-back-two-page-button\");\n    fireEvent.click(backTwoButton);\n    expect(await screen.findByTestId(\"testid-last-page-button\")).toContainHTML(\n      \"6\",\n    );\n    expect(screen.queryByTestId(\"testid-back-two-page-button\")).toBe(null);\n    const lastButton = screen.getByTestId(\"testid-last-page-button\");\n    fireEvent.click(lastButton);\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"6\");\n    expect(screen.queryByTestId(\"testid-forward-two-page-button\")).toBe(null);\n    expect(\n      await screen.findByTestId(\"testid-back-one-page-button\"),\n    ).toContainHTML(\"5\");\n    const backOneButton = screen.getByTestId(\"testid-back-one-page-button\");\n    fireEvent.click(backOneButton);\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"5\");\n    expect(screen.queryByTestId(\"testid-left-ellipsis\")).toBe(null);\n    expect(screen.queryByTestId(\"testid-forward-two-page-button\")).toBe(null);\n    fireEvent.click(backOneButton);\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"4\");\n    expect(\n      await screen.findByTestId(\"testid-forward-two-page-button\"),\n    ).toContainHTML(\"6\");\n    fireEvent.click(await screen.findByTestId(\"testid-back-two-page-button\"));\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"2\");\n    expect(screen.queryByTestId(\"testid-back-two-page-button\")).toBe(null);\n    fireEvent.click(await screen.findByTestId(\"testid-next-page-button\"));\n    expect(\n      await screen.findByTestId(\"testid-back-two-page-button\"),\n    ).toContainHTML(\"1\");\n  });\n\n  test(\"renders a table with 41 rows and moving forward and back three pages\", async () => {\n    render(<"+"OurTable columns={columns} data={fortyOneRows} />);\n\n    expect(screen.queryByTestId(\"testid-back-three-page-button\")).toBe(null);\n    const forwardThreeButton = screen.getByTestId(\n      \"testid-forward-three-page-button\",\n    );\n    fireEvent.click(forwardThreeButton);\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"4\");\n    expect(screen.queryByTestId(\"testid-forward-three-page-button\")).toBe(null);\n    expect(screen.queryByTestId(\"testid-first-page-button\")).toBe(null);\n    fireEvent.click(screen.getByTestId(\"testid-forward-one-page-button\"));\n    expect(\n      await screen.findByTestId(\"testid-back-three-page-button\"),\n    ).toContainHTML(\"2\");\n    const backThreeButton = screen.getByTestId(\"testid-back-three-page-button\");\n    fireEvent.click(backThreeButton);\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"2\");\n    expect(screen.queryByTestId(\"testid-back-three-page-button\")).toBe(null);\n    const forwardOneButton = screen.getByTestId(\n      \"testid-forward-one-page-button\",\n    );\n    fireEvent.click(forwardOneButton);\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"3\");\n    expect(screen.queryByTestId(\"testid-forward-three-page-button\")).toBe(null);\n    expect(screen.queryByTestId(\"testid-back-three-page-button\")).toBe(null);\n    fireEvent.click(forwardOneButton);\n    expect(\n      await screen.findByTestId(\"testid-current-page-button\"),\n    ).toContainHTML(\"4\");\n    expect(screen.queryByTestId(\"testid-forward-three-page-button\")).toBe(null);\n    expect(screen.queryByTestId(\"testid-back-three-page-button\")).toBe(null);\n  });\n});\n"},"src/tests/components/Commons/CommonsForm.test.jsx":{"tests":[{"id":"78","name":"CommonsForm tests renders correctly"},{"id":"79","name":"CommonsForm tests has validation errors for required fields"},{"id":"80","name":"CommonsForm tests Check Default Values and correct styles"},{"id":"81","name":"CommonsForm tests has validation errors for values out of range"},{"id":"82","name":"CommonsForm tests renders correctly when an initialCommons is passed in"},{"id":"83","name":"CommonsForm tests renders correctly with date cut off"},{"id":"84","name":"CommonsForm tests renders correctly when an initialCommons is not passed in"},{"id":"85","name":"CommonsForm tests the correct parameters are passed to useBackend"},{"id":"86","name":"CommonsForm tests populates form fields with default values when initialCommons is not provided"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { MemoryRouter as Router } from \"react-router\";\nimport CommonsForm from \"main/components/Commons/CommonsForm\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport commonsFixtures from \"fixtures/commonsFixtures\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport axios from \"axios\";\nimport healthUpdateStrategyListFixtures from \"fixtures/healthUpdateStrategyListFixtures\";\nimport { vi } from \"vitest\";\n\n// Next line uses technique from https://www.chakshunyu.com/blog/how-to-spy-on-a-named-import-in-jest/\nimport * as useBackendModule from \"main/utils/useBackend\";\n\nconst mockedNavigate = vi.fn();\n\nvi.mock(\"react-router\", async () => ({\n  ...(await vi.importActual(\"react-router\")),\n  useNavigate: () => mockedNavigate,\n}));\n\ndescribe(\"CommonsForm tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    vi.clearAllMocks();\n  });\n\n  it(\"renders correctly\", async () => {\n    const submitAction = vi.fn();\n\n    axiosMock\n      .onGet(\"/api/commons/all-health-update-strategies\")\n      .reply(200, healthUpdateStrategyListFixtures.real);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"CommonsForm submitAction={submitAction} />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(/Commons Name/)).toBeInTheDocument();\n\n    [\n      /Starting Balance/,\n      /Cow Price/,\n      /Milk Price/,\n      /Starting Date/,\n      /Last Date/,\n      /Degradation Rate/,\n      /Capacity Per User/,\n      /Carrying Capacity/,\n      /Show Leaderboard\\?/,\n      /When below capacity/,\n      /When above capacity/,\n    ].forEach((pattern) => {\n      expect(screen.getByText(pattern)).toBeInTheDocument();\n    });\n    expect(screen.getByText(/Create/)).toBeInTheDocument();\n    expect(screen.getByTestId(\"CommonsForm-Submit-Button\")).toHaveTextContent(\n      \"Create\",\n    );\n  });\n\n  it(\"has validation errors for required fields\", async () => {\n    const submitAction = vi.fn();\n\n    axiosMock\n      .onGet(\"/api/commons/all-health-update-strategies\")\n      .reply(200, healthUpdateStrategyListFixtures.real);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"CommonsForm\n            submitAction={submitAction}\n            buttonLabel=\"Create New Commons\"\n          />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByTestId(\"CommonsForm-name\")).toBeInTheDocument();\n    const submitButton = screen.getByTestId(\"CommonsForm-Submit-Button\");\n    expect(submitButton).toBeInTheDocument();\n    expect(screen.getByTestId(\"CommonsForm-Submit-Button\")).toHaveTextContent(\n      \"Create New Commons\",\n    );\n\n    fireEvent.change(screen.getByTestId(\"CommonsForm-degradationRate\"), {\n      target: { value: \"\" },\n    });\n    fireEvent.change(screen.getByTestId(\"CommonsForm-carryingCapacity\"), {\n      target: { value: \"\" },\n    });\n\n    //Check default empty field\n    fireEvent.click(submitButton);\n    expect(\n      await screen.findByText(\"Commons name is required\"),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByText(\"Degradation rate is required\"),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByText(\"Carrying capacity is required\"),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByText(\"Capacity Per User is required\"),\n    ).toBeInTheDocument();\n\n    //Clear Default Values\n    fireEvent.change(screen.getByTestId(\"CommonsForm-milkPrice\"), {\n      target: { value: \"\" },\n    });\n    fireEvent.change(screen.getByTestId(\"CommonsForm-cowPrice\"), {\n      target: { value: \"\" },\n    });\n    fireEvent.change(screen.getByTestId(\"CommonsForm-startingBalance\"), {\n      target: { value: \"\" },\n    });\n    expect(\n      await screen.findByText(\"Cow price is required\"),\n    ).toBeInTheDocument();\n    expect(screen.getByText(\"Milk price is required\")).toBeInTheDocument();\n    expect(\n      screen.getByText(\"Starting Balance is required\"),\n    ).toBeInTheDocument();\n\n    //Reset to Invalid Values\n    fireEvent.change(screen.getByTestId(\"CommonsForm-milkPrice\"), {\n      target: { value: \"-1\" },\n    });\n    fireEvent.change(screen.getByTestId(\"CommonsForm-cowPrice\"), {\n      target: { value: \"-1\" },\n    });\n    fireEvent.change(screen.getByTestId(\"CommonsForm-startingBalance\"), {\n      target: { value: \"-1\" },\n    });\n    fireEvent.change(screen.getByTestId(\"CommonsForm-startingDate\"), {\n      target: { value: NaN },\n    });\n    fireEvent.change(screen.getByTestId(\"CommonsForm-lastDate\"), {\n      target: { value: NaN },\n    });\n    fireEvent.click(submitButton);\n\n    //Await\n    await screen.findByTestId(\"CommonsForm-milkPrice\");\n\n    [\n      \"CommonsForm-name\",\n      \"CommonsForm-degradationRate\",\n      \"CommonsForm-capacityPerUser\",\n      \"CommonsForm-carryingCapacity\",\n      \"CommonsForm-milkPrice\",\n      \"CommonsForm-cowPrice\",\n      \"CommonsForm-startingBalance\",\n      \"CommonsForm-startingDate\",\n      \"CommonsForm-lastDate\",\n    ].forEach((item) => {\n      const element = screen.getByTestId(item);\n      expect(element).toBeInTheDocument();\n      expect(element).toHaveClass(\"is-invalid\");\n    });\n\n    // check that the other testids are present\n\n    [\"CommonsForm-showLeaderboard\", \"CommonsForm-showChat\"].forEach(\n      (testid) => {\n        const element = screen.getByTestId(testid);\n        expect(element).toBeInTheDocument();\n      },\n    );\n\n    expect(submitAction).not.toBeCalled();\n  });\n\n  it(\"Check Default Values and correct styles\", async () => {\n    const curr = new Date();\n    const today = curr.toLocaleDateString(\"en-CA\"); // Canadian english gives YYYY-MM-DD\n    const currMonth = curr.getMonth() % 12;\n    const nextMonth = new Date(\n      curr.getFullYear(),\n      currMonth + 1,\n      curr.getDate(),\n    )\n      .toISOString()\n      .substr(0, 10);\n    const DefaultVals = {\n      name: \"\",\n      startingBalance: 10000,\n      cowPrice: 100,\n      milkPrice: 1,\n      degradationRate: 0.001,\n      carryingCapacity: 100,\n      startingDate: today,\n      lastDate: nextMonth,\n    };\n\n    axiosMock\n      .onGet(\"/api/commons/all-health-update-strategies\")\n      .reply(200, healthUpdateStrategyListFixtures.real);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"CommonsForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByTestId(\"CommonsForm-name\")).toBeInTheDocument();\n    [\n      \"name\",\n      \"degradationRate\",\n      \"carryingCapacity\",\n      \"milkPrice\",\n      \"cowPrice\",\n      \"startingBalance\",\n      \"startingDate\",\n      \"lastDate\",\n    ].forEach((item) => {\n      const element = screen.getByTestId(`CommonsForm-${item}`);\n      expect(element).toHaveValue(DefaultVals[item]);\n    });\n\n    // Check Style\n    expect(screen.getByTestId(\"CommonsForm-r0\")).toHaveStyle(\"width: 80%\");\n    expect(screen.getByTestId(\"CommonsForm-r1\")).toHaveStyle(\"width: 80%\");\n    expect(screen.getByTestId(\"CommonsForm-r2\")).toHaveStyle(\"width: 80%\");\n    expect(screen.getByTestId(\"CommonsForm-r3\")).toHaveStyle(\"width: 300px\");\n    expect(screen.getByTestId(\"CommonsForm-r3\")).toHaveStyle(\"height: 50px\");\n    expect(screen.getByTestId(\"CommonsForm-r4\")).toHaveStyle(\"width: 300px\");\n    expect(screen.getByTestId(\"CommonsForm-r4\")).toHaveStyle(\"height: 50px\");\n    expect(screen.getByTestId(\"CommonsForm-Submit-Button\")).toHaveStyle(\n      \"width: 30%\",\n    );\n  });\n\n  it(\"has validation errors for values out of range\", async () => {\n    const submitAction = vi.fn();\n\n    axiosMock\n      .onGet(\"/api/commons/all-health-update-strategies\")\n      .reply(200, healthUpdateStrategyListFixtures.real);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"CommonsForm submitAction={submitAction} buttonLabel=\"Create\" />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(\"CommonsForm-Submit-Button\"),\n    ).toBeInTheDocument();\n    const submitButton = screen.getByTestId(\"CommonsForm-Submit-Button\");\n    expect(submitButton).toBeInTheDocument();\n\n    fireEvent.change(screen.getByTestId(\"CommonsForm-startingBalance\"), {\n      target: { value: \"-1\" },\n    });\n    fireEvent.click(submitButton);\n    await screen.findByText(/Starting Balance must be  0.00/i);\n\n    fireEvent.change(screen.getByTestId(\"CommonsForm-cowPrice\"), {\n      target: { value: \"-1\" },\n    });\n    fireEvent.click(submitButton);\n    await screen.findByText(/Cow price must be  0.01/i);\n\n    fireEvent.change(screen.getByTestId(\"CommonsForm-milkPrice\"), {\n      target: { value: \"-1\" },\n    });\n    fireEvent.click(submitButton);\n    await screen.findByText(/Milk price must be  0.01/i);\n\n    fireEvent.change(screen.getByTestId(\"CommonsForm-degradationRate\"), {\n      target: { value: \"-1\" },\n    });\n    fireEvent.click(submitButton);\n    await screen.findByText(/Degradation rate must be  0/i);\n\n    fireEvent.change(screen.getByTestId(\"CommonsForm-carryingCapacity\"), {\n      target: { value: \"-1\" },\n    });\n    fireEvent.click(submitButton);\n    await screen.findByText(/Carrying Capacity must be  1/i);\n\n    expect(submitAction).not.toBeCalled();\n  });\n\n  it(\"renders correctly when an initialCommons is passed in\", async () => {\n    axiosMock\n      .onGet(\"/api/commons/all-health-update-strategies\")\n      .reply(200, healthUpdateStrategyListFixtures.real);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"CommonsForm initialCommons={commonsFixtures.threeCommons[0]} />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(/Id/)).toBeInTheDocument();\n\n    expect(screen.getByTestId(\"CommonsForm-id\")).toHaveValue(\n      `${commonsFixtures.threeCommons[0].id}`,\n    );\n    expect(screen.getByTestId(\"CommonsForm-name\")).toHaveValue(\n      commonsFixtures.threeCommons[0].name,\n    );\n    expect(screen.getByTestId(\"CommonsForm-startingBalance\")).toHaveValue(\n      commonsFixtures.threeCommons[0].startingBalance,\n    );\n    expect(screen.getByTestId(\"CommonsForm-cowPrice\")).toHaveValue(\n      commonsFixtures.threeCommons[0].cowPrice,\n    );\n\n    await screen.findByTestId(\"aboveCapacityHealthUpdateStrategy-Noop\");\n    expect(\n      screen.getByTestId(\"belowCapacityHealthUpdateStrategy-Noop\"),\n    ).toBeInTheDocument();\n  });\n\n  it(\"renders correctly with date cut off\", async () => {\n    axiosMock\n      .onGet(\"/api/commons/all-health-update-strategies\")\n      .reply(200, healthUpdateStrategyListFixtures.real);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"CommonsForm initialCommons={commonsFixtures.threeCommons[0]} />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(/Id/)).toBeInTheDocument();\n    expect(screen.getByTestId(\"CommonsForm-startingDate\")).toHaveValue(\n      commonsFixtures.threeCommons[0].startingDate.split(\"T\")[0],\n    );\n  });\n\n  it(\"renders correctly when an initialCommons is not passed in\", async () => {\n    const curr = new Date();\n    const today = curr.toLocaleDateString(\"en-CA\"); // Canadian english gives YYYY-MM-DD\n    const currMonth = curr.getMonth() % 12;\n    const nextMonth = new Date(\n      curr.getFullYear(),\n      currMonth + 1,\n      curr.getDate(),\n    )\n      .toISOString()\n      .substr(0, 10);\n    const DefaultVals = {\n      name: \"\",\n      startingBalance: 10000,\n      cowPrice: 100,\n      milkPrice: 1,\n      degradationRate: 0.001,\n      carryingCapacity: 100,\n      startingDate: today,\n      lastDate: nextMonth,\n      aboveCapacityStrategy: \"Linear\",\n      belowCapacityStrategy: \"Constant\",\n    };\n    axiosMock\n      .onGet(\"/api/commons/all-health-update-strategies\")\n      .reply(200, healthUpdateStrategyListFixtures.real);\n    axiosMock.onGet(\"/api/commons/defaults\").reply(200, DefaultVals);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"CommonsForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByTestId(\"CommonsForm-name\")).toBeInTheDocument();\n    [\n      \"name\",\n      \"degradationRate\",\n      \"carryingCapacity\",\n      \"milkPrice\",\n      \"cowPrice\",\n      \"startingBalance\",\n      \"startingDate\",\n      \"lastDate\",\n    ].forEach((item) => {\n      const element = screen.getByTestId(`CommonsForm-${item}`);\n      expect(element).toHaveValue(DefaultVals[item]);\n    });\n    expect(await screen.findByText(/When below capacity/)).toBeInTheDocument();\n\n    expect(\n      screen.getByTestId(\"aboveCapacityHealthUpdateStrategy-Linear\"),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByTestId(\"aboveCapacityHealthUpdateStrategy-Linear\"),\n    ).toHaveAttribute(\"selected\");\n    expect(\n      screen.getByTestId(\"belowCapacityHealthUpdateStrategy-Constant\"),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByTestId(\"belowCapacityHealthUpdateStrategy-Constant\"),\n    ).toHaveAttribute(\"selected\");\n  });\n\n  test(\"the correct parameters are passed to useBackend\", async () => {\n    axiosMock\n      .onGet(\"/api/commons/all-health-update-strategies\")\n      .reply(200, healthUpdateStrategyListFixtures.real);\n\n    // https://www.chakshunyu.com/blog/how-to-spy-on-a-named-import-in-jest/\n    const useBackendSpy = vi.spyOn(useBackendModule, \"useBackend\");\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"CommonsForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(useBackendSpy).toHaveBeenCalledWith(\n        \"/api/commons/all-health-update-strategies\",\n        {\n          method: \"GET\",\n          url: \"/api/commons/all-health-update-strategies\",\n        },\n      );\n    });\n  });\n\n  test(\"populates form fields with default values when initialCommons is not provided\", async () => {\n    const curr = new Date();\n    const today = curr.toLocaleDateString(\"en-CA\"); // Canadian english gives YYYY-MM-DD\n    const currMonth = curr.getMonth() % 12;\n    const nextMonth = new Date(\n      curr.getFullYear(),\n      currMonth + 1,\n      curr.getDate(),\n    )\n      .toISOString()\n      .substr(0, 10);\n    const defaultValuesData = {\n      name: \"\",\n      startingBalance: 10000,\n      cowPrice: 100,\n      milkPrice: 1,\n      degradationRate: 0.001,\n      carryingCapacity: 100,\n      startingDate: today,\n      lastDate: nextMonth,\n    };\n\n    vi.spyOn(useBackendModule, \"useBackend\").mockReturnValue({\n      data: defaultValuesData,\n    });\n\n    vi.spyOn(useBackendModule, \"useBackend\").mockReturnValue({\n      data: healthUpdateStrategyListFixtures.real,\n    });\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"CommonsForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(\"CommonsForm-startingBalance\"),\n    ).toHaveValue(defaultValuesData.startingBalance);\n    expect(screen.getByTestId(\"CommonsForm-name\")).toHaveValue(\n      defaultValuesData.name,\n    );\n    expect(screen.getByTestId(\"CommonsForm-cowPrice\")).toHaveValue(\n      defaultValuesData.cowPrice,\n    );\n    expect(screen.getByTestId(\"CommonsForm-milkPrice\")).toHaveValue(\n      defaultValuesData.milkPrice,\n    );\n    expect(screen.getByTestId(\"CommonsForm-degradationRate\")).toHaveValue(\n      defaultValuesData.degradationRate,\n    );\n    expect(screen.getByTestId(\"CommonsForm-carryingCapacity\")).toHaveValue(\n      defaultValuesData.carryingCapacity,\n    );\n    expect(screen.getByTestId(\"CommonsForm-startingDate\")).toHaveValue(\n      defaultValuesData.startingDate,\n    );\n    expect(screen.getByTestId(\"CommonsForm-lastDate\")).toHaveValue(\n      defaultValuesData.lastDate,\n    );\n  });\n});\n"},"src/tests/components/Chat/ChatDisplay.test.jsx":{"tests":[{"id":"87","name":"ChatDisplay tests renders without crashing"},{"id":"88","name":"ChatDisplay tests displays no messages correctly"},{"id":"89","name":"ChatDisplay tests displays three messages correctly with usernames in the correct order"},{"id":"90","name":"ChatDisplay tests displays one message correctly without usernames"},{"id":"91","name":"ChatDisplay tests displays at most 10 messages and shows history link when more exist"},{"id":"92","name":"ChatDisplay tests shows history link when totalElements indicates more messages than returned"},{"id":"93","name":"ChatDisplay tests does not show history link when totalElements equals initial page size"},{"id":"94","name":"ChatDisplay tests history link points to the commons specific route"},{"id":"95","name":"ChatDisplay tests history link applies the expected styling"},{"id":"96","name":"ChatDisplay tests ignores chat responses whose content field is not an array"},{"id":"97","name":"ChatDisplay tests handles user commons responses that are not arrays"},{"id":"98","name":"ChatDisplay tests renders when chat messages response is undefined"},{"id":"99","name":"ChatDisplay tests configures chat and user commons queries with expected arguments"}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport { vi } from \"vitest\";\n\nimport ChatDisplay from \"main/components/Chat/ChatDisplay\";\nimport userCommonsFixtures from \"fixtures/userCommonsFixtures\";\nimport { chatMessageFixtures } from \"fixtures/chatMessageFixtures\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport * as useBackendModule from \"main/utils/useBackend\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\ndescribe(\"ChatDisplay tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  const commonsId = 1;\n  const renderChatDisplay = () =>\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"MemoryRouter>\n          <"+"ChatDisplay commonsId={commonsId} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  afterEach(() => {\n    vi.restoreAllMocks();\n  });\n\n  test(\"renders without crashing\", async () => {\n    renderChatDisplay();\n\n    await waitFor(() => {\n      expect(screen.getByTestId(\"ChatDisplay\")).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(\"ChatDisplay\")).toHaveStyle(\"overflowY: scroll\");\n    expect(screen.getByTestId(\"ChatDisplay\")).toHaveStyle(\"maxHeight: 300px\");\n    expect(screen.getByTestId(\"ChatDisplay\")).toHaveStyle(\"display: flex\");\n    expect(screen.getByTestId(\"ChatDisplay\")).toHaveStyle(\n      \"flexDirection: column-reverse\",\n    );\n  });\n\n  test(\"displays no messages correctly\", async () => {\n    //arrange\n\n    //act\n    renderChatDisplay();\n    //assert\n\n    //assert\n\n    await waitFor(() => {\n      expect(screen.getByTestId(\"ChatDisplay\")).toBeInTheDocument();\n    });\n\n    expect(screen.queryByText(\"Anonymous\")).not.toBeInTheDocument();\n    expect(screen.queryByText(\"George Washington (1)\")).not.toBeInTheDocument();\n    expect(screen.queryByText(\"Hello World\")).not.toBeInTheDocument();\n    expect(screen.queryByText(\"2023-08-17 23:57:46\")).not.toBeInTheDocument();\n  });\n\n  test(\"displays three messages correctly with usernames in the correct order\", async () => {\n    //arrange\n\n    axiosMock\n      .onGet(\"/api/chat/get\")\n      .reply(200, { content: chatMessageFixtures.threeChatMessages });\n    axiosMock\n      .onGet(\"/api/usercommons/commons/all\")\n      .reply(200, userCommonsFixtures.threeUserCommons);\n\n    //act\n    renderChatDisplay();\n\n    //assert\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(2);\n    });\n    expect(axiosMock.history.get[0].url).toBe(\"/api/chat/get\");\n    expect(axiosMock.history.get[0].params).toEqual({\n      commonsId: 1,\n      page: 0,\n      size: 10,\n    });\n    expect(axiosMock.history.get[1].url).toBe(\"/api/usercommons/commons/all\");\n    expect(axiosMock.history.get[1].params).toEqual({ commonsId: 1 });\n\n    const container = screen.getByTestId(\"ChatDisplay\");\n\n    await waitFor(() => {\n      expect(container.children[2].getAttribute(\"data-testid\")).toBe(\n        \"ChatMessageDisplay-1\",\n      );\n    });\n    expect(container.children[1].getAttribute(\"data-testid\")).toBe(\n      \"ChatMessageDisplay-2\",\n    );\n    expect(container.children[0].getAttribute(\"data-testid\")).toBe(\n      \"ChatMessageDisplay-3\",\n    );\n\n    expect(screen.getByTestId(\"ChatMessageDisplay-1-User\")).toHaveTextContent(\n      \"George Washington\",\n    );\n    expect(\n      screen.getByTestId(\"ChatMessageDisplay-1-Message\"),\n    ).toHaveTextContent(\"Hello World\");\n    expect(screen.getByTestId(\"ChatMessageDisplay-1-Date\")).toHaveTextContent(\n      \"2023-08-17 23:57:46\",\n    );\n\n    expect(screen.getByTestId(\"ChatMessageDisplay-2-User\")).toHaveTextContent(\n      \"Thomas Jefferson\",\n    );\n    expect(\n      screen.getByTestId(\"ChatMessageDisplay-2-Message\"),\n    ).toHaveTextContent(\"Hello World How are you doing???\");\n    expect(screen.getByTestId(\"ChatMessageDisplay-2-Date\")).toHaveTextContent(\n      \"2023-08-18 02:59:11\",\n    );\n\n    expect(screen.getByTestId(\"ChatMessageDisplay-3-User\")).toHaveTextContent(\n      \"John Adams\",\n    );\n    expect(\n      screen.getByTestId(\"ChatMessageDisplay-3-Message\"),\n    ).toHaveTextContent(\"This is another test for chat messaging\");\n    expect(screen.getByTestId(\"ChatMessageDisplay-3-Date\")).toHaveTextContent(\n      \"2023-08-18 02:59:28\",\n    );\n\n    expect(\n      screen.queryByTestId(\"ChatDisplay-HistoryLink\"),\n    ).not.toBeInTheDocument();\n  });\n\n  test(\"displays one message correctly without usernames\", async () => {\n    //arrange\n\n    axiosMock\n      .onGet(\"/api/chat/get\")\n      .reply(200, { content: chatMessageFixtures.oneChatMessage });\n    axiosMock.onGet(\"/api/usercommons/commons/all\").reply(200, [{ userId: 1 }]);\n\n    //act\n    renderChatDisplay();\n\n    //assert\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBe(2);\n    });\n    expect(axiosMock.history.get[0].url).toBe(\"/api/chat/get\");\n    expect(axiosMock.history.get[0].params).toEqual({\n      commonsId: 1,\n      page: 0,\n      size: 10,\n    });\n    expect(axiosMock.history.get[1].url).toBe(\"/api/usercommons/commons/all\");\n    expect(axiosMock.history.get[1].params).toEqual({ commonsId: 1 });\n\n    await waitFor(() => {\n      expect(screen.getByTestId(\"ChatMessageDisplay-1\")).toBeInTheDocument();\n    });\n    expect(screen.getByTestId(\"ChatMessageDisplay-1-User\")).toHaveTextContent(\n      \"Anonymous\",\n    );\n    expect(\n      screen.getByTestId(\"ChatMessageDisplay-1-Message\"),\n    ).toHaveTextContent(\"Hello World\");\n    expect(screen.getByTestId(\"ChatMessageDisplay-1-Date\")).toHaveTextContent(\n      \"2023-08-17 23:57:46\",\n    );\n\n    expect(\n      screen.queryByTestId(\"ChatDisplay-HistoryLink\"),\n    ).not.toBeInTheDocument();\n  });\n\n  test(\"displays at most 10 messages and shows history link when more exist\", async () => {\n    //arrange\n\n    axiosMock\n      .onGet(\"/api/chat/get\")\n      .reply(200, { content: chatMessageFixtures.twelveChatMessages });\n    axiosMock\n      .onGet(\"/api/usercommons/commons/all\")\n      .reply(200, userCommonsFixtures.threeUserCommons);\n\n    //act\n    renderChatDisplay();\n\n    //assert\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBe(2);\n    });\n    expect(axiosMock.history.get[0].url).toBe(\"/api/chat/get\");\n    expect(axiosMock.history.get[0].params).toEqual({\n      commonsId: 1,\n      page: 0,\n      size: 10,\n    });\n    expect(axiosMock.history.get[1].url).toBe(\"/api/usercommons/commons/all\");\n    expect(axiosMock.history.get[1].params).toEqual({ commonsId: 1 });\n\n    await waitFor(() => {\n      expect(screen.getByTestId(\"ChatMessageDisplay-12\")).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(\"ChatMessageDisplay-11\")).toBeInTheDocument();\n    expect(screen.getByTestId(\"ChatMessageDisplay-3\")).toBeInTheDocument();\n\n    expect(\n      screen.queryByTestId(\"ChatMessageDisplay-2\"),\n    ).not.toBeInTheDocument();\n    expect(\n      screen.queryByTestId(\"ChatMessageDisplay-1\"),\n    ).not.toBeInTheDocument();\n\n    expect(screen.getByTestId(\"ChatDisplay-HistoryLink\")).toBeInTheDocument();\n\n    expect(screen.getByText(\"This should appear, though\")).toBeInTheDocument();\n    expect(screen.getByText(\"This one too!\")).toBeInTheDocument();\n  });\n\n  test(\"shows history link when totalElements indicates more messages than returned\", async () => {\n    axiosMock.onGet(\"/api/chat/get\").reply(200, {\n      content: chatMessageFixtures.twelveChatMessages.slice(0, 10),\n      totalElements: 12,\n    });\n    axiosMock\n      .onGet(\"/api/usercommons/commons/all\")\n      .reply(200, userCommonsFixtures.threeUserCommons);\n\n    renderChatDisplay();\n\n    await waitFor(() => {\n      expect(screen.getByTestId(\"ChatMessageDisplay-10\")).toBeInTheDocument();\n    });\n\n    expect(\n      screen.queryByTestId(\"ChatMessageDisplay-11\"),\n    ).not.toBeInTheDocument();\n    expect(screen.getByTestId(\"ChatDisplay-HistoryLink\")).toBeInTheDocument();\n  });\n\n  test(\"does not show history link when totalElements equals initial page size\", async () => {\n    axiosMock.onGet(\"/api/chat/get\").reply(200, {\n      content: chatMessageFixtures.twelveChatMessages.slice(0, 10),\n      totalElements: 10,\n    });\n    axiosMock\n      .onGet(\"/api/usercommons/commons/all\")\n      .reply(200, userCommonsFixtures.threeUserCommons);\n\n    renderChatDisplay();\n\n    await waitFor(() => {\n      expect(screen.getByTestId(\"ChatMessageDisplay-10\")).toBeInTheDocument();\n    });\n\n    expect(\n      screen.queryByTestId(\"ChatDisplay-HistoryLink\"),\n    ).not.toBeInTheDocument();\n  });\n\n  test(\"history link points to the commons specific route\", async () => {\n    axiosMock.onGet(\"/api/chat/get\").reply(200, {\n      content: chatMessageFixtures.twelveChatMessages,\n      totalElements: 12,\n    });\n    axiosMock\n      .onGet(\"/api/usercommons/commons/all\")\n      .reply(200, userCommonsFixtures.threeUserCommons);\n\n    renderChatDisplay();\n\n    const historyLink = await screen.findByRole(\"link\", {\n      name: /view full chat history/i,\n    });\n\n    expect(historyLink).toHaveAttribute(\"href\", \"/chat/1\");\n  });\n\n  test(\"history link applies the expected styling\", async () => {\n    axiosMock.onGet(\"/api/chat/get\").reply(200, {\n      content: chatMessageFixtures.twelveChatMessages,\n      totalElements: 12,\n    });\n    axiosMock\n      .onGet(\"/api/usercommons/commons/all\")\n      .reply(200, userCommonsFixtures.threeUserCommons);\n\n    renderChatDisplay();\n\n    const historyLinkContainer = await screen.findByTestId(\n      \"ChatDisplay-HistoryLink\",\n    );\n    expect(historyLinkContainer).toHaveStyle(\"text-align: center\");\n    expect(historyLinkContainer).toHaveStyle(\"padding: 0.75rem 0 0.25rem\");\n    expect(historyLinkContainer).toHaveStyle(\"font-size: 0.9rem\");\n    expect(historyLinkContainer).toHaveStyle(\"color: #0d6efd\");\n\n    const link = await screen.findByRole(\"link\", {\n      name: /view full chat history/i,\n    });\n    expect(link).toHaveStyle(\"text-decoration: none\");\n  });\n\n  test(\"ignores chat responses whose content field is not an array\", async () => {\n    axiosMock.onGet(\"/api/chat/get\").reply(200, { content: \"invalid\" });\n    axiosMock\n      .onGet(\"/api/usercommons/commons/all\")\n      .reply(200, userCommonsFixtures.threeUserCommons);\n\n    renderChatDisplay();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(2);\n    });\n\n    const container = screen.getByTestId(\"ChatDisplay\");\n    await waitFor(() => {\n      expect(container.children.length).toBe(0);\n    });\n    expect(\n      screen.queryByTestId(\"ChatDisplay-HistoryLink\"),\n    ).not.toBeInTheDocument();\n  });\n\n  test(\"handles user commons responses that are not arrays\", async () => {\n    const useBackendSpy = vi.spyOn(useBackendModule, \"useBackend\");\n    useBackendSpy.mockImplementation((queryKey) => {\n      const key = Array.isArray(queryKey) ? queryKey[0] : \"\";\n      if (key?.startsWith(\"/api/chat/get\")) {\n        return {\n          data: {\n            content: chatMessageFixtures.oneChatMessage,\n            totalElements: 1,\n          },\n        };\n      }\n      if (key?.startsWith(\"/api/currentUser\")) {\n        return { data: { root: { user: { id: 1 }, roles: [] } } };\n      }\n      if (key?.startsWith(\"/api/usercommons/commons/all\")) {\n        return { data: { invalid: true } };\n      }\n      return { data: [] };\n    });\n\n    renderChatDisplay();\n\n    await waitFor(() => {\n      expect(screen.getByTestId(\"ChatMessageDisplay-1\")).toBeInTheDocument();\n    });\n    expect(screen.getByTestId(\"ChatMessageDisplay-1-User\")).toHaveTextContent(\n      \"Anonymous\",\n    );\n  });\n\n  test(\"renders when chat messages response is undefined\", async () => {\n    const useBackendSpy = vi.spyOn(useBackendModule, \"useBackend\");\n    useBackendSpy.mockImplementation((queryKey) => {\n      const key = Array.isArray(queryKey) ? queryKey[0] : \"\";\n      if (key?.startsWith(\"/api/chat/get\")) {\n        return { data: undefined };\n      }\n      return { data: [] };\n    });\n\n    renderChatDisplay();\n\n    await waitFor(() => {\n      expect(screen.getByTestId(\"ChatDisplay\")).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(\"ChatDisplay\").children.length).toBe(0);\n    expect(\n      screen.queryByTestId(\"ChatDisplay-HistoryLink\"),\n    ).not.toBeInTheDocument();\n  });\n\n  test(\"configures chat and user commons queries with expected arguments\", () => {\n    const useBackendSpy = vi.spyOn(useBackendModule, \"useBackend\");\n    useBackendSpy\n      .mockReturnValueOnce({ data: { content: [], totalElements: 0 } })\n      .mockReturnValueOnce({ data: [] });\n\n    renderChatDisplay();\n\n    expect(useBackendSpy).toHaveBeenNthCalledWith(\n      1,\n      [`/api/chat/get?page=0&size=10&commonsId=${commonsId}`],\n      {\n        method: \"GET\",\n        url: \"/api/chat/get\",\n        params: {\n          commonsId,\n          page: 0,\n          size: 10,\n        },\n      },\n      { content: [], totalElements: 0 },\n      { refetchInterval: 2000 },\n    );\n    expect(useBackendSpy).toHaveBeenNthCalledWith(\n      2,\n      [`/api/usercommons/commons/all`],\n      {\n        method: \"GET\",\n        url: \"/api/usercommons/commons/all\",\n        params: { commonsId },\n      },\n      [],\n      { refetchInterval: 2000 },\n    );\n  });\n});\n"},"src/tests/pages/AdminJobsPage.test.jsx":{"tests":[{"id":"100","name":"AdminJobsPage tests renders without crashing"},{"id":"101","name":"AdminJobsPage tests user can submit a test job"},{"id":"102","name":"AdminJobsPage tests user can submit a set cow health job"},{"id":"103","name":"AdminJobsPage tests user can submit update cow health job"},{"id":"104","name":"AdminJobsPage tests user can submit update cow health job for all commons"},{"id":"105","name":"AdminJobsPage tests user can submit milk the cows job"},{"id":"106","name":"AdminJobsPage tests user can submit milk the cows job for all commons"},{"id":"107","name":"AdminJobsPage tests user can submit instructor report job"},{"id":"108","name":"AdminJobsPage tests user can submit instructor report (specific commons) job"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport AdminJobsPage from \"main/pages/AdminJobsPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport pagedJobsFixtures from \"fixtures/pagedJobsFixtures\";\nimport commonsFixtures from \"../../fixtures/commonsFixtures\";\nimport { vi } from \"vitest\";\n\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async () => {\n  const originalModule = await vi.importActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"AdminJobsPage tests\", () => {\n  let queryClient = new QueryClient();\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    queryClient = new QueryClient();\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.adminUser);\n    axiosMock\n      .onGet(\"/api/jobs/all/pageable\")\n      .reply(200, pagedJobsFixtures.onePage);\n\n    // see: https://ucsb-cs156.github.io/topics/testing/testing_jest.html#hiding-the-wall-of-red\n    vi.spyOn(console, \"error\");\n    console.error.mockImplementation(() => null);\n  });\n\n  afterEach(() => {\n    // see: https://ucsb-cs156.github.io/topics/testing/testing_jest.html#hiding-the-wall-of-red\n    console.error.mockRestore();\n  });\n\n  test(\"renders without crashing\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    expect(await screen.findByText(\"Launch Jobs\")).toBeInTheDocument();\n    expect(await screen.findByText(\"Job Status\")).toBeInTheDocument();\n\n    expect(await screen.findByText(\"Test Job\")).toBeInTheDocument();\n    expect(\n      await screen.findByText(\"Set Cow Health for a Specific Commons\"),\n    ).toBeInTheDocument();\n    expect(await screen.findByText(\"Update Cow Health\")).toBeInTheDocument();\n    expect(await screen.findByText(\"Milk The Cows\")).toBeInTheDocument();\n    expect(await screen.findByText(\"Instructor Report\")).toBeInTheDocument();\n  });\n\n  test(\"user can submit a test job\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(\"Test Job\")).toBeInTheDocument();\n\n    const testJobButton = screen.getByText(\"Test Job\");\n    expect(testJobButton).toBeInTheDocument();\n    testJobButton.click();\n\n    expect(await screen.findByTestId(\"TestJobForm-fail\")).toBeInTheDocument();\n\n    const sleepMsInput = screen.getByTestId(\"TestJobForm-sleepMs\");\n    const submitButton = screen.getByTestId(\"TestJobForm-Submit-Button\");\n\n    expect(sleepMsInput).toBeInTheDocument();\n    expect(submitButton).toBeInTheDocument();\n\n    fireEvent.change(sleepMsInput, { target: { value: \"0\" } });\n    submitButton.click();\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    expect(axiosMock.history.post[0].url).toBe(\n      \"/api/jobs/launch/testjob?fail=false&sleepMs=0\",\n    );\n\n    expect(mockToast).toHaveBeenCalledWith(\"Submitted job: Test Job\");\n  });\n\n  test(\"user can submit a set cow health job\", async () => {\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n\n    const getItemSpy = vi.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation(() => null);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const setCowHealthButton = await screen.findByText(\n      \"Set Cow Health for a Specific Commons\",\n    );\n    expect(setCowHealthButton).toBeInTheDocument();\n    setCowHealthButton.click();\n\n    const commonsRadio = await screen.findByTestId(\n      \"SetCowHealthForm-commons-1\",\n    );\n    expect(commonsRadio).toBeInTheDocument();\n    fireEvent.click(commonsRadio);\n\n    const healthInput = screen.getByTestId(\"SetCowHealthForm-healthValue\");\n    const submitButton = screen.getByTestId(\"SetCowHealthForm-Submit-Button\");\n\n    expect(healthInput).toBeInTheDocument();\n    expect(submitButton).toBeInTheDocument();\n\n    fireEvent.change(healthInput, { target: { value: \"10\" } });\n    submitButton.click();\n\n    await waitFor(() => {\n      expect(axiosMock.history.post[0].url).toBe(\n        `/api/jobs/launch/setcowhealth?commonsID=1&health=10`,\n      );\n    });\n\n    expect(mockToast).toHaveBeenCalledWith(\n      `Submitted Job: Set Cow Health (Commons: Anika's Commons, Health: 10)`,\n    );\n  });\n\n  test(\"user can submit update cow health job\", async () => {\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n\n    const getItemSpy = vi.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation(() => null);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(\"Update Cow Health\")).toBeInTheDocument();\n\n    const UpdateCowHealthJobButton = screen.getByText(\"Update Cow Health\");\n    expect(UpdateCowHealthJobButton).toBeInTheDocument();\n    UpdateCowHealthJobButton.click();\n\n    const commonsRadio = await screen.findByTestId(\n      \"UpdateCowHealthForm-commons-1\",\n    );\n    expect(commonsRadio).toBeInTheDocument();\n    fireEvent.click(commonsRadio);\n\n    const submitButton = screen.getByTestId(\n      \"UpdateCowHealthForm-Submit-Button\",\n    );\n\n    expect(submitButton).toBeInTheDocument();\n\n    submitButton.click();\n\n    await waitFor(() => {\n      expect(axiosMock.history.post[0].url).toBe(\n        `/api/jobs/launch/updatecowhealthsinglecommons?commonsId=1`,\n      );\n    });\n\n    expect(mockToast).toHaveBeenCalledWith(\n      `Submitted Job: Update Cow Health (Commons: Anika's Commons)`,\n    );\n  });\n\n  test(\"user can submit update cow health job for all commons\", async () => {\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures    expect(commonsRadio).toBeInTheDocument();\n    fireEvent.click(commonsRadio);\n\n    const submitButton = screen.getByTestId(\"MilkTheCowsForm-Submit-Button\");\n    expect(submitButton).toBeInTheDocument();\n    submitButton.click();\n\n    await waitFor(() => {\n      expect(axiosMock.history.post[0].url).toBe(\n        `/api/jobs/launch/milkthecowjobsinglecommons?commonsId=1`,\n      );\n    });\n\n    expect(mockToast).toHaveBeenCalledWith(\n      `Submitted Job: Milk The Cows! (Commons: Anika's Commons)`,\n    );\n  });\n\n  test(\"user can submit milk the cows job for all commons\", async () => {\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n\n    const getItemSpy = vi.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation(() => null);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(\"Milk The Cows\")).toBeInTheDocument();\n\n    const MilkTheCowsJobButton = screen.getByText(\"Milk The Cows\");\n    expect(MilkTheCowsJobButton).toBeInTheDocument();\n    MilkTheCowsJobButton.click();\n\n    const commonsRadio = await screen.findByTestId(\"MilkTheCowsForm-commons-0\");\n    expect(commonsRadio).toBeInTheDocument();\n    fireEvent.click(commonsRadio);\n\n    const submitButton = screen.getByTestId(\"MilkTheCowsForm-Submit-Button\");\n    expect(submitButton).toBeInTheDocument();\n    submitButton.click();\n\n    await waitFor(() => {\n      expect(axiosMock.history.post[0].url).toBe(\n        `/api/jobs/launch/milkthecowjob`,\n      );\n    });\n\n    expect(mockToast).toHaveBeenCalledWith(\"Submitted Job: Milk The Cows!\");\n  });\n\n  test(\"user can submit instructor report job\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+
