\nvi.mock(\"react-router\", async () => ({\n  ...(await vi.importActual(\"react-router\")),\n  useNavigate: () => mockedNavigate,\n}));\n\ndescribe(\"SetCowHealthForm tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  it(\"renders the fallback text correctlyl\", async () => {\n    axiosMock.onGet(\"/api/commons/all\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"SetCowHealthForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByText(\"There are no commons on which to run this job.\"),\n    ).toBeInTheDocument();\n  });\n\n  it(\"validates health > 0\", async () => {\n    const submitAction = vi.fn();\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"SetCowHealthForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"SetCowHealthForm-healthValue\"),\n      ).toBeInTheDocument();\n    });\n\n    const submitButton = screen.getByTestId(\"SetCowHealthForm-Submit-Button\");\n    const healthInput = screen.getByTestId(\"SetCowHealthForm-healthValue\");\n\n    expect(submitButton).toBeInTheDocument();\n    expect(healthInput).toHaveValue(100);\n\n    fireEvent.change(healthInput, { target: { value: \"-1\" } });\n    fireEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(screen.getByText(/Health Value must be  0/i)).toBeInTheDocument();\n    });\n    expect(submitAction).not.toBeCalled();\n  });\n\n  it(\"validates health  0\", async () => {\n    const getItemSpy = vi.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation(() => null);\n\n    const submitAction = vi.fn();\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"SetCowHealthForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"SetCowHealthForm-healthValue\"),\n      ).toBeInTheDocument();\n    });\n\n    const submitButton = screen.getByTestId(\"SetCowHealthForm-Submit-Button\");\n    const healthInput = screen.getByTestId(\"SetCowHealthForm-healthValue\");\n\n    expect(submitButton).toBeInTheDocument();\n    expect(healthInput).toHaveValue(100);\n\n    fireEvent.change(healthInput, { target: { value: \"-1\" } });\n    fireEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(screen.getByText(/Health Value must be  0/i)).toBeInTheDocument();\n    });\n    expect(submitAction).not.toBeCalled();\n  });\n\n  it(\"validates health  100\", async () => {\n    const getItemSpy = vi.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation(() => null);\n\n    const submitAction = vi.fn();\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"SetCowHealthForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"SetCowHealthForm-healthValue\"),\n      ).toBeInTheDocument();\n    });\n\n    const submitButton = screen.getByTestId(\"SetCowHealthForm-Submit-Button\");\n    const healthInput = screen.getByTestId(\"SetCowHealthForm-healthValue\");\n\n    expect(submitButton).toBeInTheDocument();\n    expect(healthInput).toHaveValue(100);\n\n    fireEvent.change(healthInput, { target: { value: \"101\" } });\n    fireEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.getByText(/Health Value must be  100/i),\n      ).toBeInTheDocument();\n    });\n    expect(submitAction).not.toBeCalled();\n  });\n\n  it(\"validates health is required\", async () => {\n    const getItemSpy = vi.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation(() => null);\n\n    const submitAction = vi.fn();\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"SetCowHealthForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"SetCowHealthForm-healthValue\"),\n      ).toBeInTheDocument();\n    });\n\n    const submitButton = screen.getByTestId(\"SetCowHealthForm-Submit-Button\");\n    const healthInput = screen.getByTestId(\"SetCowHealthForm-healthValue\");\n\n    expect(submitButton).toBeInTheDocument();\n    expect(healthInput).toHaveValue(100);\n\n    fireEvent.change(healthInput, { target: { value: \"\" } });\n    fireEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(screen.getByText(/Health Value is required/i)).toBeInTheDocument();\n    });\n    expect(submitAction).not.toBeCalled();\n  });\n\n  it(\"user can sucessfully submit the job\", async () => {\n    const getItemSpy = vi.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation(() => null);\n\n    const submitAction = vi.fn();\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"SetCowHealthForm submitAction={submitAction} />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    const commonsRadio = await screen.findByTestId(\n      \"SetCowHealthForm-commons-1\",\n    );\n    expect(commonsRadio).toBeInTheDocument();\n    fireEvent.click(commonsRadio);\n\n    const healthInput = screen.getByTestId(\"SetCowHealthForm-healthValue\");\n    const submitButton = screen.getByTestId(\"SetCowHealthForm-Submit-Button\");\n\n    expect(healthInput).toBeInTheDocument();\n    expect(submitButton).toBeInTheDocument();\n\n    fireEvent.change(healthInput, { target: { value: \"10\" } });\n    fireEvent.click(submitButton);\n\n    // assert - check that the console.log was called with the expected message\n    await waitFor(() => {\n      expect(submitAction).toHaveBeenCalled();\n    });\n\n    expect(submitAction).toHaveBeenCalledWith({\n      healthValue: \"10\",\n      selectedCommons: 1,\n      selectedCommonsName: \"Anika's Commons\",\n    });\n  });\n\n  test(\"when localstorage has no value, the default value of healthValue is 100\", async () => {\n    const getItemSpy = vi.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation(() => null);\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"SetCowHealthForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"SetCowHealthForm-healthValue\"),\n      ).toBeInTheDocument();\n    });\n\n    const healthInput = screen.getByTestId(\"SetCowHealthForm-healthValue\");\n    expect(healthInput).toHaveValue(100);\n  });\n\n  test(\"healthValue can be loaded from localstorage\", async () => {\n    const getItemSpy = vi.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation((key) =>\n      key === \"SetCowHealthForm-health\" ? 42 : null,\n    );\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"SetCowHealthForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"SetCowHealthForm-healthValue\"),\n      ).toBeInTheDocument();\n    });\n\n    const healthInput = screen.getByTestId(\"SetCowHealthForm-healthValue\");\n    expect(healthInput).toHaveValue(42);\n  });\n\n  test(\"healthValue is saved in localstorage\", async () => {\n    const getItemSpy = vi.spyOn(Storage.prototype, \"getItem\");\n    const setItemSpy = vi.spyOn(Storage.prototype, \"setItem\");\n\n    getItemSpy.mockImplementation((key) =>\n      key === \"SetCowHealthForm-health\" ? 42 : null,\n    );\n\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"SetCowHealthForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"SetCowHealthForm-healthValue\"),\n      ).toBeInTheDocument();\n    });\n\n    const healthInput = screen.getByTestId(\"SetCowHealthForm-healthValue\");\n    expect(healthInput).toHaveValue(42);\n\n    const submitButton = screen.getByTestId(\"SetCowHealthForm-Submit-Button\");\n\n    fireEvent.change(healthInput, { target: { value: \"24\" } });\n    fireEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(setItemSpy).toHaveBeenCalledWith(\"SetCowHealthForm-health\", \"24\");\n    });\n  });\n\n  test(\"the first item in commons array is selected by default\", async () => {\n    const getItemSpy = vi.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation((key) =>\n      key === \"SetCowHealthForm-health\" ? 42 : null,\n    );\n\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"SetCowHealthForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    const defaultId = commonsFixtures.threeCommons[0].id;\n    const testIdForFirstItem = `SetCowHealthForm-commons-${defaultId}`;\n    await waitFor(() => {\n      expect(screen.getByTestId(testIdForFirstItem)).toBeInTheDocument();\n    });\n\n    const commons = screen.getByTestId(testIdForFirstItem);\n    expect(commons).toHaveAttribute(\"checked\", \"\");\n  });\n\n  test(\"the correct parameters are passed to useBackend\", async () => {\n    // https://www.chakshunyu.com/blog/how-to-spy-on-a-named-import-in-jest/\n    const useBackendSpy = vi.spyOn(useBackendModule, \"useBackend\");\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"SetCowHealthForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(useBackendSpy).toHaveBeenCalledWith(\n        [\"/api/commons/all\"],\n        { url: \"/api/commons/all\" },\n        [],\n      );\n    });\n  });\n});\n"},"src/tests/components/Commons/CommonsTable.test.jsx":{"tests":[{"id":"120","name":"UserTable tests renders without crashing for empty table with user not logged in"},{"id":"121","name":"UserTable tests renders without crashing for empty table for ordinary user"},{"id":"122","name":"UserTable tests renders without crashing for empty table for admin"},{"id":"123","name":"UserTable tests Has the expected column headers and content for adminUser"},{"id":"124","name":"Modal tests Clicking Delete button opens the modal for adminUser"},{"id":"125","name":"Modal tests Clicking Permanently Delete button deletes the commons"},{"id":"126","name":"Modal tests Clicking Keep this Commons button cancels the deletion"},{"id":"127","name":"Modal tests Pressing the escape key on the modal cancels the deletion"}],"source":"import { render, screen, waitFor, fireEvent } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport CommonsTable from \"main/components/Commons/CommonsTable\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport commonsPlusFixtures from \"fixtures/commonsPlusFixtures\";\nimport * as useBackendModule from \"main/utils/useBackend\";\nimport { vi } from \"vitest\";\nimport {\n  cellToAxiosParamsDelete,\n  onDeleteSuccess,\n} from \"main/utils/commonsUtils\";\n\n// Next line uses technique from https://www.chakshunyu.com/blog/how-to-spy-on-a-named-import-in-jest/\n\nconst mockedNavigate = vi.fn();\n\nvi.mock(\"react-router\", async () => ({\n  ...(await vi.importActual(\"react-router\")),\n  useNavigate: () => mockedNavigate,\n}));\n\ndescribe(\"UserTable tests\", () => {\n  const queryClient = new QueryClient();\n\n  test(\"renders without crashing for empty table with user not logged in\", () => {\n    const currentUser = null;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CommonsTable commons={[]} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n  test(\"renders without crashing for empty table for ordinary user\", () => {\n    const currentUser = currentUserFixtures.userOnly;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CommonsTable commons={[]} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"renders without crashing for empty table for admin\", () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CommonsTable commons={[]} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"Has the expected column headers and content for adminUser\", () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CommonsTable\n            commons={commonsPlusFixtures.threeCommonsPlus}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const expectedHeaders = [\n      \"id\",\n      \"Name\",\n      /Cow\\s+Price/,\n      /Milk\\s+Price/,\n      /Start\\s+Bal/,\n      /Starting\\s+Date/,\n      /Last\\s+Date/,\n      /Degrad\\s+Rate/,\n      /Show\\s+LrdrBrd\\?/,\n      /Tot\\s+Cows/,\n      /Cap \\/\\s+User/,\n      /Carry\\s+Cap/,\n      /Eff\\s+Cap/,\n    ];\n    const expectedFields = [\n      \"id\",\n      \"name\",\n      \"cowPrice\",\n      \"milkPrice\",\n      \"startingBalance\",\n      \"startingDate\",\n      \"lastDate\",\n      \"degradationRate\",\n      \"capacityPerUser\",\n      \"carryingCapacity\",\n    ];\n\n    const testId = \"CommonsTable\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(\n        `${testId}-cell-row-0-col-commons.${field}`,\n      );\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-commons.id`),\n    ).toHaveTextContent(\"1\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-commons.id`),\n    ).toHaveTextContent(\"2\");\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-commons.name`),\n    ).toHaveTextContent(\"Com2\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-commons.cowPrice`),\n    ).toHaveTextContent(\"1\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-commons.milkPrice`),\n    ).toHaveTextContent(\"2\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-commons.degradationRate`),\n    ).toHaveTextContent(\"0.01\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-commons.capacityPerUser`),\n    ).toHaveTextContent(\"5\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-commons.carryingCapacity`),\n    ).toHaveTextContent(\"42\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-commons.startingBalance`),\n    ).toHaveTextContent(\"10\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-commons.startingDate`),\n    ).toHaveTextContent(/^2022-11-22$/); // regex so that we have an exact match https://stackoverflow.com/a/73298371\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-commons.lastDate`),\n    ).toHaveTextContent(/^2022-11-22$/);\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-commons.showLeaderboard`),\n    ).toHaveTextContent(\"true\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-commons.showChat`),\n    ).toHaveTextContent(\"true\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-totalCows`),\n    ).toHaveTextContent(\"0\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-effectiveCapacity`),\n    ).toHaveTextContent(\"42\");\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Edit-button`),\n    ).toHaveClass(\"btn-primary\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Delete-button`),\n    ).toHaveClass(\"btn-danger\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Leaderboard-button`),\n    ).toHaveClass(\"btn-secondary\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Stats CSV-button`),\n    ).toHaveClass(\"btn-success\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Announcements-button`),\n    ).toHaveClass(\"btn-info\");\n  });\n});\n\ndescribe(\"Modal tests\", () => {\n  const queryClient = new QueryClient();\n\n  // Mocking the delete mutation function\n  const mockMutate = vi.fn();\n  const mockUseBackendMutation = {\n    mutate: mockMutate,\n  };\n\n  beforeEach(() => {\n    vi.spyOn(useBackendModule, \"useBackendMutation\").mockReturnValue(\n      mockUseBackendMutation,\n    );\n  });\n\n  afterEach(() => {\n    vi.clearAllMocks();\n  });\n\n  test(\"Clicking Delete button opens the modal for adminUser\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CommonsTable\n            commons={commonsPlusFixtures.threeCommonsPlus}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Verify that the modal is hidden by checking for the absence of the \"modal-open\" class\n    await waitFor(() => {\n      expect(document.body).not.toHaveClass(\"modal-open\");\n    });\n\n    const deleteButton = screen.getByTestId(\n      \"CommonsTable-cell-row-0-col-Delete-button\",\n    );\n    fireEvent.click(deleteButton);\n\n    // Verify that the modal is shown by checking for the \"modal-open\" class\n    await waitFor(() => {\n      expect(document.body).toHaveClass(\"modal-open\");\n    });\n  });\n\n  test(\"Clicking Permanently Delete button deletes the commons\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    // https://www.chakshunyu.com/blog/how-to-spy-on-a-named-import-in-jest/\n    const useBackendMutationSpy = vi.spyOn(\n      useBackendModule,\n      \"useBackendMutation\",\n    );\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CommonsTable\n            commons={commonsPlusFixtures.threeCommonsPlus}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const deleteButton = screen.getByTestId(\n      \"CommonsTable-cell-row-0-col-Delete-button\",\n    );\n    fireEvent.click(deleteButton);\n\n    const permanentlyDeleteButton = await screen.findByTestId(\n      \"CommonsTable-Modal-Delete\",\n    );\n    fireEvent.click(permanentlyDeleteButton);\n\n    await waitFor(() => {\n      expect(useBackendMutationSpy).toHaveBeenCalledWith(\n        cellToAxiosParamsDelete,\n        { onSuccess: onDeleteSuccess },\n        [\"/api/commons/allplus\"],\n      );\n    });\n\n    // Verify that the modal is hidden by checking for the absence of the \"modal-open\" class\n    await waitFor(() => {\n      expect(document.body).not.toHaveClass(\"modal-open\");\n    });\n  });\n\n  test(\"Clicking Keep this Commons button cancels the deletion\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CommonsTable\n            commons={commonsPlusFixtures.threeCommonsPlus}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const deleteButton = screen.getByTestId(\n      \"CommonsTable-cell-row-0-col-Delete-button\",\n    );\n    fireEvent.click(deleteButton);\n\n    const cancelButton = await screen.findByTestId(\"CommonsTable-Modal-Cancel\");\n    fireEvent.click(cancelButton);\n\n    // Verify that the modal is hidden by checking for the absence of the \"modal-open\" class\n    await waitFor(() => {\n      expect(document.body).not.toHaveClass(\"modal-open\");\n    });\n\n    expect(mockMutate).not.toHaveBeenCalled();\n  });\n\n  test(\"Pressing the escape key on the modal cancels the deletion\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CommonsTable\n            commons={commonsPlusFixtures.threeCommonsPlus}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Click the delete button to open the modal\n    const deleteButton = screen.getByTestId(\n      \"CommonsTable-cell-row-0-col-Delete-button\",\n    );\n    fireEvent.click(deleteButton);\n\n    // Check that the modal is displayed by checking for the \"modal-open\" class in the body\n    expect(document.body).toHaveClass(\"modal-open\");\n\n    // Click the close button\n    const closeButton = screen.getByLabelText(\"Close\");\n    fireEvent.click(closeButton);\n\n    // Verify that the modal is hidden by checking for the absence of the \"modal-open\" class\n    await waitFor(() => {\n      expect(document.body).not.toHaveClass(\"modal-open\");\n    });\n\n    // Assert that the delete mutation was not called\n    // (you'll need to replace `mockMutate` with the actual reference to the mutation in your code)\n    expect(mockMutate).not.toHaveBeenCalled();\n  });\n});\n"},"src/tests/components/Commons/CommonsCard.test.jsx":{"tests":[{"id":"128","name":"CommonsCard tests renders without crashing when button text is set"},{"id":"129","name":"CommonsCard tests renders no button when button text is null"},{"id":"130","name":"CommonsCard tests cannot join commons with future start date - future year"},{"id":"131","name":"CommonsCard tests cannot join commons with future start date - future month"},{"id":"132","name":"CommonsCard tests can join commons with past date - past month"},{"id":"133","name":"CommonsCard tests can visit even if wrong future date"},{"id":"134","name":"CommonsCard tests cannot join commons with future start date - future day"},{"id":"135","name":"CommonsCard tests can join commons with current date"},{"id":"136","name":"CommonsCard tests can join commons with past start date"},{"id":"137","name":"isFutureDate helper detects future dates within the same month"},{"id":"138","name":"isFutureDate helper detects future months and years"},{"id":"139","name":"isFutureDate helper handles invalid or missing starting dates gracefully"},{"id":"140","name":"isFutureDate helper compares months correctly when they differ within the same year"},{"id":"141","name":"isFutureDate helper parses ISO timestamps with time values"},{"id":"142","name":"isFutureDate helper accepts reference dates supplied as strings"},{"id":"143","name":"isFutureDate helper falls back to the current date when the reference is invalid"}],"source":"import { fireEvent, render, screen } from \"@testing-library/react\";\nimport CommonsCard from \"main/components/Commons/CommonsCard\";\nimport { isFutureDate } from \"main/components/Commons/commonsCardUtils\";\nimport commonsFixtures from \"fixtures/commonsFixtures\";\nimport { vi } from \"vitest\";\nimport \"@testing-library/jest-dom\";\n\nconst curr = new Date();\n\ndescribe(\"CommonsCard tests\", () => {\n  test(\"renders without crashing when button text is set\", async () => {\n    const click = vi.fn();\n    render(\n      <"+"CommonsCard\n        commons={commonsFixtures.threeCommons[0]}\n        buttonText={\"Join\"}\n        buttonLink={click}\n      />,\n    );\n\n    const button = screen.getByTestId(\"commonsCard-button-Join-5\");\n    expect(button).toBeInTheDocument();\n    expect(typeof button.textContent).toBe(\"string\");\n    expect(button.textContent).toEqual(\"Join\");\n    fireEvent.click(button);\n    expect(click).toBeCalledTimes(1);\n\n    const name = screen.getByTestId(\"commonsCard-name-5\");\n    expect(name).toBeInTheDocument();\n    expect(typeof name.textContent).toBe(\"string\");\n    expect(name.textContent).toEqual(\"Seths Common\");\n\n    const id = screen.getByTestId(\"commonsCard-id-5\");\n    expect(id).toBeInTheDocument();\n    expect(typeof id.textContent).toBe(\"string\");\n    expect(id.textContent).toEqual(\"5\");\n  });\n\n  test(\"renders no button when button text is null\", () => {\n    render(\n      <"+"CommonsCard\n        commons={commonsFixtures.threeCommons[0]}\n        buttonText={null}\n      />,\n    );\n\n    expect(\n      screen.queryByTestId(/commonsCard-button-\\w+-5/),\n    ).not.toBeInTheDocument();\n\n    const name = screen.getByTestId(\"commonsCard-name-5\");\n    expect(name).toBeInTheDocument();\n    expect(typeof name.textContent).toBe(\"string\");\n    expect(name.textContent).toEqual(\"Seths Common\");\n\n    const id = screen.getByTestId(\"commonsCard-id-5\");\n    expect(id).toBeInTheDocument();\n    expect(typeof id.textContent).toBe(\"string\");\n    expect(id.textContent).toEqual(\"5\");\n  });\n\n  test(\"cannot join commons with future start date - future year\", async () => {\n    const futureYearCommon = commonsFixtures.threeCommons[2];\n    futureYearCommon.startingDate = new Date(\n      curr.getFullYear() + 1,\n      curr.getMonth(),\n      curr.getDate(),\n    )\n      .toISOString()\n      .substring(0, 10);\n    const click = vi.fn();\n    window.alert = vi.fn();\n    render(\n      <"+"CommonsCard\n        commons={futureYearCommon}\n        buttonText={\"Join\"}\n        buttonLink={click}\n      />,\n    );\n\n    const button = screen.getByTestId(\"commonsCard-button-Join-1\");\n    expect(button).toBeInTheDocument();\n    expect(typeof button.textContent).toBe(\"string\");\n    expect(button.textContent).toEqual(\"Join\");\n    fireEvent.click(button);\n    expect(click).toBeCalledTimes(0);\n    expect(window.alert).toBeCalledTimes(1);\n\n    expect(button).toBeInTheDocument();\n    expect(typeof button.textContent).toBe(\"string\");\n    expect(button.textContent).toEqual(\"Join\");\n  });\n\n  test(\"cannot join commons with future start date - future month\", async () => {\n    const futureCommon = commonsFixtures.threeCommons[2];\n    futureCommon.startingDate = new Date(\n      curr.getFullYear(),\n      curr.getMonth() + 2,\n      curr.getDate(),\n    )\n      .toISOString()\n      .substring(0, 10);\n    const click = vi.fn();\n    render(\n      <"+"CommonsCard\n        commons={futureCommon}\n        buttonText={\"Join\"}\n        buttonLink={click}\n      />,\n    );\n\n    const button = screen.getByTestId(\"commonsCard-button-Join-1\");\n    expect(button).toBeInTheDocument();\n    expect(typeof button.textContent).toBe(\"string\");\n    expect(button.textContent).toEqual(\"Join\");\n    fireEvent.click(button);\n    expect(click).toBeCalledTimes(0);\n\n    expect(button).toBeInTheDocument();\n    expect(typeof button.textContent).toBe(\"string\");\n    expect(button.textContent).toEqual(\"Join\");\n  });\n\n  test(\"can join commons with past date - past month\", async () => {\n    const futureCommon = commonsFixtures.threeCommons[2];\n    futureCommon.startingDate = new Date(\n      curr.getFullYear(),\n      curr.getMonth() - 1,\n      curr.getDate(),\n    )\n      .toISOString()\n      .substring(0, 10);\n    const click = vi.fn();\n    render(\n      <"+"CommonsCard\n        commons={futureCommon}\n        buttonText={\"Join\"}\n        buttonLink={click}\n      />,\n    );\n\n    const button = screen.getByTestId(\"commonsCard-button-Join-1\");\n    expect(button).toBeInTheDocument();\n    expect(typeof button.textContent).toBe(\"string\");\n    expect(button.textContent).toEqual(\"Join\");\n    fireEvent.click(button);\n    expect(click).toBeCalledTimes(1);\n  });\n\n  test(\"can visit even if wrong future date\", async () => {\n    const futureCommon = commonsFixtures.threeCommons[2];\n    futureCommon.startingDate = new Date(\n      curr.getFullYear(),\n      curr.getMonth() + 2,\n      curr.getDate(),\n    )\n      .toISOString()\n      .substring(0, 10);\n    const click = vi.fn();\n    render(\n      <"+"CommonsCard\n        commons={futureCommon}\n        buttonText={\"Visit\"}\n        buttonLink={click}\n      />,\n    );\n\n    const button = screen.getByTestId(\"commonsCard-button-Visit-1\");\n    expect(button).toBeInTheDocument();\n    expect(typeof button.textContent).toBe(\"string\");\n    expect(button.textContent).toEqual(\"Visit\");\n    fireEvent.click(button);\n    expect(click).toBeCalledTimes(1);\n  });\n\n  test(\"cannot join commons with future start date - future day\", async () => {\n    const futureCommon = commonsFixtures.threeCommons[2];\n    futureCommon.startingDate = new Date(\n      curr.getFullYear(),\n      curr.getMonth(),\n      curr.getDate() + 1,\n    )\n      .toISOString()\n      .substring(0, 10);\n    const click = vi.fn();\n    render(\n      <"+"CommonsCard\n        commons={futureCommon}\n        buttonText={\"Join\"}\n        buttonLink={click}\n      />,\n    );\n\n    const button = screen.getByTestId(\"commonsCard-button-Join-1\");\n    expect(button).toBeInTheDocument();\n    expect(typeof button.textContent).toBe(\"string\");\n    expect(button.textContent).toEqual(\"Join\");\n    fireEvent.click(button);\n    expect(click).toBeCalledTimes(0);\n\n    expect(button).toBeInTheDocument();\n    expect(typeof button.textContent).toBe(\"string\");\n    expect(button.textContent).toEqual(\"Join\");\n  });\n\n  test(\"can join commons with current date\", async () => {\n    const futureCommon = commonsFixtures.threeCommons[2];\n    futureCommon.startingDate = new Date(\n      curr.getFullYear(),\n      curr.getMonth(),\n      curr.getDate(),\n    )\n      .toISOString()\n      .substring(0, 10);\n    const click = vi.fn();\n    render(\n      <"+"CommonsCard\n        commons={futureCommon}\n        buttonText={\"Join\"}\n        buttonLink={click}\n      />,\n    );\n\n    const button = screen.getByTestId(\"commonsCard-button-Join-1\");\n    expect(button).toBeInTheDocument();\n    expect(typeof button.textContent).toBe(\"string\");\n    expect(button.textContent).toEqual(\"Join\");\n    fireEvent.click(button);\n    expect(click).toBeCalledTimes(1);\n  });\n\n  test(\"can join commons with past start date\", async () => {\n    const click = vi.fn();\n    render(\n      <"+"CommonsCard\n        commons={commonsFixtures.threeCommons[0]}\n        buttonText={\"Join\"}\n        buttonLink={click}\n      />,\n    );\n\n    const button = screen.getByTestId(\"commonsCard-button-Join-5\");\n    expect(button).toBeInTheDocument();\n    expect(typeof button.textContent).toBe(\"string\");\n    expect(button.textContent).toEqual(\"Join\");\n    fireEvent.click(button);\n    expect(click).toBeCalledTimes(1);\n  });\n});\n\ndescribe(\"isFutureDate helper\", () => {\n  const referenceDate = new Date(\"2024-05-15T12:00:00\");\n\n  test(\"detects future dates within the same month\", () => {\n    expect(isFutureDate(\"2024-05-16\", referenceDate)).toBe(true);\n    expect(isFutureDate(\"2024-05-15\", referenceDate)).toBe(false);\n  });\n\n  test(\"detects future months and years\", () => {\n    expect(isFutureDate(\"2024-06-01\", referenceDate)).toBe(true);\n    expect(isFutureDate(\"2023-12-31\", referenceDate)).toBe(false);\n    expect(isFutureDate(\"2025-01-01\", referenceDate)).toBe(true);\n  });\n\n  test(\"handles invalid or missing starting dates gracefully\", () => {\n    expect(isFutureDate(undefined, referenceDate)).toBe(false);\n    expect(isFutureDate(null, referenceDate)).toBe(false);\n    expect(isFutureDate(\"\", referenceDate)).toBe(false);\n    expect(isFutureDate(\"not-a-date\", referenceDate)).toBe(false);\n  });\n\n  test(\"compares months correctly when they differ within the same year\", () => {\n    expect(isFutureDate(\"2024-04-01\", referenceDate)).toBe(false);\n    expect(isFutureDate(\"2024-07-01\", referenceDate)).toBe(true);\n  });\n\n  test(\"parses ISO timestamps with time values\", () => {\n    expect(isFutureDate(\"2024-05-16T00:00:00Z\", referenceDate)).toBe(true);\n    expect(isFutureDate(\"2024-05-14T23:59:59Z\", referenceDate)).toBe(false);\n  });\n\n  test(\"accepts reference dates supplied as strings\", () => {\n    expect(isFutureDate(\"2024-05-16\", \"2024-05-15\")).toBe(true);\n    expect(isFutureDate(\"2024-05-14\", \"2024-05-15\")).toBe(false);\n  });\n\n  test(\"falls back to the current date when the reference is invalid\", () => {\n    vi.useFakeTimers();\n    vi.setSystemTime(new Date(\"2024-05-15T12:00:00Z\"));\n    const invalidReference = new Date(\"not-a-real-date\");\n\n    try {\n      expect(isFutureDate(\"2024-05-16\", invalidReference)).toBe(true);\n      expect(isFutureDate(\"2024-05-14\", invalidReference)).toBe(false);\n    } finally {\n      vi.useRealTimers();\n    }\n  });\n});\n"},"src/tests/pages/AdminEditCommonsPage.test.jsx":{"tests":[{"id":"144","name":"AdminEditCommonsPage tests tests where backend is working normally renders without crashing"},{"id":"145","name":"AdminEditCommonsPage tests tests where backend is working normally Is populated with the data provided"},{"id":"146","name":"AdminEditCommonsPage tests tests where backend is working normally Changes when you click Update"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport AdminEditCommonsPage from \"main/pages/AdminEditCommonsPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport healthUpdateStrategyListFixtures from \"../../fixtures/healthUpdateStrategyListFixtures\";\nimport { vi } from \"vitest\";\n\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async () => {\n  const originalModule = await vi.importActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\nconst mockNavigate = vi.fn();\nvi.mock(\"react-router\", async () => {\n  const originalModule = await vi.importActual(\"react-router\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    useParams: () => ({\n      id: 5,\n    }),\n    Navigate: (x) => {\n      mockNavigate(x);\n
