ategyField).toHaveValue(\"strat1\");\n      expect(belowCapacityHealthUpdateStrategyField).toHaveValue(\"strat2\");\n      expect(showLeaderboardField).not.toBeChecked();\n      expect(showChatField).not.toBeChecked();\n    });\n\n    test(\"Changes when you click Update\", async () => {\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"MemoryRouter>\n            <"+"AdminEditCommonsPage />\n          <"+"/MemoryRouter>\n        <"+"/QueryClientProvider>,\n      );\n\n      expect(await screen.findByLabelText(/Commons Name/)).toBeInTheDocument();\n\n      const nameField = screen.getByLabelText(/Commons Name/);\n      const startingBalanceField = screen.getByLabelText(/Starting Balance/);\n      const cowPriceField = screen.getByLabelText(/Cow Price/);\n      const milkPriceField = screen.getByLabelText(/Milk Price/);\n      const startingDateField = screen.getByLabelText(/Starting Date/);\n      const lastDateField = screen.getByLabelText(/Last Date/);\n      const degradationRateField = screen.getByLabelText(/Degradation Rate/);\n      const capacityPerUserField = screen.getByLabelText(/Capacity Per User/);\n      const carryingCapacityField = screen.getByLabelText(/Carrying Capacity/);\n      const aboveCapacityHealthUpdateStrategyField =\n        screen.getByLabelText(/When above capacity/);\n      const belowCapacityHealthUpdateStrategyField =\n        screen.getByLabelText(/When below capacity/);\n      const showLeaderboardField = screen.getByLabelText(/Show Leaderboard\\?/);\n      const showChatField = screen.getByLabelText(/Show Chat?\\?/);\n\n      expect(nameField).toHaveValue(\"Seths Common\");\n      expect(startingDateField).toHaveValue(\"2022-03-05\");\n      expect(lastDateField).toHaveValue(\"2023-03-05\");\n      expect(startingBalanceField).toHaveValue(1200);\n      expect(cowPriceField).toHaveValue(15);\n      expect(milkPriceField).toHaveValue(10);\n      expect(degradationRateField).toHaveValue(20.3);\n      expect(capacityPerUserField).toHaveValue(10);\n      expect(carryingCapacityField).toHaveValue(100);\n      expect(aboveCapacityHealthUpdateStrategyField).toHaveValue(\"strat1\");\n      expect(belowCapacityHealthUpdateStrategyField).toHaveValue(\"strat2\");\n      expect(showLeaderboardField).not.toBeChecked();\n      expect(showChatField).not.toBeChecked();\n\n      const submitButton = screen.getByText(\"Update\");\n\n      expect(submitButton).toBeInTheDocument();\n\n      fireEvent.change(nameField, { target: { value: \"Phill's Commons\" } });\n      fireEvent.change(startingDateField, { target: { value: \"2022-03-07\" } });\n      fireEvent.change(lastDateField, { target: { value: \"2023-03-07\" } });\n      fireEvent.change(startingBalanceField, { target: { value: 1400 } });\n      fireEvent.change(cowPriceField, { target: { value: 200 } });\n      fireEvent.change(milkPriceField, { target: { value: 5 } });\n      fireEvent.change(degradationRateField, { target: { value: 40.3 } });\n      fireEvent.change(capacityPerUserField, { target: { value: 20 } });\n      fireEvent.change(carryingCapacityField, { target: { value: 200 } });\n      fireEvent.change(aboveCapacityHealthUpdateStrategyField, {\n        target: { value: \"strat2\" },\n      });\n      fireEvent.change(belowCapacityHealthUpdateStrategyField, {\n        target: { value: \"strat3\" },\n      });\n      fireEvent.click(showLeaderboardField);\n      fireEvent.click(showChatField);\n\n      fireEvent.click(submitButton);\n\n      await waitFor(() => expect(mockToast).toHaveBeenCalled());\n      expect(mockToast).toBeCalledWith(\n        \"Commons Updated - id: 5 name: Phill's Commons\",\n      );\n      expect(mockNavigate).toBeCalledWith({ to: \"/admin/listcommons\" });\n\n      expect(axiosMock.history.put.length).toBe(1); // times called\n      expect(axiosMock.history.put[0].params).toEqual({ id: 5 });\n      expect(axiosMock.history.put[0].data).toBe(\n        JSON.stringify({\n          name: \"Phill's Commons\",\n          startingBalance: 1400,\n          cowPrice: 200,\n          milkPrice: 5,\n          startingDate: \"2022-03-07T00:00:00.000Z\",\n          lastDate: \"2023-03-07T00:00:00.000Z\",\n          degradationRate: 40.3,\n          capacityPerUser: 20,\n          carryingCapacity: 200,\n          aboveCapacityHealthUpdateStrategy: \"strat2\",\n          belowCapacityHealthUpdateStrategy: \"strat3\",\n          showLeaderboard: true,\n          showChat: true,\n        }),\n      ); // posted object\n    });\n  });\n});\n"},"src/tests/components/Commons/ManageCowsModal.test.jsx":{"tests":[{"id":"147","name":"ManageCowsModal renders the modal when isOpen is true"},{"id":"148","name":"ManageCowsModal modal has correct buy capitalization"},{"id":"149","name":"ManageCowsModal modal has correct sell capitalization"},{"id":"150","name":"ManageCowsModal does not render the modal when isOpen is false"},{"id":"151","name":"ManageCowsModal calls onClose and setNumber when close button is clicked"},{"id":"152","name":"ManageCowsModal calls onClose and setNumber when cancel button is clicked"},{"id":"153","name":"ManageCowsModal calls onBuy with correct arguments when buy button is clicked"},{"id":"154","name":"ManageCowsModal calls onSell with correct arguments when sell button is clicked"},{"id":"155","name":"ManageCowsModal calls onSell with correct arguments when sell button is clicked (0 argument)"},{"id":"156","name":"ManageCowsModal windows toolkit warning for buying negative cows"},{"id":"157","name":"ManageCowsModal windows toolkit warning for selling negative cows"},{"id":"158","name":"ManageCowsModal toast warning for inputing negative number when buying cows"},{"id":"159","name":"ManageCowsModal toast warning for inputing negative number when selling cows"},{"id":"160","name":"ManageCowsModal toast warning not present when buying 0 cows"},{"id":"161","name":"ManageCowsModal toast warning not present when selling 0 cows"},{"id":"162","name":"ManageCowsModal updates the number state on input change"},{"id":"163","name":"ManageCowsModal Check styling of modal components"}],"source":"import React from \"react\";\nimport { render, fireEvent, screen, waitFor } from \"@testing-library/react\";\nimport ManageCowsModal from \"main/components/Commons/ManageCowsModal\";\nimport userCommonsFixtures from \"fixtures/userCommonsFixtures\";\nimport { vi } from \"vitest\";\nimport \"@testing-library/jest-dom\";\n\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async () => {\n  const originalModule = await vi.importActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: {\n      ...originalModule.toast,\n      warn: (message) => mockToast(message),\n    },\n  };\n});\n\ndescribe(\"ManageCowsModal\", () => {\n  const mockOnClose = vi.fn();\n  const mockSetNumber = vi.fn();\n  const mockOnBuy = vi.fn();\n  const mockOnSell = vi.fn();\n  window.alert = vi.fn();\n\n  beforeEach(() => {\n    vi.clearAllMocks();\n  });\n\n  test(\"renders the modal when isOpen is true\", () => {\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"buy\"\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    expect(screen.getByTestId(\"buy-sell-cow-modal\")).toBeInTheDocument();\n  });\n\n  test(\"modal has correct buy capitalization\", () => {\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"buy\"\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    expect(screen.getByText(\"Buy\")).toBeInTheDocument();\n  });\n\n  test(\"modal has correct sell capitalization\", () => {\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"sell\"\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    expect(screen.getByText(\"Sell\")).toBeInTheDocument();\n  });\n\n  test(\"does not render the modal when isOpen is false\", () => {\n    render(\n      <"+"ManageCowsModal\n        isOpen={false}\n        onClose={mockOnClose}\n        message=\"buy\"\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    expect(screen.queryByTestId(\"buy-sell-cow-modal\")).not.toBeInTheDocument();\n  });\n\n  test(\"calls onClose and setNumber when close button is clicked\", () => {\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"buy\"\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    fireEvent.click(screen.getByTestId(\"buy-sell-cow-modal-close\"));\n    expect(mockOnClose).toHaveBeenCalled();\n    expect(mockSetNumber).toHaveBeenCalledWith(1);\n  });\n\n  test(\"calls onClose and setNumber when cancel button is clicked\", () => {\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"buy\"\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    fireEvent.click(screen.getByTestId(\"buy-sell-cow-modal-cancel\"));\n    expect(mockOnClose).toHaveBeenCalled();\n    expect(mockSetNumber).toHaveBeenCalledWith(1);\n  });\n\n  test(\"calls onBuy with correct arguments when buy button is clicked\", async () => {\n    const number = 5;\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"buy\"\n        userCommons={userCommonsFixtures.oneUserCommons[0]}\n        number={number}\n        onBuy={mockOnBuy}\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    fireEvent.click(screen.getByTestId(\"buy-sell-cow-modal-submit\"));\n\n    await waitFor(() =>\n      expect(mockOnBuy).toHaveBeenCalledWith(\n        userCommonsFixtures.oneUserCommons[0],\n        number,\n      ),\n    );\n  });\n\n  test(\"calls onSell with correct arguments when sell button is clicked\", async () => {\n    const number2 = 3;\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"sell\"\n        userCommons={userCommonsFixtures.oneUserCommons[0]}\n        number={number2}\n        onSell={mockOnSell}\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    fireEvent.click(screen.getByTestId(\"buy-sell-cow-modal-submit\"));\n\n    await waitFor(() =>\n      expect(mockOnSell).toHaveBeenCalledWith(\n        userCommonsFixtures.oneUserCommons[0],\n        number2,\n      ),\n    );\n  });\n\n  test(\"calls onSell with correct arguments when sell button is clicked (0 argument)\", async () => {\n    const number2 = 0;\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"sell\"\n        userCommons={userCommonsFixtures.oneUserCommons[0]}\n        number={number2}\n        onSell={mockOnSell}\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    fireEvent.click(screen.getByTestId(\"buy-sell-cow-modal-submit\"));\n\n    await waitFor(() =>\n      expect(mockOnSell).toHaveBeenCalledWith(\n        userCommonsFixtures.oneUserCommons[0],\n        number2,\n      ),\n    );\n  });\n\n  test(\"windows toolkit warning for buying negative cows\", async () => {\n    const number2 = -3;\n\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"buy\"\n        userCommons={userCommonsFixtures.oneUserCommons[0]}\n        number={number2}\n        onBuy={mockOnBuy}\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    fireEvent.click(screen.getByTestId(\"buy-sell-cow-modal-submit\"));\n\n    expect(window.alert).toHaveBeenCalledWith(\n      \"You cannot buy a negative number of cows! Please enter a non-negative number.\",\n    );\n  });\n\n  test(\"windows toolkit warning for selling negative cows\", async () => {\n    const number2 = -3;\n\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"sell\"\n        userCommons={userCommonsFixtures.oneUserCommons[0]}\n        number={number2}\n        onSell={mockOnSell}\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    fireEvent.click(screen.getByTestId(\"buy-sell-cow-modal-submit\"));\n\n    expect(window.alert).toHaveBeenCalledWith(\n      \"You cannot sell a negative number of cows! Please enter a non-negative number.\",\n    );\n  });\n\n  test(\"toast warning for inputing negative number when buying cows\", async () => {\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"buy\"\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    const input = screen.getByTestId(\"buy-sell-cow-modal-input\");\n\n    fireEvent.change(input, { target: { value: \"-3\" } });\n    expect(mockSetNumber).toHaveBeenCalledWith(\"-3\");\n    expect(mockToast).toHaveBeenCalledWith(\n      \"Warning: You cannot buy a negative number of cows!\",\n    );\n  });\n\n  test(\"toast warning for inputing negative number when selling cows\", async () => {\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"sell\"\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    const input = screen.getByTestId(\"buy-sell-cow-modal-input\");\n\n    fireEvent.change(input, { target: { value: \"-3\" } });\n    expect(mockSetNumber).toHaveBeenCalledWith(\"-3\");\n    expect(mockToast).toHaveBeenCalledWith(\n      \"Warning: You cannot sell a negative number of cows!\",\n    );\n  });\n\n  test(\"toast warning not present when buying 0 cows\", async () => {\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"buy\"\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    const input = screen.getByTestId(\"buy-sell-cow-modal-input\");\n\n    fireEvent.change(input, { target: { value: \"0\" } });\n    expect(mockSetNumber).toHaveBeenCalledWith(\"0\");\n    expect(mockToast).not.toHaveBeenCalledWith(\n      \"Warning: You cannot buy a negative number of cows!\",\n    );\n  });\n\n  test(\"toast warning not present when selling 0 cows\", async () => {\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"sell\"\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    const input = screen.getByTestId(\"buy-sell-cow-modal-input\");\n\n    fireEvent.change(input, { target: { value: \"0\" } });\n    expect(mockSetNumber).toHaveBeenCalledWith(\"0\");\n    expect(mockToast).not.toHaveBeenCalledWith(\n      \"Warning: You cannot sell a negative number of cows!\",\n    );\n  });\n\n  test(\"updates the number state on input change\", () => {\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"buy\"\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    const input = screen.getByTestId(\"buy-sell-cow-modal-input\");\n\n    fireEvent.change(input, { target: { value: \"10\" } });\n    expect(mockSetNumber).toHaveBeenCalledWith(\"10\");\n  });\n\n  test(\"Check styling of modal components\", () => {\n    render(\n      <"+"ManageCowsModal\n        isOpen={true}\n        onClose={mockOnClose}\n        message=\"buy\"\n        setNumber={mockSetNumber}\n      />,\n    );\n\n    expect(screen.getByTestId(\"buy-sell-cow-modal-footer\")).toHaveStyle(\n      \"border-top: 0px\",\n    );\n    expect(screen.getByTestId(\"buy-sell-cow-modal-input\")).toHaveStyle(\n      \"width: 20%\",\n    );\n    expect(screen.getByTestId(\"buy-sell-cow-modal-close\")).toHaveStyle(\n      \"color: rgb(0, 0, 0); border-color: #fff; background-color: rgb(255, 255, 255);\",\n    );\n    expect(screen.getByTestId(\"buy-sell-cow-modal-closeGroup\")).toHaveStyle(\n      \"display: flex; justify-content: right\",\n    );\n  });\n});\n"},"src/tests/utils/useBackend.test.jsx":{"tests":[{"id":"164","name":"utils/useBackend tests utils/useBackend useBackend tests useBackend handles 404 error correctly"},{"id":"165","name":"utils/useBackend tests utils/useBackend useBackend tests useBackend handles 404 error with no message"},{"id":"166","name":"utils/useBackend tests utils/useBackend useBackendMutation tests useBackendMutation handles success correctly"},{"id":"167","name":"utils/useBackend tests utils/useBackend useBackendMutation tests useBackendMutation handles error correctly with response message"},{"id":"168","name":"utils/useBackend tests utils/useBackend useBackendMutation tests useBackendMutation handles error correctly with no response message"}],"source":"import { renderHook, waitFor } from \"@testing-library/react\";\nimport { act } from \"react\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { toast } from \"react-toastify\";\nimport { useBackend, useBackendMutation } from \"main/utils/useBackend\";\nimport { vi } from \"vitest\";\n\nvi.mock(\"react-router\");\n\nconst mockToast = vi.spyOn(toast, \"error\").mockImplementation();\n\ndescribe(\"utils/useBackend tests\", () => {\n  beforeEach(() => {\n    vi.clearAllMocks();\n  });\n  describe(\"utils/useBackend useBackend tests\", () => {\n    test(\"useBackend handles 404 error correctly\", async () => {\n      vi.spyOn(console, \"error\");\n      console.error.mockImplementation(() => null);\n\n      // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            //  turns retries off\n            retry: false,\n          },\n        },\n      });\n\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      var axiosMock = new AxiosMockAdapter(axios);\n\n      axiosMock\n        .onGet(\"/api/admin/users\")\n        .reply(404, { message: \"Error: Request failed with status code 404\" });\n\n      const { result } = renderHook(\n        () =>\n          useBackend(\n            [\"/api/admin/users\"],\n            { method: \"GET\", url: \"/api/admin/users\" },\n            [\"initialData\"],\n          ),\n        { wrapper },\n      );\n\n      await waitFor(() => result.current.isError);\n\n      expect(result.current.data).toEqual([\"initialData\"]);\n      await waitFor(() => expect(mockToast).toHaveBeenCalledTimes(1));\n      expect(mockToast).toHaveBeenCalledWith(\n        \"Error: Request failed with status code 404\",\n      );\n\n      console.error.mockRestore();\n    });\n\n    test(\"useBackend handles 404 error with no message\", async () => {\n      vi.spyOn(console, \"error\");\n      console.error.mockImplementation(() => null);\n\n      // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            //  turns retries off\n            retry: false,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      var axiosMock = new AxiosMockAdapter(axios);\n\n      axiosMock.onGet(\"/api/admin/users\").reply(404);\n\n      const { result } = renderHook(\n        () =>\n          useBackend(\n            [\"/api/admin/users\"],\n            { method: \"GET\", url: \"/api/admin/users\" },\n            [\"initialData\"],\n          ),\n        { wrapper },\n      );\n\n      await waitFor(() => result.current.isError);\n\n      expect(result.current.data).toEqual([\"initialData\"]);\n      await waitFor(() => expect(mockToast).toHaveBeenCalledTimes(1));\n      expect(mockToast).toHaveBeenCalledWith(\n        \"Error communicating with backend via GET on /api/admin/users\",\n      );\n\n      console.error.mockRestore();\n    });\n  });\n  describe(\"utils/useBackend useBackendMutation tests\", () => {\n    test(\"useBackendMutation handles success correctly\", async () => {\n      // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            //  turns retries off\n            retry: false,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      var axiosMock = new AxiosMockAdapter(axios);\n\n      axiosMock.onPost(\"/api/ucsbdates/post\").reply(202, {\n        id: 17,\n        quarterYYYYQ: \"20221\",\n        name: \"Groundhog Day\",\n        localDateTime: \"2022-02-02T12:00\",\n      });\n\n      const objectToAxiosParams = (ucsbDate) => ({\n        url: \"/api/ucsbdates/post\",\n        method: \"POST\",\n        params: {\n          quarterYYYYQ: ucsbDate.quarterYYYYQ,\n          name: ucsbDate.name,\n          localDateTime: ucsbDate.localDateTime,\n        },\n      });\n\n      const onSuccess = vi.fn().mockImplementation((ucsbDate) => {\n        mockToast(\n          `New ucsbDate Created - id: ${ucsbDate.id} name: ${ucsbDate.name}`,\n        );\n      });\n\n      const { result } = renderHook(\n        () =>\n          useBackendMutation(objectToAxiosParams, { onSuccess }, [\n            \"/api/ucsbdates/all\",\n          ]),\n        { wrapper },\n      );\n\n      const mutation = result.current;\n      act(() =>\n        mutation.mutate({\n          quarterYYYYQ: \"20221\",\n          name: \"Groundhog Day\",\n          localDateTime: \"2022-02-02T12:00\",\n        }),\n      );\n\n      await waitFor(() => expect(onSuccess).toHaveBeenCalled());\n      expect(mockToast).toHaveBeenCalledWith(\n        \"New ucsbDate Created - id: 17 name: Groundhog Day\",\n      );\n    });\n\n    test(\"useBackendMutation handles error correctly with response message\", async () => {\n      vi.spyOn(console, \"error\");\n      console.error.mockImplementation(() => null);\n\n      // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            //  turns retries off\n            retry: false,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock\n        .onPost(\"/api/ucsbdates/post\")\n        .reply(404, { message: \"Error: Request failed with status code 404\" });\n\n      const objectToAxiosParams = (ucsbDate) => ({\n        url: \"/api/ucsbdates/post\",\n        method: \"POST\",\n        params: {\n          quarterYYYYQ: ucsbDate.quarterYYYYQ,\n          name: ucsbDate.name,\n          localDateTime: ucsbDate.localDateTime,\n        },\n      });\n\n      const onSuccess = vi.fn().mockImplementation((ucsbDate) => {\n        mockToast(\n          `New ucsbDate Created - id: ${ucsbDate.id} name: ${ucsbDate.name}`,\n        );\n      });\n\n      const { result } = renderHook(\n        () => useBackendMutation(objectToAxiosParams, { onSuccess }),\n        { wrapper },\n      );\n\n      const mutation = result.current;\n\n      mutation.mutate({\n        quarterYYYYQ: \"20221\",\n        name: \"Groundhog Day\",\n        localDateTime: \"2022-02-02T12:00\",\n      });\n\n      await waitFor(() => expect(mockToast).toHaveBeenCalledTimes(1));\n      expect(mockToast).toHaveBeenCalledWith(\n        \"Error: Request failed with status code 404\",\n      );\n\n      console.error.mockRestore();\n    });\n\n    test(\"useBackendMutation handles error correctly with no response message\", async () => {\n      vi.spyOn(console, \"error\");\n      console.error.mockImplementation(() => null);\n\n      // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            //  turns retries off\n            retry: false,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onPost(\"/api/ucsbdates/post\").reply(404);\n\n      const objectToAxiosParams = (ucsbDate) => ({\n        url: \"/api/ucsbdates/post\",\n        method: \"POST\",\n        params: {\n          quarterYYYYQ: ucsbDate.quarterYYYYQ,\n          name: ucsbDate.name,\n          localDateTime: ucsbDate.localDateTime,\n        },\n      });\n\n      const onSuccess = vi.fn().mockImplementation((ucsbDate) => {\n        mockToast(\n          `New ucsbDate Created - id: ${ucsbDate.id} name: ${ucsbDate.name}`,\n        );\n      });\n\n      const { result } = renderHook(\n        () => useBackendMutation(objectToAxiosParams, { onSuccess }),\n        { wrapper },\n      );\n\n      const mutation = result.current;\n\n      mutation.mutate({\n        quarterYYYYQ: \"20221\",\n        name: \"Groundhog Day\",\n        localDateTime: \"2022-02-02T12:00\",\n      });\n      await waitFor(() => expect(mockToast).toHaveBeenCalledTimes(1));\n      expect(mockToast).toHaveBeenCalledWith(\n        \"Error communicating with backend via post on /api/ucsbdates/post\",\n      );\n\n      console.error.mockRestore();\n    });\n  });\n});\n"},"src/tests/pages/AdminViewPlayPage.test.jsx":{"tests":[{"id":"169","name":"AdminViewPlayPage tests renders without crashing"},{"id":"170","name":"AdminViewPlayPage tests Make sure that both the Announcements and Welcome Farmer components show up"},{"id":"171","name":"AdminViewPlayPage tests Chat toggle button opens and closes the ChatPanel"},{"id":"172","name":"AdminViewPlayPage tests Chat button and container have correct styles"},{"id":"173","name":"AdminViewPlayPage tests displays read-only banner"},{"id":"174","name":"AdminViewPlayPage tests renders when userCommons is falsy but commonsPlus is truthy"},{"id":"175","name":"AdminViewPlayPage tests renders when userCommons is truthy and commonsPlus is falsy"},{"id":"176","name":"AdminViewPlayPage tests renders CardGroup when userCommons and commonsPlus are truthy"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport AdminViewPlayPage from \"main/pages/AdminViewPlayPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { vi } from \"vitest\";\n\nvi.mock(\"react-router\", async () => ({\n  ...(await vi.importActual(\"react-router\")),\n  useParams: () => ({\n    userId: 1,\n    commonsId: 1,\n  }),\n}));\n\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async () => {\n  const originalModule = await vi.importActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"AdminViewPlayPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n  const queryClient = new QueryClient();\n\n  beforeEach(() => {\n    const userCommons = {\n      commonsId: 1,\n      id: 1,\n      totalWealth: 0,\n      userId: 1,\n    };\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n    axiosMock\n      .onGet(\"/api/usercommons\", {\n        params: { userId: 1, commonsId: 1 },\n      })\n      .reply(200, userCommons);\n    axiosMock.onGet(\"/api/commons\", { params: { id: 1 } }).reply(200, {\n      id: 1,\n      name: \"Sample Commons\",\n    });\n    axiosMock.onGet(\"/api/commons/all\").reply(200, [\n      {\n        id: 1,\n        name: \"Sample Commons\",\n      },\n    ]);\n\n    axiosMock.onGet(\"/api/commons/plus\", { params: { id: 1 } }).reply(200, {\n      commons: {\n        id: 1,\n        name: \"Sample Commons\",\n      },\n      totalPlayers: 5,\n      totalCows: 5,\n    });\n    axiosMock\n      .onGet(\"/api/profits/all\", {\n        params: {\n          userId: 1,\n          commonsId: 1,\n        },\n      })\n      .reply(200, []);\n    axiosMock.onPut(\"/api/usercommons/sell\").reply(200, userCommons);\n    axiosMock.onPut(\"/api/usercommons/buy\").reply(200, userCommons);\n  });\n\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminViewPlayPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"Make sure that both the Announcements and Welcome Farmer components show up\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminViewPlayPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(/Announcements/)).toBeInTheDocument();\n    expect(await screen.findByTestId(\"CommonsPlay\")).toBeInTheDocument();\n  });\n\n  test(\"Chat toggle button opens and closes the ChatPanel\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminViewPlayPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"adminviewplaypage-chat-toggle\"),\n      ).toBeInTheDocument();\n    });\n\n    // Make sure the chat toggle button is visible\n    const chatToggleButton = screen.getByTestId(\n      \"adminviewplaypage-chat-toggle\",\n    );\n    expect(chatToggleButton).toBeInTheDocument();\n\n    // Make sure the ChatPanel is not visible initially\n    expect(screen.queryByTestId(\"ChatPanel\")).not.toBeInTheDocument();\n\n    // Click the chat toggle button to open the ChatPanel\n    fireEvent.click(chatToggleButton);\n\n    // Wait for the ChatPanel to become visible\n    await waitFor(() => {\n      expect(screen.getByTestId(\"ChatPanel\")).toBeInTheDocument();\n    });\n\n    // Click the chat toggle button again to close the ChatPanel\n    fireEvent.click(chatToggleButton);\n\n    // Wait for the ChatPanel to become hidden\n    await waitFor(() => {\n      expect(screen.queryByTestId(\"ChatPanel\")).not.toBeInTheDocument();\n    });\n  });\n\n  test(\"Chat button and container have correct styles\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminViewPlayPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"adminviewplaypage-chat-toggle\"),\n      ).toBeInTheDocument();\n    });\n\n    const chatButton = screen.getByTestId(\"adminviewplaypage-chat-toggle\");\n    const chatContainer = screen.getByTestId(\"adminviewplaypage-chat-div\");\n\n    expect(chatButton).toHaveTextContent(\"\");\n\n    // Click the chat toggle button to open the ChatPanel\n    fireEvent.click(chatButton);\n\n    await waitFor(() => {\n      expect(chatButton).toHaveTextContent(\"\");\n    });\n\n    // Check styles for the chat button\n    expect(chatButton).toHaveStyle(`\n            width: 40px;\n            height: 40px;\n            border-radius: 50%;\n            background-color: lightblue;\n            color: black;\n            position: fixed;\n            bottom: 20px;\n            right: 20px;\n        `);\n\n    // Check styles for the chat container\n    expect(chatContainer).toHaveStyle(`\n            width: 550px;\n            position: fixed;\n            bottom: 100px;\n            right: 20px;\n        `);\n  });\n  test(\"displays read-only banner\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminViewPlayPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByText(/This is a Admin Feature for/),\n    ).toBeInTheDocument();\n    expect(await screen.findByText(/Visiting Farmer/)).toBeInTheDocument();\n    expect(await screen.findByText(/Play Page for common/)).toBeInTheDocument();\n\n    const bannerElement = screen.getByTestId(\n      \"adminviewplaypage-read-only-banner\",\n    );\n\n    expect(bannerElement).toHaveStyle(\n      `\n            background: rgb(240, 240, 240);\n            padding: 10px;\n            textAlign: center\n            `,\n    );\n    expect(bannerElement).toHaveTextContent(\n      \"This is a Admin Feature for Phillip ConradVisiting Farmer 's Play Page for common Sample Commons in Read Only Mode.\",\n    );\n  });\n\n  test(\"renders when userCommons is falsy but commonsPlus is truthy\", async () => {\n    // Mock the response so that userCommons is falsy but commonsPlus is truthy\n    axiosMock\n      .onGet(\"/api/usercommons\", {\n        params: { userId: 1, commonsId: 1 },\n      })\n      .reply(200, null);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminViewPlayPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Ensure that the component renders without crashing\n    expect(\n      await screen.findByText(/This is a Admin Feature for/),\n    ).toBeInTheDocument();\n    expect(await screen.findByText(/Visiting Farmer/)).toBeInTheDocument();\n    expect(await screen.findByText(/Play Page for common/)).toBeInTheDocument();\n  });\n  test(\"renders when userCommons is truthy and commonsPlus is falsy\", async () => {\n    axiosMock\n      .onGet(\"/api/commons/plus\", { params: { id: 1 } })\n      .reply(200, null);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminViewPlayPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Ensure that the component renders without crashing\n    expect(\n      await screen.findByText(/This is a Admin Feature for/),\n    ).toBeInTheDocument();\n    expect(await screen.findByText(/Visiting Farmer/)).toBeInTheDocument();\n    expect(await screen.findByText(/Play Page for common/)).toBeInTheDocument();\n  });\n  test(\"renders CardGroup when userCommons and commonsPlus are truthy\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminViewPlayPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Ensure that the component renders the CardGroup when conditions are met\n    expect(\n      await screen.findByTestId(\"adminviewplaypage-card-group\"),\n    ).toBeInTheDocument();\n  });\n});\n"},"src/tests/pages/HomePage.test.jsx":{"tests":[{"id":"177","name":"HomePage tests renders without crashing when lists return empty list"},{"id":"178","name":"HomePage tests renders with default for commons when api times out"},{"id":"179","name":"HomePage tests expected CSS properties"},{"id":"180","name":"HomePage tests renders without crashing when lists are full"},{"id":"181","name":"HomePage tests Redirects to the PlayPage when you click visit"},{"id":"182","name":"HomePage tests Calls the callback when you click join"},{"id":"183","name":"HomePage tests Check hour null is working, and that the background image is set correctly"},{"id":"184","name":"HomePage tests Home page intro card has the correct styles applied"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport HomePage from \"main/pages/HomePage\";\nimport commonsFixtures from \"fixtures/commonsFixtures\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport getBackgroundImage from \"main/components/Utils/HomePageBackground\";\nimport { vi } from \"vitest\";\n\nimport \"main/pages/HomePage.css\";\n\nconst mockNavigate = vi.fn();\nvi.mock(\"react-router\", async () => ({\n  ...(await vi.importActual(\"react-router\")),\n  useParams: () => ({\n    commonsId: 1,\n  }),\n  useNavigate: () => mockNavigate,\n}));\n\ndescribe(\"HomePage tests\", () => {\n  const queryClient = new QueryClient();\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    vi.clearAllMocks();\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  test(\"renders without crashing when lists return empty list\", async () => {\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock.onGet(\"/api/commons/all\").reply(200, []);\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const mainDiv = screen.getByTestId(\"HomePage-main-div\");\n    expect(mainDiv).toBeInTheDocument();\n\n    const title = screen.getByTestId(\"homePage-title\");\n    expect(title).toBeInTheDocument();\n    expect(typeof title.textContent).toBe(\"string\");\n\n    await waitFor(() => {\n      expect(title.textContent).toEqual(\"Howdy Farmer Phillip\");\n    });\n  });\n\n  test(\"renders with default for commons when api times out\", () => {\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock.onGet(\"/api/commons/all\").timeout();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const mainDiv = screen.getByTestId(\"HomePage-main-div\");\n    expect(mainDiv).toBeInTheDocument();\n\n    const title = screen.getByTestId(\"homePage-title\");\n    expect(title).toBeInTheDocument();\n    expect(typeof title.textContent).toBe(\"string\");\n    expect(title.textContent).toEqual(\"Howdy Farmer Phillip\");\n  });\n\n  test(\"expected CSS properties\", () => {\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock.onGet(\"/api/commons/all\").reply(200, []);\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const title = screen.getByTestId(\"homePage-title\");\n    expect(title).toHaveAttribute(\"class\", \"animate-charcter\");\n  });\n\n  test(\"renders without crashing when lists are full\", () => {\n    apiCurrentUserFixtures.userOnly.user.commons = commonsFixtures.oneCommons;\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const title = screen.getByTestId(\"homePage-title\");\n    expect(title).toBeInTheDocument();\n    expect(typeof title.textContent).toBe(\"string\");\n    expect(title.textContent).toEqual(\"Howdy Farmer Phillip\");\n  });\n\n  test(\"Redirects to the PlayPage when you click visit\", async () => {\n    apiCurrentUserFixtures.userOnly.user.commons = commonsFixtures.oneCommons;\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(\"commonsCard-button-Visit-1\"),\n    ).toBeInTheDocument();\n    const visitButton = screen.getByTestId(\"commonsCard-button-Visit-1\");\n    fireEvent.click(visitButton);\n\n    await waitFor(() => {\n      expect(mockNavigate).toHaveBeenCalledWith(\"/play/1\");\n    });\n  });\n\n  test(\"Calls the callback when you click join\", async () => {\n    apiCurrentUserFixtures.userOnly.user.commons = commonsFixtures.oneCommons;\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n    axiosMock\n      .onPost(\"/api/commons/join\")\n      .reply(200, commonsFixtures.threeCommons[0]);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(\"commonsCard-button-Join-4\"),\n    ).toBeInTheDocument();\n    const joinButton = screen.getByTestId(\"commonsCard-button-Join-4\");\n    fireEvent.click(joinButton);\n\n    await waitFor(() => {\n      expect(axiosMock.history.post.length).toBe(1);\n    });\n    expect(axiosMock.history.post[0].url).toBe(\"/api/commons/join\");\n    expect(axiosMock.history.post[0].params).toEqual({ commonsId: 4 });\n  });\n\n  test(\"Check hour null is working, and that the background image is set correctly\", async () => {\n    apiCurrentUserFixtures.userOnly.user.commons = commonsFixtures.oneCommons;\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n    axiosMock\n      .onPost(\"/api/commons/join\")\n      .reply(200, commonsFixtures.threeCommons[0]);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePage hour={12} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(\"commonsCard-button-Join-4\"),\n    ).toBeInTheDocument();\n    const joinButton = screen.getByTestId(\"commonsCard-button-Join-4\");\n    fireEvent.click(joinButton);\n\n    await waitFor(() => {\n      expect(axiosMock.history.post.length).toBe(1);\n    });\n    expect(axiosMock.history.post[0].url).toBe(\"/api/commons/join\");\n    expect(axiosMock.history.post[0].params).toEqual({ commonsId: 4 });\n  });\n\n  test(\"Home page intro card has the correct styles applied\", async () => {\n    apiCurrentUserFixtures.userOnly.user.commons = commonsFixtures.oneCommons;\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n    axiosMock\n      .onPost(\"/api/commons/join\")\n      .reply(200, commonsFixtures.threeCommons[0]);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePage hour={12} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(\"HomePage-intro-card\"),\n    ).toBeInTheDocument();\n\n    const HomePageDiv = screen.getByTestId(\"HomePage-main-div\");\n    expect(HomePageDiv).toHaveStyle(\"backgroundSize: cover;\");\n\n    const Background = getBackgroundImage(12);\n    expect(HomePageDiv).toHaveStyle(`backgroundImage: url(${Background});`);\n\n    expect(\n      await screen.findByTestId(\"HomePage-intro-card\"),\n    ).toBeInTheDocument();\n  });\n});\n"},"src/tests/pages/AdminListCommonsPage.test.jsx":{"tests":[{"id":"185","name":"AdminListCommonPage tests renders without crashing for regular user"},{"id":"186","name":"AdminListCommonPage tests renders without crashing for admin user"},{"id":"187","name":"AdminListCommonPage tests renders three commons without crashing for admin user"},{"id":"188","name":"AdminListCommonPage tests renders empty table when backend unavailable, user only"},{"id":"189","name":"AdminListCommonPage tests what happens when you click delete, admin"},{"id":"190","name":"AdminListCommonPage tests what happens when you click edit as an admin"},{"id":"191","name":"AdminListCommonPage tests what happens when you click leaderboard as an admin"},{"id":"192","name":"AdminListCommonPage tests correct href for stats csv button as an admin"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport mockConsole from \"tests/testutils/mockConsole\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport AdminListCommonPage from \"main/pages/AdminListCommonPage\";\nimport commonsPlusFixtures from \"fixtures/commonsPlusFixtures\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { vi } from \"vitest\";\n\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async () => {\n  const originalModule = await vi.importActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\nconst mockedNavigate = vi.fn();\n\nvi.mock(\"react-router\", async () => ({\n  ...(await vi.importActual(\"react-router\")),\n  useNavigate: () => mockedNavigate,\n}));\n\ndescribe(\"AdminListCommonPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  const testId = \"CommonsTable\";\n\n  const setupUserOnly = () => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  };\n\n  const setupAdminUser = () => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.adminUser);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  };\n\n  test(\"renders without crashing for regular user\", () => {\n    setupUserOnly();\n    const queryClient = new QueryClient();\n    axiosMock.onGet(\"/api/commons/allplus\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminListCommonPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"renders without crashing for admin user\", () => {\n    setupAdminUser();\n    const queryClient = new QueryClient();\n    axiosMock.onGet(\"/api/commons/allplus\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminListCommonPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"renders three commons without crashing for admin user\", async () => {\n    setupAdminUser();\n    const queryClient = new QueryClient();\n    axiosMock\n      .onGet(\"/api/commons/allplus\")\n      .reply(200, commonsPlusFixtures.threeCommonsPlus);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminListCommonPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(`${testId}-cell-row-0-col-commons.id`),\n    ).toHaveTextContent(\"1\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-commons.id`),\n    ).toHaveTextContent(\"2\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-2-col-commons.id`),\n    ).toHaveTextContent(\"3\");\n    expect(screen.getByText(`Download All Stats`)).toBeInTheDocument();\n  });\n\n  test(\"renders empty table when backend unavailable, user only\", async () => {\n    setupUserOnly();\n\n    const queryClient = new QueryClient();\n    axiosMock.onGet(\"/api/commons/allplus\").timeout();\n\n    const restoreConsole = mockConsole();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminListCommonPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n    restoreConsole();\n\n    expect(\n      screen.queryByTestId(`${testId}-cell-row-0-col-commons.id`),\n    ).not.toBeInTheDocument();\n    expect(screen.getByText(`Download All Stats`)).toBeInTheDocument();\n  });\n\n  test(\"what happens when you click delete, admin\", async () => {\n    setupAdminUser();\n\n    const queryClient = new QueryClient();\n    axiosMock\n      .onGet(\"/api/commons/allplus\")\n      .reply(200, commonsPlusFixtures.threeCommonsPlus);\n    axiosMock\n      .onDelete(\"/api/commons\", { params: { id: 1 } })\n      .reply(200, \"Commons with id 1 was deleted\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminListCommonPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(`${testId}-cell-row-0-col-commons.id`),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-commons.id`),\n    ).toHaveTextContent(\"1\");\n\n    const deleteButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n\n    fireEvent.click(deleteButton);\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"CommonsTable-Modal-Delete\"),\n      ).toBeInTheDocument();\n    });\n\n    const modalDelete = screen.getByTestId(\"CommonsTable-Modal-Delete\");\n    fireEvent.click(modalDelete);\n\n    await waitFor(() => {\n      expect(mockToast).toBeCalledWith(\"Commons with id 1 was deleted\");\n    });\n  });\n\n  test(\"what happens when you click edit as an admin\", async () => {\n    setupAdminUser();\n\n    const queryClient = new QueryClient();\n    axiosMock\n      .onGet(\"/api/commons/allplus\")\n      .reply(200, commonsPlusFixtures.threeCommonsPlus);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminListCommonPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(`${testId}-cell-row-0-col-commons.id`),\n    ).toHaveTextContent(\"1\");\n\n    const editButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Edit-button`,\n    );\n    expect(editButton).toBeInTheDocument();\n\n    fireEvent.click(editButton);\n\n    await waitFor(() =>\n      expect(mockedNavigate).toHaveBeenCalledWith(\"/admin/editcommons/1\"),\n    );\n  });\n\n  test(\"what happens when you click leaderboard as an admin\", async () => {\n    setupAdminUser();\n\n    const queryClient = new QueryClient();\n    axiosMock\n      .onGet(\"/api/commons/allplus\")\n      .reply(200, commonsPlusFixtures.threeCommonsPlus);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminListCommonPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(`${testId}-cell-row-0-col-commons.id`),\n    ).toHaveTextContent(\"1\");\n\n    const leaderboardButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Leaderboard-button`,\n    );\n    expect(leaderboardButton).toBeInTheDocument();\n\n    fireEvent.click(leaderboardButton);\n\n    await waitFor(() =>\n      expect(mockedNavigate).toHaveBeenCalledWith(\"/leaderboard/1\"),\n    );\n  });\n\n  test(\"correct href for stats csv button as an admin\", async () => {\n    setupAdminUser();\n\n    const queryClient = new QueryClient();\n    axiosMock\n      .onGet(\"/api/commons/allplus\")\n      .reply(200, commonsPlusFixtures.threeCommonsPlus);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminListCommonPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(`${testId}-cell-row-0-col-commons.id`),\n    ).toHaveTextContent(\"1\");\n\n    const statsCSVButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Stats CSV-button`,\n    );\n    expect(statsCSVButton).toHaveAttribute(\n      \"href\",\n      \"/api/commonstats/download?commonsId=1\",\n    );\n  });\n});\n"},"src/tests/components/Users/UsersTable.test.jsx":{"tests":[{"id":"193","name":"UserTable tests renders without crashing for empty table"},{"id":"194","name":"UserTable tests renders without crashing for three users"},{"id":"195","name":"UserTable tests Has the expected colum headers and content"},{"id":"196","name":"Modal tests Clicking Suspend button opens th e\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"1\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-admin`),\n    ).toHaveTextContent(\"true\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-lastOnline`),\n    ).toHaveTextContent(formatTime(usersFixtures.threeUsers[0].lastOnline));\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-suspended`),\n    ).toHaveTextContent(\"false\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Suspend-button`),\n    ).toHaveClass(\"btn-danger\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Restore-button`),\n    ).toHaveClass(\"btn-primary\");\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\n      \"2\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-admin`),\n    ).toHaveTextContent(\"false\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-2-col-suspended`),\n    ).toHaveTextContent(\"true\");\n  });\n});\n\ndescribe(\"Modal tests\", () => {\n  beforeEach(() => {\n    vi.clearAllMocks();\n  });\n\n  test(\"Clicking Suspend button opens the modal for suspendUser\", async () => {\n    render(<"+"UsersTable users={usersFixtures.threeUsers} />);\n\n    await waitFor(() => {\n      expect(document.body).not.toHaveClass(\"modal-open\");\n    });\n\n    const suspendButtons = screen.getAllByText(\"Suspend\");\n    fireEvent.click(suspendButtons[1]);\n\n    await waitFor(() => {\n      expect(document.body).toHaveClass(\"modal-open\");\n    });\n\n    await waitFor(() => {\n      expect(\n        screen.getByText(\n          \"Are you sure you want to suspend \" +\n            usersFixtures.threeUsers[0].email +\n            \"?\",\n        ),\n      ).toBeInTheDocument();\n    });\n  });\n\n  test(\"Clicking confirm suspend button calls suspendUser\", async () => {\n    render(<"+"UsersTable users={usersFixtures.threeUsers} />);\n\n    const suspendButtons = screen.getAllByText(\"Suspend\");\n    fireEvent.click(suspendButtons[1]);\n\n    await waitFor(() => {\n      expect(document.body).toHaveClass(\"modal-open\");\n    });\n\n    const confirmSuspendButton = screen.getByText(\"Confirm Suspend\");\n    fireEvent.click(confirmSuspendButton);\n\n    await waitFor(() => {\n      expect(document.body).not.toHaveClass(\"modal-open\");\n    });\n\n    await waitFor(() => {\n      expect(mockMutate).toHaveBeenCalled();\n    });\n  });\n\n  test(\"Pressing the cancel button on the suspended modal cancels the suspension\", async () => {\n    render(<"+"UsersTable users={usersFixtures.threeUsers} />);\n\n    const suspendButtons = screen.getAllByText(\"Suspend\");\n    fireEvent.click(suspendButtons[1]);\n\n    await waitFor(() => {\n      expect(document.body).toHaveClass(\"modal-open\");\n    });\n\n    const cancelButton = screen.getByText(\"Cancel\");\n    fireEvent.click(cancelButton);\n\n    await waitFor(() => {\n      expect(document.body).not.toHaveClass(\"modal-open\");\n    });\n    expect(mockMutate).not.toHaveBeenCalled();\n  });\n\n  test(\"Pressing the escape key on the suspended modal cancels the suspension\", async () => {\n    render(<"+"UsersTable users={usersFixtures.threeUsers} />);\n\n    const suspendButtons = screen.getAllByText(\"Suspend\");\n    fireEvent.click(suspendButtons[1]);\n\n    await waitFor(() => {\n      expect(document.body).toHaveClass(\"modal-open\");\n    });\n    fireEvent.keyDown(document, {\n      key: \"Escape\",\n      code: \"Escape\",\n      keyCode: 27,\n      charCode: 27,\n    });\n    await waitFor(() => {\n      expect(document.body).not.toHaveClass(\"modal-open\");\n    });\n\n    expect(mockMutate).not.toHaveBeenCalled();\n  });\n\n  test(\"Clicking Restore button opens the modal for restoreUser\", async () => {\n    render(<"+"UsersTable users={usersFixtures.threeUsers} />);\n\n    await waitFor(() => {\n      expect(document.body).not.toHaveClass(\"modal-open\");\n    });\n\n    const restoredButtons = screen.getAllByText(\"Restore\");\n    fireEvent.click(restoredButtons[1]);\n\n    await waitFor(() => {\n      expect(document.body).toHaveClass(\"modal-open\");\n    });\n\n    await waitFor(() => {\n      expect(\n        screen.getByText(\n          \"Are you sure you want to restore \" +\n            usersFixtures.threeUsers[0].email +\n            \"?\",\n        ),\n      ).toBeInTheDocument();\n    });\n  });\n\n  test(\"Clicking confirm restore button calls restoreUser\", async () => {\n    render(<"+"UsersTable users={usersFixtures.threeUsers} />);\n\n    const restoredButtons = screen.getAllByText(\"Restore\");\n    fireEvent.click(restoredButtons[1]);\n\n    await waitFor(() => {\n      expect(document.body).toHaveClass(\"modal-open\");\n    });\n\n    const confirmRestoredButton = screen.getByText(\"Confirm Restore\");\n    fireEvent.click(confirmRestoredButton);\n\n    await waitFor(() => {\n      expect(document.body).not.toHaveClass(\"modal-open\");\n    });\n\n    await waitFor(() => {\n      expect(mockMutate).toHaveBeenCalled();\n    });\n  });\n\n  test(\"Pressing the cancel button on the suspended modal cancels the restoration\", async () => {\n    render(<"+"UsersTable users={usersFixtures.threeUsers} />);\n\n    const restoredButtons = screen.getAllByText(\"Restore\");\n    fireEvent.click(restoredButtons[1]);\n\n    await waitFor(() => {\n      expect(document.body).toHaveClass(\"modal-open\");\n    });\n\n    const cancelButton = screen.getByText(\"Cancel\");\n    fireEvent.click(cancelButton);\n\n    await waitFor(() => {\n      expect(document.body).not.toHaveClass(\"modal-open\");\n    });\n    expect(mockMutate).not.toHaveBeenCalled();\n  });\n\n  test(\"Pressing the escape key on the restored modal cancels the restoration\", async () => {\n    render(<"+"UsersTable users={usersFixtures.threeUsers} />);\n\n    const restoredButtons = screen.getAllByText(\"Restore\");\n    fireEvent.click(restoredButtons[1]);\n\n    await waitFor(() => {\n      expect(document.body).toHaveClass(\"modal-open\");\n    });\n\n    fireEvent.keyDown(document, {\n      key: \"Escape\",\n      code: \"Escape\",\n      keyCode: 27,\n      charCode: 27,\n    });\n    await waitFor(() => {\n      expect(document.body).not.toHaveClass(\"modal-open\");\n    });\n\n    expect(mockMutate).not.toHaveBeenCalled();\n  });\n});\n"},"src/tests/components/Leaderboard/LeaderboardTable.test.jsx":{"tests":[{"id":"204","name":"LeaderboardTable tests renders without crashing for empty table with user not logged in"},{"id":"205","name":"LeaderboardTable tests renders without crashing for empty table for ordinary user"},{"id":"206","name":"LeaderboardTable tests renders without crashing for empty table for admin"},{"id":"207","name":"LeaderboardTable tests Has the expected column headers and content for adminUser"},{"id":"208","name":"LeaderboardTable tests Total wealth is formatted correctly"},{"id":"209","name":"LeaderboardTable tests Users are sorted correctly by total wealth"},{"id":"210","name":"LeaderboardTable tests Clicking on link navigates to the correct URL"}],"source":"import { render, screen, fireEvent } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport LeaderboardTable from \"main/components/Leaderboard/LeaderboardTable\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport leaderboardFixtures from \"fixtures/leaderboardFixtures\";\nimport { vi } from \"vitest\";\n\nconst mockedNavigate = vi.fn();\n\nvi.mock(\"react-router\", async () => ({\n  ...(await vi.importActual(\"react-router\")),\n  useNavigate: () => mockedNavigate,\n}));\n\ndescribe(\"LeaderboardTable tests\", () => {\n  const queryClient = new QueryClient();\n\n  test(\"renders without crashing for empty table with user not logged in\", () => {\n    const currentUser = null;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"LeaderboardTable leaderboardUsers={[]} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n  test(\"renders without crashing for empty table for ordinary user\", () => {\n    const currentUser = currentUserFixtures.userOnly;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"LeaderboardTable leaderboardUsers={[]} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"renders without crashing for empty table for admin\", () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"LeaderboardTable leaderboardUsers={[]} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"Has the expected column headers and content for adminUser\", () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"LeaderboardTable\n            leaderboardUsers={leaderboardFixtures.fiveUserCommonsLB}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedHeaders = [\n      \"Farmer\",\n      \"Total Wealth\",\n      \"Cows Owned\",\n      \"Cow Health\",\n      \"Cows Bought\",\n      \"Cows Sold\",\n      \"Cow Deaths\",\n    ];\n    const expectedFields = [\n      \"Farmer\",\n      \"totalWealth\",\n      \"numOfCows\",\n      \"cowHealth\",\n      \"cowsBought\",\n      \"cowsSold\",\n      \"cowDeaths\",\n    ];\n    const testId = \"LeaderboardTable\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Farmer`),\n    ).toHaveTextContent(\"one\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-totalWealth`),\n    ).toHaveTextContent(\"$1,000.00\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-numOfCows`),\n    ).toHaveTextContent(\"12\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-cowHealth`),\n    ).toHaveTextContent(\"93\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-cowsBought`),\n    ).toHaveTextContent(\"11\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-cowsSold`),\n    ).toHaveTextContent(\"10\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-cowDeaths`),\n    ).toHaveTextContent(\"9\");\n  });\n\n  test(\"Total wealth is formatted correctly\", () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"LeaderboardTable\n            leaderboardUsers={leaderboardFixtures.fiveUserCommonsLB}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getAllByText(\"$1,000.00\")[0]).toHaveStyle(\n      \"text-align: right;\",\n    );\n    expect(screen.getAllByText(\"12\")[0]).toHaveStyle(\"text-align: right;\");\n\n    expect(screen.getAllByText(\"93\")[0]).toHaveStyle(\"text-align: right;\");\n\n    expect(screen.getAllByText(\"11\")[0]).toHaveStyle(\"text-align: right;\");\n    expect(screen.getAllByText(\"10\")[0]).toHaveStyle(\"text-align: right;\");\n    expect(screen.getAllByText(\"9\")[0]).toHaveStyle(\"text-align: right;\");\n  });\n\n  test(\"Users are sorted correctly by total wealth\", () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"LeaderboardTable\n            leaderboardUsers={leaderboardFixtures.threeUserCommonsLB}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    // expected orders for sorting ascending/descending\n    const usersAscending = [\"two\", \"one\", \"three\"];\n    const usersDescending = [\"three\", \"one\", \"two\"];\n\n    const wealthHeader = screen.getByTestId(\n      \"LeaderboardTable-header-totalWealth\",\n    );\n    expect(wealthHeader).toBeInTheDocument();\n\n    fireEvent.click(wealthHeader);\n    expect(wealthHeader).toHaveTextContent(\"Total Wealth \");\n\n    for (let i = 1; i <"+" 3; i++) {\n      const username1 = screen.getByText(usersAscending[i - 1]);\n      const username2 = screen.getByText(usersAscending[i]);\n      expect(username1.compareDocumentPosition(username2)).toBe(4); // username2 follows username 1\n    }\n\n    fireEvent.click(wealthHeader);\n    expect(wealthHeader).toHaveTextContent(\"Total Wealth \");\n\n    for (let i = 1; i <"+" 3; i++) {\n      const username1 = screen.getByText(usersDescending[i - 1]);\n      const username2 = screen.getByText(usersDescending[i]);\n      expect(username1.compareDocumentPosition(username2)).toBe(4); // username2 follows username 1\n    }\n  });\n\n  test(\"Clicking on link navigates to the correct URL\", () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n ol-Log`),\n    ).toHaveTextContent(\n      `Updating cow health...Commons Blue, degradationRate: 0.1, carryingCapacity: 10User: Phill Conrad, numCows: 3, cowHealth: 100.0 old cow health: 100.0, new cow health: 100.0User: Phillip Conrad, numCows: 7, cowHealth: 100.0 old cow health: 100.0, new cow health: 100.0Commons Red, degradationRate: 0.1, carryingCapacity: 2User: Phill Conrad, numCows: 10, cowHealth: 54.40000000000016 old cow health: 54.40000000000016, new cow health: 53.600000000000165Cow health has been updated!`,\n    );\n\n    expect(\n      screen.getByTestId(`${testId}-header-id-sort-carets`),\n    ).toHaveTextContent(\"\");\n\n    const nextButton = screen.getByTestId(`${testId}-next-button`);\n    expect(nextButton).toBeInTheDocument();\n    expect(nextButton).toBeDisabled();\n\n    const previousButton = screen.getByTestId(`${testId}-previous-button`);\n    expect(previousButton).toBeInTheDocument();\n    expect(previousButton).toBeDisabled();\n  });\n\n  test(\"buttons are disabled where there are zero pages\", async () => {\n    // arrange\n\n    axiosMock\n      .onGet(\"/api/jobs/all/pageable\")\n      .reply(200, pagedJobsFixtures.emptyPage);\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PagedJobsTable />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBe(1);\n    });\n\n    expect(axiosMock.history.get[0].url).toBe(\"/api/jobs/all/pageable\");\n    expect(axiosMock.history.get[0].params).toEqual({ page: 0, size: 10 });\n\n    const nextButton = screen.getByTestId(`${testId}-next-button`);\n    expect(nextButton).toBeInTheDocument();\n    expect(nextButton).toBeDisabled();\n\n    const previousButton = screen.getByTestId(`${testId}-previous-button`);\n    expect(previousButton).toBeInTheDocument();\n    expect(previousButton).toBeDisabled();\n  });\n\n  test(\"renders correct content with multiple pages\", async () => {\n    // arrange\n\n    axiosMock\n      .onGet(\"/api/jobs/all/pageable\", { params: { page: 0, size: 10 } })\n      .reply(200, pagedJobsFixtures.fourPages[0]);\n    axiosMock\n      .onGet(\"/api/jobs/all/pageable\", { params: { page: 1, size: 10 } })\n      .reply(200, pagedJobsFixtures.fourPages[1]);\n    axiosMock\n      .onGet(\"/api/jobs/all/pageable\", { params: { page: 2, size: 10 } })\n      .reply(200, pagedJobsFixtures.fourPages[2]);\n    axiosMock\n      .onGet(\"/api/jobs/all/pageable\", { params: { page: 3, size: 10 } })\n      .reply(200, pagedJobsFixtures.fourPages[3]);\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PagedJobsTable />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    const expectedHeaders = [\"id\", \"Created\", \"Updated\", \"Status\", \"Log\"];\n    const expectedFields = [\"id\", \"Created\", \"Updated\", \"status\", \"Log\"];\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBe(1);\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(axiosMock.history.get[0].url).toBe(\"/api/jobs/all/pageable\");\n    expect(axiosMock.history.get[0].params).toEqual({ page: 0, size: 10 });\n\n    const nextButton = screen.getByTestId(`${testId}-next-button`);\n    expect(nextButton).toBeInTheDocument();\n\n    const previousButton = screen.getByTestId(`${testId}-previous-button`);\n    expect(previousButton).toBeInTheDocument();\n\n    expect(previousButton).toBeDisabled();\n    expect(nextButton).toBeEnabled();\n\n    expect(screen.getByText(`Page: 1`)).toBeInTheDocument(); } from \"react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { useNavigate } from \"react-router\";\nimport { useCurrentUser, useLogout, hasRole } from \"main/utils/currentUser\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { vi } from \"vitest\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\n\nvi.mock(\"react-router\");\nconst { MemoryRouter } = await vi.importActual(\"react-router\");\n\ndescribe(\"utils/currentUser tests\", () => {\n  describe(\"useCurrentUser tests\", () => {\n    test(\"useCurrentUser retrieves initial data\", async () => {\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            retry: false,\n            staleTime: Infinity,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      var axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/currentUser\").timeout();\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingNeither);\n\n      const { result } = renderHook(() => useCurrentUser(), {\n        wrapper,\n      });\n      await waitFor(() => result.current.isSuccess);\n\n      expect(result.current.data.loggedIn).toBe(false);\n      expect(result.current.data.root).toBe(null);\n\n      const queryState = queryClient.getQueryState(\"/api/currentUser\");\n      expect(queryState).toBeDefined();\n    });\n\n    test(\"useCurrentUser retrieves data from API\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      var axiosMock = new AxiosMockAdapter(axios);\n      axiosMock\n        .onGet(\"/api/currentUser\")\n        .reply(200, apiCurrentUserFixtures.userOnly);\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingNeither);\n\n      const { result } = renderHook(() => useCurrentUser(), {\n        wrapper,\n      });\n\n      await waitFor(() => result.current.isFetched);\n      expect(result.current.data.loggedIn).toBe(true);\n      expect(result.current.data.root).toBeTruthy();\n\n      queryClient.clear();\n      axiosMock.restore();\n    });\n\n    test(\"useCurrentUser when API unreachable\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      var axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/currentUser\").reply(404);\n\n      const restoreConsole = mockConsole();\n      const { result } = renderHook(() => useCurrentUser(), {\n        wrapper,\n      });\n\n      await waitFor(() => result.current.isFetched);\n      expect(console.error).toHaveBeenCalled();\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(/Error invoking axios.get:/);\n      restoreConsole();\n\n      await waitFor(() =>\n        expect(result.current.data).toEqual({ loggedIn: false, root: null }),\n      );\n      queryClient.clear();\n      axiosMock.restore();\n    });\n\n    test(\"useCurrentUser handles missing roles correctly\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const apiResult = apiCurrentUserFixtures.missingRolesToTestErrorHandling;\n      var axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/currentUser\").reply(200, apiResult);\n\n      const restoreConsole = mockConsole();\n      const { result } = renderHook(() => useCurrentUser(), {\n        wrapper,\n      });\n\n      await waitFor(() => result.current.isFetched);\n      expect(console.error).toHaveBeenCalled();\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(/Error getting roles: /);\n      restoreConsole();\n\n      let expectedResult = {\n        loggedIn: true,\n        root: { ...apiResult, rolesList: [\"ERROR_GETTING_ROLES\"] },\n      };\n      await waitFor(() => expect(result.current.data).toEqual(expectedResult));\n      queryClient.clear();\n    });\n  });\n\n  describe(\"useLogout tests\", () => {\n    test(\"useLogout\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"MemoryRouter>{children}<"+"/MemoryRouter>\n        <"+"/QueryClientProvider>\n      );\n\n      var axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onPost(\"/logout\").reply(200);\n\n      const navigateSpy = vi.fn();\n      useNavigate.mockImplementation(() => navigateSpy);\n\n      const resetQueriesSpy = vi.spyOn(queryClient, \"resetQueries\");\n\n      const { result } = renderHook(() => useLogout(), { wrapper });\n\n      act(() => {\n        expect(useNavigate).toHaveBeenCalled();\n        result.current.mutate();\n      });\n      await waitFor(() => expect(navigateSpy).toHaveBeenCalledWith(\"/\"));\n\n      await waitFor(() =>\n        expect(resetQueriesSpy).toHaveBeenCalledWith(\"/api/currentUser\", {\n          exact: true,\n        }),\n      );\n\n      queryClient.clear();\n    });\n  });\n  describe(\"hasRole tests\", () => {\n    test('hasRole(x,\"ROLE_ADMIN\") return falsy when currentUser ill-defined', async () => {\n      expect(hasRole(null, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(hasRole({}, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(hasRole({ loggedIn: null }, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(hasRole({ loggedIn: true }, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(hasRole({ loggedIn: true, root: null }, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(hasRole({ loggedIn: true, root: {} }, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(\n        hasRole({ loggedIn: true, root: { rolesList: null } }, \"ROLE_ADMIN\"),\n      ).toBeFalsy();\n    });\n\n    test('hasRole(x,\"ROLE_ADMIN\") returns correct values when currentUser properly defined', async () => {\n      expect(\n        hasRole({ loggedIn: true, root: { rolesList: [] } }, \"ROLE_ADMIN\"),\n      ).toBeFalsy();\n      expect(\n        hasRole(\n          { loggedIn: true, root: { rolesList: [\"ROLE_USER\"] } },\n          \"ROLE_ADMIN\",\n        ),\n      ).toBeFalsy();\n      expect(\n        hasRole(\n          { loggedIn: true, root: { rolesList: [\"ROLE_USER\", \"ROLE_ADMIN\"] } },\n          \"ROLE_ADMIN\",\n        ),\n      ).toBeTruthy();\n    });\n  });\n});\n"},"src/tests/components/Announcement/AnnouncementsTable.test.jsx":{"tests":[{"id":"221","name":"AnnouncementTable tests renders empty table correctly"},{"id":"222","name":"AnnouncementTable tests Has the expected column headers, content and buttons for admin user"},{"id":"223","name":"AnnouncementTable tests Has the expected column headers, content for ordinary user"},{"id":"224","name":"AnnouncementTable tests Edit button navigates to the edit page"},{"id":"225","name":"AnnouncementTable tests Delete button calls delete callback"}],"source":"import { fireEvent, render, waitFor, screen } from \"@testing-library/react\";\nimport { announcementFixtures } from \"fixtures/announcementFixtures\";\nimport AnnouncementTable from \"main/components/Announcement/AnnouncementTable\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { vi } from \"vitest\";\n\nconst mockedNavigate = vi.fn();\n\nvi.mock(
