stId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"1\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-startDate`),\n    ).toHaveTextContent(\"2024-12-12T00:00:00\");\n\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\n      \"2\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-startDate`),\n    ).toHaveTextContent(\"2022-12-12T00:00:00\");\n\n    const editButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Edit-button`,\n    );\n    expect(editButton).toBeInTheDocument();\n    expect(editButton).toHaveClass(\"btn-primary\");\n\n    const deleteButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n    expect(deleteButton).toHaveClass(\"btn-danger\");\n  });\n\n  test(\"Has the expected column headers, content for ordinary user\", () => {\n    // arrange\n    const currentUser = currentUserFixtures.userOnly;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AnnouncementTable\n            announcements={announcementFixtures.threeAnnouncements}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"1\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-startDate`),\n    ).toHaveTextContent(\"2024-12-12T00:00:00\");\n\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\n      \"2\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-startDate`),\n    ).toHaveTextContent(\"2022-12-12T00:00:00\");\n\n    expect(screen.queryByText(\"Delete\")).not.toBeInTheDocument();\n    expect(screen.queryByText(\"Edit\")).not.toBeInTheDocument();\n  });\n\n  test(\"Edit button navigates to the edit page\", async () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    // act - render the component\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AnnouncementTable\n            announcements={announcementFixtures.threeAnnouncements}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert - check that the expected content is rendered\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"1\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-startDate`),\n    ).toHaveTextContent(\"2024-12-12T00:00:00\");\n\n    const editButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Edit-button`,\n    );\n    expect(editButton).toBeInTheDocument();\n\n    // act - click the edit button\n    fireEvent.click(editButton);\n\n    // assert - check that the navigate function was called with the expected path\n    await waitFor(() =>\n      expect(mockedNavigate).toHaveBeenCalledWith(\"/announcements/edit/1\"),\n    );\n  });\n\n  test(\"Delete button calls delete callback\", async () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    // act - render the component\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AnnouncementTable\n            announcements={announcementFixtures.threeAnnouncements}\n     .reply(200, systemInfoFixtures.showingNeither);\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n  });\n\n  test(\"renders correct content with username\", async () => {\n    const message_no_name = chatMessageFixtures.oneChatMessage[0];\n\n    const message = { ...message_no_name, username: \"John Doe\" };\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"ChatMessageDisplay message={message} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    await waitFor(() => {\n      expect(screen.getByText(\"Hello World\")).toBeInTheDocument();\n    });\n\n    expect(message.userId).toBe(1);\n    expect(screen.getByText(\"John Doe\")).toBeInTheDocument();\n    expect(screen.getByText(\"2023-08-17 23:57:46\")).toBeInTheDocument();\n\n    // Assert for lines 11-16\n    const cardBody = screen.getByTestId(\"ChatMessageDisplay-1\");\n\n    const expectedBgColor = \"card bg-secondary text-white\";\n    expect(cardBody).toHaveClass(expectedBgColor);\n\n    expect(screen.getByTestId(\"ChatMessageDisplay-1-User\")).toHaveStyle(\n      \"margin: 0px\",\n    );\n    expect(screen.getByTestId(\"ChatMessageDisplay-1-Date\")).toHaveStyle(\n      \"margin: 0px\",\n    );\n\n    const styleDiv = screen.getByTestId(\n      \"ChatMessageDisplay-1-User\",\n    ).parentElement;\n\n    expect(styleDiv).toHaveStyle(\n      \"display: flex; justify-content: space-between; align-items: center\",\n    );\n    expect(screen.getByTestId(\"ChatMessageDisplay-1-User\")).toHaveStyle(\n      \"margin: 0px\",\n    );\n    expect(screen.getByTestId(\"ChatMessageDisplay-1-Date\")).toHaveStyle(\n      \"margin: 0px\",\n    );\n  });\n\n  test(\"renders correct content with empty username\", async () => {\n    const message_no_name = chatMessageFixtures.oneChatMessage[0];\n\n    const message = { ...message_no_name, username: \"\" };\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"ChatMessageDisplay message={message} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    await waitFor(() => {\n      expect(screen.getByText(\"Hello World\")).toBeInTheDocument();\n    });\n    expect(message.userId).toBe(1);\n\n    const cardBody = screen.getByTestId(\"ChatMessageDisplay-1\");\n\n    const expectedBgColor = \"card bg-secondary text-white\";\n    expect(cardBody).toHaveClass(expectedBgColor);\n\n    expect(screen.getByText(\"Anonymous\")).toBeInTheDocument();\n    expect(screen.getByText(\"2023-08-17 23:57:46\")).toBeInTheDocument();\n  });\n\n  test(\"renders correct content with no timestamp or username\", async () => {\n    const message_no_name = chatMessageFixtures.oneChatMessage[0];\n    message_no_name.timestamp = null;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"ChatMessageDisplay message={message_no_name} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"ChatMessageDisplay-1-Message\"),\n      ).toHaveTextContent(\"Hello World\");\n    });\n\n    const cardBody = screen.getByTestId(\"ChatMessageDisplay-1\");\n\n    const expectedBgColor = \"card bg-secondary text-white\";\n    expect(cardBody).toHaveClass(expectedBgColor);\n\n    expect(screen.getByTestId(\"ChatMessageDisplay-1-User\")).toHaveTextContent(\n      \"Anonymous\",\n    );\n    expect(screen.getByTestId(\"ChatMessageDisplay-1-Date\")).toHaveTextContent(\n      \"\",\n    );\n  });\n\n  test(\"renders correct content with no message\", async () => {\n    // act\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"ChatMessageDisplay />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"ChatMessageDisplay-undefined-Message\"),\n      ).toHaveTextContent(\"\");\n    });\n\n    const cardBody = screen.getByTestId(\"ChatMessageDisplay-undefined\");\n\n    const expectedBgColor = \"card bg-secondary text-white\";\n    expect(cardBody).toHaveClass(expectedBgColor);\n\n    expect(\n      screen.getByTestId(\"ChatMessageDisplay-undefined-User\"),\n    ).toHaveTextContent(\"Anonymous\");\n    expect(\n      screen.getByTestId(\"ChatMessageDisplay-undefined-Date\"),\n    ).toHaveTextContent(\"\");\n  });\n\n  test(\"current user message\", async () => {\n    const message = chatMessageFixtures.oneChatMessage[0];\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.adminUser);\n\n    message.userId = 2;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"ChatMessageDisplay message={message} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(message.userId).toBe(2);\n\n    const cardBody = screen.getByTestId(\"ChatMessageDisplay-1\");\n\n    const expectedBgColor = \"card bg-primary text-white\";\n    expect(cardBody).toHaveClass(expectedBgColor);\n\n    expect(screen.getByTestId(\"ChatMessageDisplay-1-User\")).toHaveStyle(\n      \"margin: 0px\",\n    );\n    expect(screen.getByTestId(\"ChatMessageDisplay-1-Date\")).toHaveStyle(\n      \"margin: 0px\",\n    );\n\n    const styleDiv = screen.getByTestId(\n      \"ChatMessageDisplay-1-User\",\n    ).parentElement;\n\n    expect(styleDiv).toHaveStyle(\n      \"display: flex; justify-content: space-between; align-items: center\",\n    );\n    expect(screen.getByTestId(\"ChatMessageDisplay-1-User\")).toHaveStyle(\n      \"margin: 0px\",\n    );\n    expect(screen.getByTestId(\"ChatMessageDisplay-1-Date\")).toHaveStyle(\n      \"margin: 0px\",\n    );\n  });\n});\n"},"src/tests/components/Commons/PagedProfitsTable.test.jsx":{"tests":[{"id":"231","name":"PagedProfitsTable tests renders correct content"},{"id":"232","name":"PagedProfitsTable tests buttons are disabled where there are zero pages"},{"id":"233","name":"PagedProfitsTable tests renders correct content with multiple pages"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport PagedProfitsTable from \"main/components/Commons/PagedProfitsTable\";\nimport pagedProfitsFixtures from \"fixtures/pagedProfitsFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\ndescribe(\"PagedProfitsTable tests\", () => {\n  const queryClient = new QueryClient();\n\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  const testId = \"PagedProfitsTable\";\n\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    queryClient.clear();\n  });\n\n  test(\"renders correct content\", async () => {\n    // arrange\n    axiosMock\n      .onGet(\"/api/profits/paged/commonsid\")\n      .reply(200, pagedProfitsFixtures.onePage);\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PagedProfitsTable />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    const expectedHeaders = [\"Profit\", \"Date\", \"Health\", \"Cows\"];\n    const expectedFields = [\"amount\", \"timestamp\", \"avgCowHealth\", \"numCows\"];\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    await screen.findByTestId(`${testId}-cell-row-0-col-amount`);\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(axiosMock.history.get[0].url).toBe(\"/api/profits/paged/commonsid\");\n    expect(axiosMock.history.get[0].params).toEqual({\n      commonsId: undefined,\n      pageNumber: 0,\n      pageSize: 5,\n    });\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-amount`),\n    ).toHaveTextContent(\"110\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-timestamp`),\n    ).toHaveTextContent(\"2024-06-16\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-avgCowHealth`),\n    ).toHaveTextContent(\"100.00%\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-numCows`),\n    ).toHaveTextContent(\"5\");\n\n    const divContainer = screen.getByTestId(\"PagedProfitsTable-CSS\");\n    expect(divContainer).toHaveStyle({ display: \"flex\", overflow: \"auto\" });\n    expect(\n      screen.getByTestId(`${testId}-header-timestamp-sort-carets`),\n    ).toHaveTextContent(\"\");\n\n    const nextButton = screen.getByTestId(`${testId}-next-button`);\n    expect(nextButton).toBeInTheDocument();\n    expect(nextButton).toBeDisabled();\n\n    const previousButton = screen.getByTestId(`${testId}-previous-button`);\n    expect(previousButton).toBeInTheDocument();\n    expect(previousButton).toBeDisabled();\n  });\n\n  test(\"buttons are disabled where there are zero pages\", async () => {\n    // arrange\n\n    axiosMock\n      .onGet(\"/api/profits/paged/commonsid\")\n      .reply(200, pagedProfitsFixtures.emptyPage);\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PagedProfitsTable />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBe(1);\n    });\n\n    expect(axiosMock.history.get[0].url).toBe(\"/api/profits/paged/commonsid\");\n    expect(axiosMock.history.get[0].params).toEqual({\n      commonsId: undefined,\n      pageNumber: 0,\n      pageSize: 5,\n    });\n\n    const nextButton = screen.getByTestId(`${testId}-next-button`);\n    expect(nextButton).toBeInTheDocument();\n    expect(nextButton).toBeDisabled();\n\n    const previousButton = screen.getByTestId(`${testId}-previous-button`);\n    expect(previousButton).toBeInTheDocument();\n    expect(previousButton).toBeDisabled();\n  });\n\n  test(\"renders correct content with multiple pages\", async () => {\n    // arrange\n\n    axiosMock\n      .onGet(\"/api/profits/paged/commonsid\", {\n        params: { commonsId: undefined, pageNumber: 0, pageSize: 5 },\n      })\n      .reply(200, pagedProfitsFixtures.twoPages[0]);\n    axiosMock\n      .onGet(\"/api/profits/paged/commonsid\", {\n        params: { commonsId: undefined, pageNumber: 1, pageSize: 5 },\n      })\n      .reply(200, pagedProfitsFixtures.twoPages[1]);\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PagedProfitsTable />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    const expectedHeaders = [\"Profit\", \"Date\", \"Health\", \"Cows\"];\n    const expectedFields = [\"amount\", \"timestamp\", \"avgCowHealth\", \"numCows\"];\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBe(1);\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(axiosMock.history.get[0].url).toBe(\"/api/profits/paged/commonsid\");\n    expect(axiosMock.history.get[0].params).toEqual({\n      commonsId: undefined,\n      pageNumber: 0,\n      pageSize: 5,\n    });\n\n    const nextButton = screen.getByTestId(`${testId}-next-button`);\n    expect(nextButton).toBeInTheDocument();\n\n    const previousButton = screen.getByTestId(`${testId}-previous-button`);\n    expect(previousButton).toBeInTheDocument();\n\n    expect(previousButton).toBeDisabled();\n    expect(nextButton).toBeEnabled();\n\n    expect(screen.getByText(`Page: 1`)).toBeInTheDocument();\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-amount`),\n    ).toHaveTextContent(\"20\");\n\n    fireEvent.click(nextButton);\n\n    await waitFor(() => {\n      expect(screen.getByText(`Page: 2`)).toBeInTheDocument();\n    });\n    expect(previousButton).toBeEnabled();\n    expect(nextButton).toBeDisabled();\n\n    fireEvent.click(previousButton);\n    await waitFor(() => {\n      expect(screen.getByText(`Page: 1`)).toBeInTheDocument();\n    });\n    expect(previousButton).toBeDisabled();\n    expect(nextButton).toBeEnabled();\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-amount`),\n    ).toHaveTextContent(\"20\");\n  });\n});\n"},"src/tests/components/Courses/CoursesTable.test.jsx":{"tests":[{"id":"234","name":"CoursesTable tests Has the expected column headers and content for ordinary user"},{"id":"235","name":"CoursesTable tests Has the expected column headers and content for admin user"},{"id":"236","name":"CoursesTable tests Edit button navigates to the edit page for admin user"},{"id":"237","name":"CoursesTable tests Delete button calls delete callback"},{"id":"238","name":"CoursesTable tests Supports overriding the testIdPrefix prop"},{"id":"239","name":"CoursesTable tests Renders headers even when no courses are provided"},{"id":"240","name":"CoursesTable tests Hides action buttons when currentUser is null"},{"id":"241","name":"CoursesTable tests Configures delete mutation with expected args"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\n\nimport { coursesFixtures } from \"fixtures/coursesFixtures\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport CoursesTable from \"main/components/Courses/CoursesTable\";\nimport {\n  cellToAxiosParamsDelete,\n  onDeleteSuccess,\n} from \"main/utils/courseUtils\";\n\nconst { mockMutate, mockUseBackendMutation } = vi.hoisted(() => {\n  const mutate = vi.fn();\n  const useBackendMutationMock = vi.fn(() => ({ mutate }));\n  return { mockMutate: mutate, mockUseBackendMutation: useBackendMutationMock };\n});\n\nvi.mock(\"main/utils/useBackend\", async (importOriginal) => {\n  const actual = await importOriginal();\n  return {\n    ...actual,\n    useBackendMutation: mockUseBackendMutation,\n  };\n});\n\nconst mockedNavigate = vi.fn();\nvi.mock(\"react-router\", async () => {\n  const originalModule = await vi.importActual(\"react-router\");\n  return {\n    ...originalModule,\n    useNavigate: () => mockedNavigate,\n  };\n});\n\ndescribe(\"CoursesTable tests\", () => {\n  const queryClient = new QueryClient();\n  const testId = \"CoursesTable\";\n  const expectedHeaders = [\"id\", \"Code\", \"Name\", \"Term\"];\n  const expectedFields = [\"id\", \"code\", \"name\", \"term\"];\n\n  beforeEach(() => {\n    mockMutate.mockReset();\n    mockUseBackendMutation.mockReset();\n    mockUseBackendMutation.mockReturnValue({ mutate: mockMutate });\n    mockedNavigate.mockClear();\n  });\n\n  const renderTable = (courses, currentUser, props = {}) => {\n    return render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CoursesTable\n            courses={courses}\n            currentUser={currentUser}\n            {...props}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  };\n\n  test(\"Has the expected column headers and content for ordinary user\", () => {\n    renderTable(coursesFixtures.threeCourses, currentUserFixtures.userOnly);\n\n    expectedHeaders.forEach((headerText) => {\n      expect(screen.getByText(headerText)).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      expect(\n        screen.getByTestId(`${testId}-cell-row-0-col-${field}`),\n      ).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"1\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-code`),\n    ).toHaveTextContent(\"CHEM 123\");\n    expect(\n      screen.queryByTestId(`${testId}-cell-row-0-col-Edit-button`),\n    ).not.toBeInTheDocument();\n    expect(\n      screen.queryByTestId(`${testId}-cell-row-0-col-Delete-button`),\n    ).not.toBeInTheDocument();\n  });\n\n  test(\"Has the expected column headers and content for admin user\", () => {\n    renderTable(coursesFixtures.threeCourses, currentUserFixtures.adminUser);\n\n    expectedHeaders.forEach((headerText) => {\n      expect(screen.getByText(headerText)).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      expect(\n        screen.getByTestId(`${testId}-cell-row-0-col-${field}`),\n      ).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"1\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-code`),\n    ).toHaveTextContent(\"CHEM 123\");\n\n    const editButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Edit-button`,\n    );\n    expect(editButton).toBeInTheDocument();\n    expect(editButton).toHaveClass(\"btn-primary\");\n\n    const deleteButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n    expect(deleteButton).toHaveClass(\"btn-danger\");\n  });\n\n  test(\"Edit button navigates to the edit page for admin user\", async () => {\n    renderTable(coursesFixtures.threeCourses, currentUserFixtures.adminUser);\n\n    const editButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Edit-button`,\n    );\n    fireEvent.click(editButton);\n\n    await waitFor(() =>\n      expect(mockedNavigate).toHaveBeenCalledWith(\"/admin/editcourses/1\"),\n    );\n  });\n\n  test(\"Delete button calls delete callback\", async () => {\n    renderTable(coursesFixtures.threeCourses, currentUserFixtures.adminUser);\n\n    const deleteButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Delete-button`,\n    );\n    fireEvent.click(deleteButton);\n\n    await waitFor(() => expect(mockMutate).toHaveBeenCalledTimes(1));\n    const cellArg = mockMutate.mock.calls[0][0];\n    expect(cellArg.row.values.id).toBe(1);\n    expect(cellArg.row.values.code).toBe(\"CMPSC 156\");\n  });\n\n  test(\"Supports overriding the testIdPrefix prop\", () => {\n    renderTable(coursesFixtures.threeCourses, currentUserFixtures.adminUser, {\n      testIdPrefix: \"CustomCourses\",\n    });\n\n    expect(screen.getByTestId(\"CustomCourses-header-code\")).toBeInTheDocument();\n    expect(\n      screen.getByTestId(\"CustomCourses-cell-row-0-col-code\"),\n    ).toHaveTextContent(\"CMPSC 156\");\n  });\n\n  test(\"Renders headers even when no courses are provided\", () => {\n    renderTable([], currentUserFixtures.userOnly);\n\n    expectedHeaders.forEach((headerText) => {\n      expect(screen.getByText(headerText)).toBeInTheDocument();\n    });\n    expect(\n      screen.queryByTestId(`${testId}-cell-row-0-col-id`),\n    ).not.toBeInTheDocument();\n  });\n\n  test(\"Hides action buttons when currentUser is null\", () => {\n    renderTable(coursesFixtures.threeCourses, null);\n\n    expect(\n      screen.queryByTestId(`${testId}-cell-row-0-col-Edit-button`),\n    ).not.toBeInTheDocument();\n    expect(\n      screen.queryByTestId(`${testId}-cell-row-0-col-Delete-button`),\n    ).not.toBeInTheDocument();\n    expect(screen.getAllByRole(\"columnheader\")).toHaveLength(\n      expectedHeaders.length,\n    );\n  });\n\n  test(\"Configures delete mutation with expected args\", () => {\n    renderTable(coursesFixtures.threeCourses, currentUserFixtures.adminUser);\n\n    expect(mockUseBackendMutation).toHaveBeenCalledWith(\n      cellToAxiosParamsDelete,\n      expect.objectContaining({ onSuccess: onDeleteSuccess }),\n      [\"/api/course/all\"],\n    );\n  });\n});\n"},"src/tests/pages/AdminCreateCommonsPage.test.jsx":{"tests":[{"id":"242","name":"AdminCreateCommonsPage tests renders without crashing"},{"id":"243","name":"AdminCreateCommonsPage tests When you fill in form and click submit, the right things happens"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport AdminCreateCommonsPage from \"main/pages/AdminCreateCommonsPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport healthUpdateStrategyListFixtures from \"../../fixtures/healthUpdateStrategyListFixtures\";\nimport { vi } from \"vitest\";\n\nconst mockedNavigate = vi.fn();\nvi.mock(\"react-router\", async () => {\n  const originalModule = await vi.importActual(\"react-router\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    Navigate: (x) => {\n      mockedNavigate(x);\n      return null;\n    },\n  };\n});\n\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async () => {\n  const originalModule = await vi.importActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"AdminCreateCommonsPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n  const queryClient = new QueryClient();\n\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n\n    axiosMock\n      .onGet(\"/api/commons/all-health-update-strategies\")\n      .reply(200, healthUpdateStrategyListFixtures.simple);\n  });\n\n  test(\"renders without crashing\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminCreateCommonsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(\"Create Commons\")).toBeInTheDocument();\n  });\n\n  test(\"When you fill in form and click submit, the right things happens\", async () => {\n    axiosMock.onPost(\"/api/commons/new\").reply(200, {\n      id: 5,\n      name: \"My New Commons\",\n      cowPrice: 10,\n      milkPrice: 5,\n      startingBalance: 500,\n      startingDate: \"2022-03-05T00:00:00\",\n      lastDate: \"2023-03-05T00:00:00\",\n      degradationRate: 30.4,\n      capacityPerUser: 10,\n      carryingCapacity: 25,\n      aboveCapacityHealthUpdateStrategy: \"strat2\",\n      belowCapacityHealthUpdateStrategy: \"strat3\",\n      showLeaderboard: false,\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminCreateCommonsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(\"Create Commons\")).toBeInTheDocument();\n\n    const commonsNameField = screen.getByLabelText(\"Commons Name\");\n    const startingBalanceField = screen.getByLabelText(\"Starting Balance\");\n    const cowPriceField = screen.getByLabelText(\"Cow Price\");\n    const milkPriceField = screen.getByLabelText(\"Milk Price\");\n    const startDateField = screen.getByLabelText(\"Starting Date\");\n    const lastDateField = screen.getByLabelText(\"Last Date\");\n    const degradationRateField = screen.getByLabelText(\"Degradation Rate\");\n    const capacityPerUserField = screen.getByLabelText(\"Capacity Per User\");\n    const carryingCapacityField = screen.getByLabelText(\"Carrying Capacity\");\n    const aboveCapacityHealthUpdateStrategyField = screen.getByLabelText(\n      \"When above capacity\",\n    );\n    const belowCapacityHealthUpdateStrategyField = screen.getByLabelText(\n      \"When below capacity\",\n    );\n    const showLeaderboardField = screen.getByLabelText(\"Show Leaderboard?\");\n    const button = screen.getByTestId(\"CommonsForm-Submit-Button\");\n\n    fireEvent.change(commonsNameField, { target: { value: \"My New Commons\" } });\n    fireEvent.change(startingBalanceField, { target: { value: \"500\" } });\n    fireEvent.change(cowPriceField, { target: { value: \"10\" } });\n    fireEvent.change(milkPriceField, { target: { value: \"5\" } });\n    fireEvent.change(startDateField, { target: { value: \"2022-03-05\" } });\n    fireEvent.change(lastDateField, { target: { value: \"2023-03-05\" } });\n    fireEvent.change(degradationRateField, { target: { value: \"30.4\" } });\n    fireEvent.change(capacityPerUserField, { target: { value: \"10\" } });\n    fireEvent.change(carryingCapacityField, { target: { value: \"25\" } });\n    fireEvent.change(showLeaderboardField, { target: { value: true } });\n\n    fireEvent.change(aboveCapacityHealthUpdateStrategyField, {\n      target: { value: \"strat2\" },\n    });\n    fireEvent.change(belowCapacityHealthUpdateStrategyField, {\n      target: { value: \"strat3\" },\n    });\n    fireEvent.click(button);\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    // The Date object is initialized from the form without time information. I believe React\n    // Query calls toISOString() before stuffing it into the body of the POST request, so the\n    // POST contains the suffix .000Z, which Java's LocalDateTime.parse ignores. [1]\n\n    const expectedCommons = {\n      name: \"My New Commons\",\n      startingBalance: 500,\n      cowPrice: 10,\n      milkPrice: 5,\n      degradationRate: 30.4,\n      carryingCapacity: 25,\n      capacityPerUser: 10,\n      startingDate: \"2022-03-05T00:00:00.000Z\",\n      lastDate: \"2023-03-05T00:00:00.000Z\",\n      showLeaderboard: false,\n      showChat: false,\n      aboveCapacityHealthUpdateStrategy: \"strat2\",\n      belowCapacityHealthUpdateStrategy: \"strat3\",\n    };\n\n    expect(axiosMock.history.post[0].data).toEqual(\n      JSON.stringify(expectedCommons),\n    );\n\n    expect(mockToast).toBeCalledWith(\n      <"+"div>\n        Commons successfully created!\n        <"+"br />\n        id: 5\n        <"+"br />\n        name: My New Commons\n        <"+"br />\n        startDate: 2022-03-05T00:00:00\n        <"+"br />\n        lastDate: 2023-03-05T00:00:00\n        <"+"br />\n        cowPrice: 10\n        <"+"br />\n        capacityPerUser: 10\n        <"+"br />\n        carryingCapacity: 25\n      <"+"/div>,\n    );\n\n    expect(mockedNavigate).toBeCalledWith({ to: \"/\" });\n  });\n});\n"},"src/tests/pages/LeaderboardPage.test.jsx":{"tests":[{"id":"244","name":"LeaderboardPage tests renders without crashing for users"},{"id":"245","name":"LeaderboardPage tests that navigate(-1) is called when Back is clicked"},{"id":"246","name":"LeaderboardPage tests renders leaderboard for users when showLeaderboard = true"},{"id":"247","name":"LeaderboardPage tests renders leaderboard error message for users when showLeaderboard = false"},{"id":"248","name":"LeaderboardPage tests renders leaderboard for Admin users when showLeaderboard = false"}],"source":"import { render, waitFor, fireEvent, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport LeaderboardPage from \"main/pages/LeaderboardPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { vi } from \"vitest\";\n\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async () => {\n  const originalModule = await vi.importActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\nconst mockNavigate = vi.fn();\nvi.mock(\"react-router\", async () => {\n  const originalModule = await vi.importActual(\"react-router\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    useParams: () => ({\n      commonsId: 1,\n    }),\n    useNavigate: () => mockNavigate,\n  };\n});\n\ndescribe(\"LeaderboardPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  const setupUser = () => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  };\n\n  const setupAdmin = () => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.adminUser);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  };\n\n  test(\"renders without crashing for users\", async () => {\n    setupUser();\n    axiosMock.onGet(\"/api/commons\", { params: { id: 1 } }).reply(200, {\n      username: \"Anika\",\n      totalWealth: 100.0,\n      numOfCows: 5,\n      cowHealth: 100,\n      cowsBought: 10,\n      cowsSold: 3,\n      cowDeaths: 0,\n      showLeaderboard: true,\n    });\n    axiosMock\n      .onGet(\"/api/usercommons/commons/all\", { params: { commonsId: 1 } })\n      .reply(200, []);\n    const queryClient = new QueryClient();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"LeaderboardPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"LeaderboardPage-main-div\"),\n      ).toBeInTheDocument();\n    });\n\n    const leaderboard_main_div = screen.getByTestId(\"LeaderboardPage-main-div\");\n    const leaderboard_back_button = screen.getByTestId(\n      \"LeaderboardPage-back-button\",\n    );\n    expect(leaderboard_main_div).toHaveAttribute(\n      \"style\",\n      \"background-size: cover; background-image: url(/src/assets/PlayPageBackground.png);\",\n    );\n\n    expect(leaderboard_back_button).toBeInTheDocument();\n  });\n\n  test(\"that navigate(-1) is called when Back is clicked\", async () => {\n    const queryClient = new QueryClient();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"LeaderboardPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    await screen.findByTestId(\"LeaderboardPage-back-button\");\n    const cancelButton = screen.getByTestId(\"LeaderboardPage-back-button\");\n    expect(cancelButton).toHaveAttribute(\"style\", \"float: right;\");\n\n    fireEvent.click(cancelButton);\n\n    await waitFor(() => expect(mockNavigate).toHaveBeenCalledWith(-1));\n  });\n\n  test(\"renders leaderboard for users when showLeaderboard = true\", async () => {\n    setupUser();\n    axiosMock.onGet(\"/api/commons\", { params: { id: 1 } }).reply(200, {\n      username: \"Anika\",\n      totalWealth: 100.0,\n      numOfCows: 5,\n      cowHealth: 100,\n      cowsBought: 10,\n      cowsSold: 3,\n      cowDeaths: 0,\n      showLeaderboard: true,\n    });\n    axiosMock\n      .onGet(\"/api/usercommons/commons/all\", { params: { commonsId: 1 } })\n      .reply(200, []);\n    const queryClient = new QueryClient();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"LeaderboardPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toEqual(4);\n    });\n    expect(await screen.findByText(\"Total Wealth\")).toBeInTheDocument();\n  });\n\n  test(\"renders leaderboard error message for users when showLeaderboard = false\", async () => {\n    setupUser();\n    axiosMock.onGet(\"/api/commons\", { params: { id: 1 } }).reply(200, {\n      username: \"Anika\",\n      totalWealth: 100.0,\n      numOfCows: 5,\n      cowHealth: 100,\n      cowsBought: 10,\n      cowsSold: 3,\n      cowDeaths: 0,\n      showLeaderboard: false,\n    });\n    const queryClient = new QueryClient();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"LeaderboardPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    expect(\n      await screen.findByText(\"You're not authorized to see the leaderboard.\"),\n    ).toBeInTheDocument();\n  });\n\n  test(\"renders leaderboard for Admin users when showLeaderboard = false\", async () => {\n    setupAdmin();\n    axiosMock.onGet(\"/api/commons\", { params: { id: 1 } }).reply(200, {\n      username: \"Anika\",\n      totalWealth: 100.0,\n      numOfCows: 5,\n      cowHealth: 100,\n      cowsBought: 10,\n      cowsSold: 3,\n      cowDeaths: 0,\n      showLeaderboard: false,\n    });\n    axiosMock\n      .onGet(\"/api/usercommons/commons/all\", { params: { commonsId: 1 } })\n      .reply(200, []);\n    const queryClient = new QueryClient();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"LeaderboardPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toEqual(4);\n    });\n    expect(await screen.findByText(\"Total Wealth\")).toBeInTheDocument();\n  });\n});\n"},"src/tests/components/Commons/CommonsFeaturesForm.test.jsx":{"tests":[{"id":"249","name":"CommonsFeaturesForm tests renders correctly with single feature"},{"id":"250","name":"CommonsFeaturesForm tests renders correctly with multiple features"},{"id":"251","name":"CommonsFeaturesForm tests formats feature names correctly"},{"id":"252","name":"CommonsFeaturesForm tests handles checkbox changes correctly"},{"id":"253","name":"CommonsFeaturesForm tests calls onSubmit with updated features when form is submitted"},{"id":"254","name":"CommonsFeaturesForm tests does not call onSubmit if onSubmit is not provided"},{"id":"255","name":"CommonsFeaturesForm tests uses custom button label when provided"},{"id":"256","name":"CommonsFeaturesForm tests updates local state when features prop changes"},{"id":"257","name":"CommonsFeaturesForm tests handles empty features object"}],"source":"import { fireEvent, render, screen } from \"@testing-library/react\";\nimport CommonsFeaturesForm from \"main/components/Commons/CommonsFeaturesForm\";\nimport commonsFeaturesFixtures from \"fixtures/commonsFeaturesFixtures\";\nimport { vi } from \"vitest\";\n\ndescribe(\"CommonsFeaturesForm tests\", () => {\n  beforeEach(() => {\n    vi.clearAllMocks();\n  });\n\n  it(\"renders correctly with single feature\", () => {\n    const onSubmit = vi.fn();\n    render(\n      <"+"CommonsFeaturesForm\n        features={commonsFeaturesFixtures.singleFeature}\n        onSubmit={onSubmit}\n      />,\n    );\n\n    expect(\n      screen.getByTestId(\"CommonsFeaturesForm-FARMERS_CAN_SEE_LEADERBOARD\"),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByLabelText(\"Farmers Can See Leaderboard\"),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByTestId(\"CommonsFeaturesForm-Submit-Button\"),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByTestId(\"CommonsFeaturesForm-Submit-Button\"),\n    ).toHaveTextContent(\"Save\");\n  });\n\n  it(\"renders correctly with multiple features\", () => {\n    const onSubmit = vi.fn();\n    render(\n      <"+"CommonsFeaturesForm\n        features={commonsFeaturesFixtures.threeFeatures}\n        onSubmit={onSubmit}\n      />,\n    );\n\n    expect(\n      screen.getByTestId(\"CommonsFeaturesForm-FARMERS_CAN_SEE_LEADERBOARD\"),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByTestId(\n        \"CommonsFeaturesForm-FARMERS_CAN_SEE_HERD_SIZE_HISTOGRAM\",\n      ),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByTestId(\"CommonsFeaturesForm-TAXES_ON_HERD_SIZE_ARE_ENABLED\"),\n    ).toBeInTheDocument();\n\n    expect(\n      screen.getByLabelText(\"Farmers Can See Leaderboard\"),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByLabelText(\"Farmers Can See Herd Size Histogram\"),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByLabelText(\"Taxes On Herd Size Are Enabled\"),\n    ).toBeInTheDocument();\n  });\n\n  it(\"formats feature names correctly\", () => {\n    const onSubmit = vi.fn();\n    const features = {\n      FARMERS_CAN_SEE_LEADERBOARD: false,\n      SOME_OTHER_FEATURE: true,\n    };\n\n    render(<"+"CommonsFeaturesForm features={features} onSubmit={onSubmit} />);\n\n    expect(\n      screen.getByLabelText(\"Farmers Can See Leaderboard\"),\n    ).toBeInTheDocument();\n    expect(screen.getByLabelText(\"Some Other Feature\")).toBeInTheDocument();\n  });\n\n  it(\"handles checkbox changes correctly\", () => {\n    const onSubmit = vi.fn();\n    render(\n      <"+"CommonsFeaturesForm\n        features={commonsFeaturesFixtures.singleFeature}\n        onSubmit={onSubmit}\n      />,\n    );\n\n    const checkbox = screen.getByTestId(\n      \"CommonsFeaturesForm-FARMERS_CAN_SEE_LEADERBOARD\",\n    );\n\n    // Initially false\n    expect(checkbox).not.toBeChecked();\n\n    // Click to toggle\n    fireEvent.click(checkbox);\n    expect(checkbox).toBeChecked();\n\n    // Click again to toggle back\n    fireEvent.click(checkbox);\n    expect(checkbox).not.toBeChecked();\n  });\n\n  it(\"calls onSubmit with updated features when
