"CommonsFeaturesForm\n        features={{ FARMERS_CAN_SEE_LEADERBOARD: true }}\n        onSubmit={onSubmit}\n      />,\n    );\n\n    expect(checkbox).toBeChecked();\n  });\n\n  it(\"handles empty features object\", () => {\n    const onSubmit = vi.fn();\n    render(<"+"CommonsFeaturesForm features={{}} onSubmit={onSubmit} />);\n\n    // Should render without crashing\n    expect(\n      screen.getByTestId(\"CommonsFeaturesForm-Submit-Button\"),\n    ).toBeInTheDocument();\n  });\n});\n"},"src/tests/components/Commons/CommonsList.test.jsx":{"tests":[{"id":"258","name":"CommonsList tests renders without crashing when button text is set"},{"id":"259","name":"CommonsList tests renders no button when button text is null"},{"id":"260","name":"CommonsList tests renders default join UI when there are no commons"},{"id":"261","name":"CommonsList tests renders default visit UI when there are no commons"}],"source":"import { render, screen } from \"@testing-library/react\";\nimport CommonsList from \"main/components/Commons/CommonsList\";\nimport commonsFixtures from \"fixtures/commonsFixtures\";\n\ndescribe(\"CommonsList tests\", () => {\n  test(\"renders without crashing when button text is set\", () => {\n    render(\n      <"+"CommonsList\n        commonList={commonsFixtures.threeCommons}\n        buttonText={\"Join\"}\n        title=\"Join A New Commons\"\n      />,\n    );\n\n    const title = screen.getByTestId(\"commonsList-title\");\n    expect(title).toBeInTheDocument();\n    expect(typeof title.textContent).toBe(\"string\");\n    expect(title.textContent).toEqual(\"Join A New Commons\");\n\n    const subtitle_name = screen.getByTestId(\"commonsList-subtitle-name\");\n    expect(subtitle_name).toBeInTheDocument();\n    expect(typeof subtitle_name.textContent).toBe(\"string\");\n    expect(subtitle_name.textContent).toEqual(\"Common's Name\");\n\n    const subtitle_id = screen.getByTestId(\"commonsList-subtitle-id\");\n    expect(subtitle_id).toBeInTheDocument();\n    expect(typeof subtitle_id.textContent).toBe(\"string\");\n    expect(subtitle_id.textContent).toEqual(\"ID#\");\n\n    const buttons = screen.getAllByTestId(/commonsCard-button/);\n    buttons.forEach((b) => {\n      expect(b).toBeInTheDocument();\n      expect(typeof b.textContent).toBe(\"string\");\n      expect(b.textContent).toEqual(\"Join\");\n    });\n\n    let i = 0;\n    const names = screen.getAllByTestId(/commonsCard-name/);\n    names.forEach((n) => {\n      expect(n).toBeInTheDocument();\n      expect(typeof n.textContent).toBe(\"string\");\n      expect(n.textContent).toEqual(commonsFixtures.threeCommons[i].name);\n      i++;\n    });\n\n    i = 0;\n    const ids = screen.getAllByTestId(/commonsCard-id/);\n    ids.forEach((id) => {\n      expect(id).toBeInTheDocument();\n      expect(typeof id.textContent).toBe(\"string\");\n      expect(id.textContent).toEqual(\n        commonsFixtures.threeCommons[i].id.toString(),\n      );\n      i++;\n    });\n  });\n\n  test(\"renders no button when button text is null\", () => {\n    render(\n      <"+"CommonsList\n        commonList={commonsFixtures.threeCommons}\n        buttonText={null}\n      />,\n    );\n\n    const title = screen.getByTestId(\"commonsList-title\");\n    expect(title).toBeInTheDocument();\n    expect(typeof title.textContent).toBe(\"string\");\n    expect(title.textContent).toEqual(\"\");\n\n    const subtitle_name = screen.getByTestId(\"commonsList-subtitle-name\");\n    expect(subtitle_name).toBeInTheDocument();\n    expect(typeof subtitle_name.textContent).toBe(\"string\");\n    expect(subtitle_name.textContent).toEqual(\"Common's Name\");\n\n    const subtitle_id = screen.getByTestId(\"commonsList-subtitle-id\");\n    expect(subtitle_id).toBeInTheDocument();\n    expect(typeof subtitle_id.textContent).toBe(\"string\");\n    expect(subtitle_id.textContent).toEqual(\"ID#\");\n\n    expect(() => screen.getAllByTestId(/commonsCard-button/)).toThrow(\n      \"Unable to find an element\",\n    );\n\n    let i = 0;\n    const names = screen.getAllByTestId(/commonsCard-name/);\n    names.forEach((n) => {\n      expect(n).toBeInTheDocument();\n      expect(typeof n.textContent).toBe(\"string\");\n      expect(n.textContent).toEqual(commonsFixtures.threeCommons[i].name);\n      i++;\n    });\n\n    i = 0;\n    const ids = screen.getAllByTestId(/commonsCard-id/);\n    ids.forEach((id) => {\n      expect(id).toBeInTheDocument();\n      expect(typeof id.textContent).toBe(\"string\");\n      expect(id.textContent).toEqual(\n        commonsFixtures.threeCommons[i].id.toString(),\n      );\n      i++;\n    });\n  });\n\n  test(\"renders default join UI when there are no commons\", () => {\n    render(\n      <"+"CommonsList\n        commonList={[]}\n        buttonText={\"Join\"}\n        title=\"Join A New Commons\"\n      />,\n    );\n\n    const title = screen.getByTestId(\"commonsList-title\");\n    expect(title).toBeInTheDocument();\n    expect(typeof title.textContent).toBe(\"string\");\n    expect(title.textContent).toEqual(\"Join A New Commons\");\n\n    const subtitle_name = screen.getByTestId(\"commonsList-default-message\");\n    expect(subtitle_name).toBeInTheDocument();\n    expect(typeof subtitle_name.textContent).toBe(\"string\");\n    expect(subtitle_name.textContent).toEqual(\n      \"There are currently no commons to join\",\n    );\n    expect(subtitle_name).toHaveStyle(\"justify-content: center;\");\n\n    expect(() => screen.getByTestId(\"commonsList-subtitle-name\")).toThrow(\n      \"Unable to find an element\",\n    );\n  });\n\n  test(\"renders default visit UI when there are no commons\", () => {\n    render(\n      <"+"CommonsList\n        commonList={[]}\n        buttonText={\"Visit\"}\n        title=\"Visit A Commons\"\n      />,\n    );\n\n    const title = screen.getByTestId(\"commonsList-title\");\n    expect(title).toBeInTheDocument();\n    expect(typeof title.textContent).toBe(\"string\");\n    expect(title.textContent).toEqual(\"Visit A Commons\");\n\n    const subtitle_name = screen.getByTestId(\"commonsList-default-message\");\n    expect(subtitle_name).toBeInTheDocument();\n    expect(typeof subtitle_name.textContent).toBe(\"string\");\n    expect(subtitle_name.textContent).toEqual(\n      \"There are currently no commons to visit\",\n    );\n    expect(subtitle_name).toHaveStyle(\"justify-content: center;\");\n\n    expect(() => screen.getByTestId(\"commonsList-subtitle-name\")).toThrow(\n      \"Unable to find an element\",\n    );\n  });\n});\n"},"src/tests/utils/users.test.jsx":{"tests":[{"id":"262","name":"utils/users tests useUsers tests useUsers initially retrieves initial data on timeout"},{"id":"263","name":"utils/users tests useUsers tests useUsers hits error logic on 404"},{"id":"264","name":"utils/users tests useUsers tests useUsers returns correct data when api is mocked"},{"id":"265","name":"utils/users tests suspendUser tests suspendUser posts to correct endpoint on successful request"},{"id":"266","name":"utils/users tests restoreUser tests restoreUser posts to correct endpoint on success request"}],"source":"import { renderHook, waitFor } from \"@testing-library/react\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport mockConsole from \"tests/testutils/mockConsole\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { useRestoreUser, useSuspendUser, useUsers } from \"main/utils/users\";\nimport usersFixtures from \"fixtures/usersFixtures\";\nimport { act } from \"react\";\nimport { vi } from \"vitest\";\n\nvi.mock(\"react-router\");\n\ndescribe(\"utils/users tests\", () => {\n  describe(\"useUsers tests\", () => {\n    test(\"useUsers initially retrieves initial data on timeout\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      var axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/admin/users\").timeout();\n\n      const restoreConsole = mockConsole();\n\n      const { result } = renderHook(() => useUsers(), { wrapper });\n\n      await waitFor(() => result.current.isSuccess);\n      expect(result.current.data).toEqual([]);\n\n      const queryState = queryClient.getQueryState(\"users\");\n      expect(queryState).toBeDefined();\n\n      await waitFor(() => expect(console.error).toHaveBeenCalled());\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(\"Error getting data from /api/admin/users:\");\n      restoreConsole();\n    });\n\n    test(\"useUsers hits error logic on 404\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      var axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/admin/users\").reply(404);\n\n      const restoreConsole = mockConsole();\n\n      const { result } = renderHook(() => useUsers(), { wrapper });\n      await waitFor(() => result.current.isFetched);\n      expect(console.error).toHaveBeenCalled();\n      restoreConsole();\n\n      expect(result.current.data).toEqual([]);\n    });\n\n    test(\"useUsers returns correct data when api is mocked\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n      var axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/admin/users\").reply(200, usersFixtures.threeUsers);\n\n      const { result } = renderHook(() => useUsers(), { wrapper });\n      await waitFor(() => result.current.isFetched);\n      expect(result.current.data).toEqual(usersFixtures.threeUsers);\n    });\n  });\n\n  describe(\"suspendUser tests\", () => {\n    var axiosMock;\n    beforeEach(() => {\n      vi.spyOn(console, \"error\").mockImplementation();\n      axiosMock = new AxiosMockAdapter(axios);\n      queryClient.prefetchQuery(\"users\", async () => {\n        return [];\n      });\n    });\n\n    afterEach(() => {\n      axiosMock.restore();\n      console.error.mockRestore();\n    });\n\n    const queryClient = new QueryClient();\n    const wrapper = ({ children }) => (\n      <"+"QueryClientProvider client={queryClient}>{children}<"+"/QueryClientProvider>\n    );\n\n    test(\"suspendUser posts to correct endpoint on successful request\", async () => {\n      axiosMock\n        .onPost(\"/api/admin/users/suspend\")\n        .reply(200, \"User with id 1 suspended\");\n\n      const userCell = { row: { values: { id: 1 } } };\n      const { result } = renderHook(() => useSuspendUser(), {\n        wrapper,\n      });\n\n      act(() => {\n        result.current.mutate(userCell);\n      });\n\n      await waitFor(() => expect(result.current.isSuccess).toBe(true));\n      const queryState = queryClient.getQueryState(\"users\");\n      expect(queryState).toBeDefined();\n      expect(result.current.data).toEqual(\"User with id 1 suspended\");\n      expect(axiosMock.history.post[0].params).toEqual({ userId: 1 });\n    });\n  });\n\n  describe(\"restoreUser tests\", () => {\n    var axiosMock;\n    beforeEach(() => {\n      vi.spyOn(console, \"error\").mockImplementation();\n      axiosMock = new AxiosMockAdapter(axios);\n      queryClient.prefetchQuery(\"users\", async () => {\n        return [];\n      });\n    });\n\n    afterEach(() => {\n      axiosMock.restore();\n      console.error.mockRestore();\n    });\n\n    const queryClient = new QueryClient();\n    const wrapper = ({ children }) => (\n      <"+"QueryClientProvider client={queryClient}>{children}<"+"/QueryClientProvider>\n    );\n\n    test(\"restoreUser posts to correct endpoint on success request\", async () => {\n      axiosMock\n        .onPost(\"/api/admin/users/restore\")\n        .reply(200, \"User with id 1 restored\");\n\n      const userCell = { row: { values: { id: 1 } } };\n      const { result } = renderHook(() => useRestoreUser(), {\n        wrapper,\n      });\n\n      act(() => {\n        result.current.mutate(userCell);\n      });\n\n      await waitFor(() => expect(result.current.isSuccess).toBe(true));\n      const queryState = queryClient.getQueryState(\"users\");\n      expect(queryState).toBeDefined();\n      expect(result.current.data).toEqual(\"User with id 1 restored\");\n      expect(axiosMock.history.post[0].params).toEqual({ userId: 1 });\n    });\n  });\n});\n"},"src/tests/components/Nav/AppNavbar.test.jsx":{"tests":[{"id":"267","name":"AppNavbar tests renders correctly for regular logged in user"},{"id":"268","name":"AppNavbar tests renders correctly for admin user"},{"id":"269","name":"AppNavbar tests renders H2Console and Swagger links correctly"},{"id":"270","name":"AppNavbar tests renders the AppNavbarLocalhost when on http://localhost:3000"},{"id":"271","name":"AppNavbar tests renders the AppNavbarLocalhost when on http://127.0.0.1:3000"},{"id":"272","name":"AppNavbar tests does NOT render the AppNavbarLocalhost when on localhost:8080"},{"id":"273","name":"AppNavbar tests when oauthlogin undefined, default value is used"}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport AppNavbar from \"main/components/Nav/AppNavbar\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { vi } from \"vitest\";\n\ndescribe(\"AppNavbar tests\", () => {\n  const queryClient = new QueryClient();\n\n  test(\"renders correctly for regular logged in user\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const doLogin = vi.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar currentUser={currentUser} doLogin={doLogin} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByText(\"Welcome, pconrad.cis@gmail.com\"),\n    ).toBeInTheDocument();\n  });\n\n  test(\"renders correctly for admin user\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n    const doLogin = vi.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar currentUser={currentUser} doLogin={doLogin} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByText(\"Welcome, phtcon@ucsb.edu\"),\n    ).toBeInTheDocument();\n    const adminMenu = screen.getByTestId(\"appnavbar-admin-dropdown\");\n    expect(adminMenu).toBeInTheDocument();\n  });\n\n  test(\"renders H2Console and Swagger links correctly\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n    const systemInfo = systemInfoFixtures.showingAll;\n\n    const doLogin = vi.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(\"H2Console\")).toBeInTheDocument();\n    const swaggerMenu = screen.getByText(\"Swagger\");\n    expect(swaggerMenu).toBeInTheDocument();\n  });\n\n  test(\"renders the AppNavbarLocalhost when on http://localhost:3000\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const systemInfo = systemInfoFixtures.showingAll;\n    const doLogin = vi.fn();\n\n    delete window.location;\n    window.location = new URL(\"http://localhost:3000\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByTestId(\"AppNavbarLocalhost\")).toBeInTheDocument();\n  });\n\n  test(\"renders the AppNavbarLocalhost when on http://127.0.0.1:3000\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const systemInfo = systemInfoFixtures.showingAll;\n    const doLogin = vi.fn();\n\n    delete window.location;\n    window.location = new URL(\"http://127.0.0.1:3000\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByTestId(\"AppNavbarLocalhost\")).toBeInTheDocument();\n  });\n\n  test(\"does NOT render the AppNavbarLocalhost when on localhost:8080\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const systemInfo = systemInfoFixtures.showingAll;\n    const doLogin = vi.fn();\n\n    delete window.location;\n    window.location = new URL(\"http://localhost:8080\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByTestId(\"AppNavbar\")).toBeInTheDocument();\n    expect(screen.queryByTestId(/AppNavbarLocalhost/i)).toBeNull();\n  });\n\n  test(\"when oauthlogin undefined, default value is used\", async () => {\n    const currentUser = currentUserFixtures.notLoggedIn;\n    const systemInfo = systemInfoFixtures.oauthLoginUndefined;\n    const doLogin = vi.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Log In\");\n    expect(screen.getByText(\"Log In\")).toHaveAttribute(\n      \"href\",\n      \"/oauth2/authorization/google\",\n    );\n  });\n});\n"},"src/tests/utils/leaderboardSortingUtils.test.jsx":{"tests":[{"id":"274","name":"leaderboardSortingUtils tests sortByWealth"},{"id":"275","name":"leaderboardSortingUtils tests sortByWealthReturnOne"},{"id":"276","name":"leaderboardSortingUtils tests sortByWealthReturnThree"},{"id":"277","name":"leaderboardSortingUtils tests sortByWealthExpectTooMany"},{"id":"278","name":"leaderboardSortingUtils tests sortByNumCows"},{"id":"279","name":"leaderboardSortingUtils tests sortByNumCowsReturnOne"},{"id":"280","name":"leaderboardSortingUtils tests sortByNumCowsReturnThree"},{"id":"281","name":"leaderboardSortingUtils tests sortByNumCowsExpectTooMany"},{"id":"282","name":"leaderboardSortingUtils tests sortByCowHealth"},{"id":"283","name":"leaderboardSortingUtils tests sortByCowHealthReturnOne"},{"id":"284","name":"leaderboardSortingUtils tests sortByCowHealthReturnThree"},{"id":"285","name":"leaderboardSortingUtils tests sortByCowHealthExpectTooMany"}],"source":"import {\n  sortByWealth,\n  sortByNumCows,\n  sortByCowHealth,\n} from \"../../main/utils/leaderboardSortingUtils\";\nimport userCommonsFixtures from \"../../fixtures/userCommonsFixtures\";\n\ndescribe(\"leaderboardSortingUtils tests\", () => {\n  const {\n    _oneUserCommons,\n    _threeUserCommons,\n    fiveUserCommons,\n    tenUserCommons,\n  } = userCommonsFixtures;\n\n  //-----------------------------//\n  //        Wealth Tests\n  //----------------------------//\n  test(\"sortByWealth\", () => {\n    const sortedUserCommons = sortByWealth(fiveUserCommons);\n    const expectedWealths = [100000, 1000, 1000, 800, 50];\n    for (let i in expectedWealths) {\n      expect(sortedUserCommons[i].totalWealth).toBe(expectedWealths[i]);\n    }\n  });\n\n  test(\"sortByWealthReturnOne\", () => {\n    const sortedUserCommons = sortByWealth(tenUserCommons, 1);\n    expect(sortedUserCommons.length).toBe(1);\n    expect(sortedUserCommons[0].totalWealth).toBe(100000);\n  });\n\n  test(\"sortByWealthReturnThree\", () => {\n    const sortedUserCommons = sortByWealth(tenUserCommons, 3);\n    expect(sortedUserCommons.length).toBe(3);\n    const expectedWealths = [100000, 100000, 1000];\n    for (let i in expectedWealths) {\n      expect(sortedUserCommons[i].totalWealth).toBe(expectedWealths[i]);\n    }\n  });\n\n  // Expected behavior here is to just return the full sorted array of userCommons\n  test(\"sortByWealthExpectTooMany\", () => {\n    const sortedUserCommons = sortByWealth(tenUserCommons, 25);\n    expect(sortedUserCommons.length).toBe(tenUserCommons.length);\n    const expectedWealths = [\n      100000, 100000, 1000, 1000, 1000, 1000, 800, 800, 50, 50,\n    ];\n    for (let i in expectedWealths) {\n      expect(sortedUserCommons[i].totalWealth).toBe(expectedWealths[i]);\n    }\n  });\n\n  //-----------------------------//\n  //      Num Cows Tests\n  //----------------------------//\n\n  test(\"sortByNumCows\", () => {\n    const sortedUserCommons = sortByNumCows(fiveUserCommons);\n    const expectedNumCows = [1000, 100, 60, 8, 5];\n    for (let i in expectedNumCows) {\n      expect(sortedUserCommons[i].numOfCows).toBe(expectedNumCows[i]);\n    }\n  });\n\n  test(\"sortByNumCowsReturnOne\", () => {\n    const sortedUserCommons = sortByNumCows(tenUserCommons, 1);\n    expect(sortedUserCommons.length).toBe(1);\n    expect(sortedUserCommons[0].numOfCows).toBe(1000);\n  });\n\n  test(\"sortByNumCowsReturnThree\", () => {\n    const sortedUserCommons = sortByNumCows(tenUserCommons, 3);\n    expect(sortedUserCommons.length).toBe(3);\n    const expectedNumCows = [1000, 1000, 100];\n    for (let i in expectedNumCows) {\n      expect(sortedUserCommons[i].numOfCows).toBe(expectedNumCows[i]);\n    }\n  });\n\n  // Expected behavior here is to just return the full sorted array of userCommons\n  test(\"sortByNumCowsExpectTooMany\", () => {\n    const sortedUserCommons = sortByNumCows(tenUserCommons, 25);\n    expect(sortedUserCommons.length).toBe(tenUserCommons.length);\n    const expectedNumCows = [1000, 1000, 100, 100, 60, 60, 8, 8, 5, 5];\n    for (let i in expectedNumCows) {\n      expect(sortedUserCommons[i].numOfCows).toBe(expectedNumCows[i]);\n    }\n  });\n\n  //-----------------------------//\n  //      Cow Health Tests\n  //----------------------------//\n  // if tests fail due to floating point error, try using .toBeCloseTo(number, numDigits?) instead of .toBe()\n\n  test(\"sortByCowHealth\", () => {\n    const sortedUserCommons = sortByCowHealth(fiveUserCommons);\n    const expectedCowHealths = [98.0, 93.0, 84.0, 72.0, 2.0];\n    for (let i in expectedCowHealths) {\n      expect(sortedUserCommons[i].cowHealth).toBe(expectedCowHealths[i]);\n    }\n  });\n\n  test(\"sortByCowHealthReturnOne\", () => {\n    const sortedUserCommons = sortByCowHealth(tenUserCommons, 1);\n    expect(sortedUserCommons.length).toBe(1);\n    expect(sortedUserCommons[0].cowHealth).toBe(98.0);\n  });\n\n  test(\"sortByCowHealthReturnThree\", () => {\n    const sortedUserCommons = sortByCowHealth(tenUserCommons, 3);\n    expect(sortedUserCommons.length).toBe(3);\n    const expectedCowHealths = [98.0, 98.0, 93.0];\n    for (let i in expectedCowHealths) {\n      expect(sortedUserCommons[i].cowHealth).toBe(expectedCowHealths[i]);\n    }\n  });\n\n  // Expected behavior here is to just return the full sorted array of userCommons\n  test(\"sortByCowHealthExpectTooMany\", () => {\n    const sortedUserCommons = sortByCowHealth(tenUserCommons, 25);\n    expect(sortedUserCommons.length).toBe(tenUserCommons.length);\n    const expectedCowHealths = [\n      98.0, 98.0, 93.0, 93.0, 84.0, 84.0, 72.0, 72.0, 2.0, 2.0,\n    ];\n    for (let i in expectedCowHealths) {\n      expect(sortedUserCommons[i].cowHealth).toBe(expectedCowHealths[i]);\n    }\n  });\n});\n"},"src/tests/components/Commons/ManageCows.test.jsx":{"tests":[{"id":"286","name":"ManageCows tests renders without crashing"},{"id":"287","name":"ManageCows tests renders message when admin visit other pages"},{"id":"288","name":"ManageCows tests calls setMessage with \"buy\" when the buy button is clicked"},{"id":"289","name":"ManageCows tests calls setMessage with \"sell\" when the sell button is clicked"}],"source":"import { fireEvent, render, screen } from \"@testing-library/react\";\nimport ManageCows from \"main/components/Commons/ManageCows\";\nimport userCommonsFixtures from \"fixtures/userCommonsFixtures\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { useParams } from \"react-router\";\nimport * as currentUserModule from \"main/utils/currentUser\";\nimport { vi } from \"vitest\";\n\nconst queryClient = new QueryClient();\n\n// Mock the useCurrentUser and hasRole functions\nvi.mock(\"main/utils/currentUser\", async () => ({\n  ...(await vi.importActual(\"main/utils/currentUser\")),\n  useCurrentUser: vi.fn(),\n  hasRole: vi.fn(),\n}));\n// mock useparams\nvi.mock(\"react-router\", async () => ({\n  ...(await vi.importActual(\"react-router\")),\n  useParams: vi.fn(),\n}));\ndescribe(\"ManageCows tests\", () => {\n  const mockSetMessage = vi.fn();\n  const mockOpenModal = vi.fn();\n\n  test(\"renders without crashing\", () => {\n    useParams.mockReturnValue({ userId: 1 }); // Replace with your desired mock values\n\n    currentUserModule.useCurrentUser.mockReturnValue({\n      data: {},\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"ManageCows\n          userCommons={userCommonsFixtures.oneUserCommons[0]}\n          onBuy={(userCommons) => {\n            console.log(\"onBuy called:\", userCommons);\n          }}\n          onSell={(userCommons) => {\n            console.log(\"onSell called:\", userCommons);\n          }}\n        />\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"renders message when admin visit other pages\", async () => {\n    useParams.mockReturnValue({ userId: 1 }); // Replace with your desired mock values\n\n    currentUserModule.useCurrentUser.mockReturnValue({\n      data: {\n        root: {\n          user: {\n            id: 1,\n          },\n        },\n      },\n    });\n    currentUserModule.hasRole.mockReturnValue(true);\n    const mockBuy = vi.fn();\n    const mockSell = vi.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"ManageCows\n          userCommons={userCommonsFixtures.oneUserCommons[0]}\n          onBuy={mockBuy}\n          onSell={mockSell}\n          userId={1}\n        />\n      <"+"/QueryClientProvider>,\n    );\n\n    const messageElement = screen.getByTestId(\"ManageCows-ViewOnly\");\n    expect(messageElement).toBeInTheDocument();\n    expect(messageElement).toHaveTextContent(\n      \"This page is for viewing only, cannot buy and sell cows.\",\n    );\n\n    const buyButton = screen.queryByTestId(\"buy-cow-button\");\n    const sellButton = screen.queryByTestId(\"sell-cow-button\");\n\n    expect(buyButton).toBeNull();\n    expect(sellButton).toBeNull();\n  });\n\n  test('calls setMessage with \"buy\" when the buy button is clicked', () => {\n    useParams.mockReturnValue({ userId: undefined }); // Replace with your desired mock values\n\n    currentUserModule.useCurrentUser.mockReturnValue({\n      data: {\n        root: {\n          user: {\n            id: NaN,\n          },\n        },\n      },\n    });\n    currentUserModule.hasRole.mockReturnValue(true);\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"ManageCows\n          userCommons={userCommonsFixtures.oneUserCommons[0]}\n          setMessage={mockSetMessage}\n          openModal={mockOpenModal}\n        />\n      <"+"/QueryClientProvider>,\n    );\n\n    fireEvent.click(screen.getByTestId(\"buy-cow-button\"));\n    expect(mockSetMessage).toHaveBeenCalledWith(\"buy\");\n    expect(mockOpenModal).toHaveBeenCalled();\n  });\n\n  test('calls setMessage with \"sell\" when the sell button is clicked', () => {\n    useParams.mockReturnValue({ userId: undefined }); // Replace with your desired mock values\n\n    currentUserModule.useCurrentUser.mockReturnValue({\n      data: {\n        root: {\n          user: {\n            id: NaN,\n          },\n        },\n      },\n    });\n    currentUserModule.hasRole.mockReturnValue(true);\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"ManageCows\n          userCommons={userCommonsFixtures.oneUserCommons[0]}\n          setMessage={mockSetMessage}\n          openModal={mockOpenModal}\n        />\n      <"+"/QueryClientProvider>,\n    );\n\n    fireEvent.click(screen.getByTestId(\"sell-cow-button\"));\n    expect(mockSetMessage).toHaveBeenCalledWith(\"sell\");\n    expect(mockOpenModal).toHaveBeenCalled();\n  });\n});\n"},"src/tests/components/Jobs/InstructorReportSpecificCommonsForm.test.jsx":{"tests":[{"id":"290","name":"InstructorReportSpecificCommonsForm tests renders the fallback text correctlyl"},{"id":"291","name":"InstructorReportSpecificCommonsForm tests user can sucessfully submit the job"},{"id":"292","name":"InstructorReportSpecificCommonsForm tests the first item in commons array is selected by default"},{"id":"293","name":"InstructorReportSpecificCommonsForm tests the correct parameters are passed to useBackend"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { MemoryRouter as Router } from \"react-router\";\nimport InstructorReportSpecificCommonsForm from \"main/components/Jobs/InstructorReportSpecificCommonsForm\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport axios from \"axios\";\nimport commonsFixtures from \"fixtures/commonsFixtures\";\nimport { vi } from \"vitest\";\n\n// Next line uses technique from https://www.chakshunyu.com/blog/how-to-spy-on-a-named-import-in-jest/\nimport * as useBackendModule from \"main/utils/useBackend\";\n\nconst mockedNavigate = vi.fn();\n\nvi.mock(\"react-router\", async () => ({\n  ...(await vi.importActual(\"react-router\")),\n  useNavigate: () => mockedNavigate,\n}));\n\ndescribe(\"InstructorReportSpecificCommonsForm tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  it(\"renders the fallback text correctlyl\", async () => {\n    axiosMock.onGet(\"/api/commons/all\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"InstructorReportSpecificCommonsForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByText(\"There are no commons on which to run this job.\"),\n    ).toBeInTheDocument();\n  });\n\n  test(\"user can sucessfully submit the job\", async () => {\n    const getItemSpy = vi.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation(() => null);\n\n    const submitAction = vi.fn();\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"InstructorReportSpecificCommonsForm submitAction={submitAction} />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    const commonsRadio = await screen.findByTestId(\n      \"InstructorReportSpecificCommonsForm-commons-1\",\n    );\n    expect(commonsRadio).toBeInTheDocument();\n    fireEvent.click(commonsRadio);\n\n    expect(\n      screen.queryByText(\"There are no commons on which to run this job.\"),\n    ).not.toBeInTheDocument();\n\n    const submitButton = screen.getByTestId(\n      \"InstructorReportSpecificCommonsForm-Submit-Button\",\n    );\n\n    expect(submitButton).toBeInTheDocument();\n\n    fireEvent.click(submitButton);\n\n    // assert - check that the console.log was called with the expected message\n    await waitFor(() => {\n      expect(submitAction).toHaveBeenCalled();\n    });\n\n    expect(submitAction).toHaveBeenCalledWith({\n      selectedCommons: 1,\n      selectedCommonsName: \"Anika's Commons\",\n    });\n  });\n\n  test(\"the first item in commons array is selected by default\", async () => {\n    const getItemSpy = vi.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation((key) =>\n      key === \"InstructorReportSpecificCommonsForm-health\" ? 42 : null,\n    );\n\n    axiosMock\n      .onGet(\"/api/commons/all\")\n      .reply(200, commonsFixtures.threeCommons);\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"InstructorReportSpecificCommonsForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    const defaultId = commonsFixtures.threeCommons[0].id;\n    const testIdForFirstItem = `InstructorReportSpecificCommonsForm-commons-${defaultId}`;\n    await waitFor(() => {\n      expect(screen.getByTestId(testIdForFirstItem)).toBeInTheDocument();\n    });\n\n    const commons = screen.getByTestId(testIdForFirstItem);\n    expect(commons).toHaveAttribute(\"checked\", \"\");\n  });\n\n  test(\"the correct parameters are passed to useBackend\", async () => {\n    // https://www.chakshunyu.com/blog/how-to-spy-on-a-named-import-in-jest/\n    const useBackendSpy = vi.spyOn(useBackendModule, \"useBackend\");\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"InstructorReportSpecificCommonsForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(useBackendSpy).toHaveBeenCalledWith(\n        [\"/api/commons/all\"],\n        { url: \"/api/commons/all\" },\n        [],\n      );\n    });\n  });\n});\n"},"src/tests/components/Reports/ReportTable.test.jsx":{"tests":[{"id":"294","name":"ReportTable tests Has the expected column headers and content"},{"id":"295","name":"ReportTable tests When not on storybook, navigates to view page"},{"id":"296","name":"ReportTable tests When on storybook, calls window.alert"},{"id":"297","name":"ReportTable tests Has all numeric values right-justified"}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport ReportTable from \"main/components/Reports/ReportTable\";\nimport reportFixtures from \"fixtures/reportFixtures\";\nimport { vi } from \"vitest\";\n\nconst mockNavigate = vi.fn();\nvi.mock(\"react-router\", async () => ({\n  ...(await vi.importActual(\"react-router\")),\n  useParams: () => ({\n    commonsId: 1,\n  }),\n  useNavigate: () => mockNavigate,\n}));\n\ndescribe(\"ReportTable tests\", () => {\n  const testId = \"ReportTable\";\n\n  const queryClient = new QueryClient();\n\n  test(\"Has the expected column headers and content\", () => {\n    // act\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"ReportTable reports={reportFixtures.threeReports} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n\n    const expectedFields = [\n      \"id\",\n      \"commonsId\",\n      \"name\",\n      \"numUsers\",\n      \"numCows\",\n      \"createDate\",\n    ];\n    const expectedHeaders = [\n      \"id\",\n      \"commonsId\",\n      \"Name\",\n      \"Num Users\",\n      \"Num Cows\",\n      \"Create Date\",\n    ];\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\n      \"3\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-commonsId`),\n    ).toHaveTextContent(\"1\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-name`),\n    ).toHaveTextContent(\"Blue\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-numUsers`),\n    ).toHaveTextContent(\"1\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-numCows`),\n    ).toHaveTextContent(\"3\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-createDate`),\n    ).toHaveTextContent(\"2023-08-07T01:12:09.088+00:00\");\n  });\n\n  test(\"When not on storybook, navigates to view page\", () => {\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"ReportTable reports={reportFixtures.threeReports} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-View Report-button`),\n    ).toBeInTheDocument();\n    const viewButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-View Report-button`,\n    );\n    expect(viewButton).toHaveClass(\"btn-secondary\");\n    viewButton.click();\n    expect(mockNavigate).toHaveBeenCalledWith(\"/admin/report/1\");\n  });\n\n  test(\"When on storybook, calls window.alert\", async () => {\n    // arrange\n\n    const mockAlert = vi.spyOn(window, \"alert\").mockImplementation(() => {});\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"ReportTable reports={reportFixtures.threeReports} storybook={true} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-View Report-button`),\n    ).toBeInTheDocument();\n    const viewButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-View Report-button`,\n    );\n    viewButton.click();\n    await waitFor(() => {\n      expect(mockAlert).toHaveBeenCalledWith(\n        `would navigate to /admin/report/1`,\n      );\n    });\n    mockAlert.mockRestore();\n  });\n\n  test(\"Has all numeric values right-justified\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"ReportTable reports={reportFixtures.threeReports} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getAllByText(\"1\")[2]).toHaveStyle(\"text-align: right;\");\n    expect(screen.getAllByText(\"1\")[3]).toHaveStyle(\"text-align: right;\");\n    expect(screen.getAllByText(\"3\")[0]).toHaveStyle(\"text-align: right;\");\n  });\n});\n"},"src/tests/pages/AdminListCommonsPageV2.test.jsx":{"tests":[{"id":"298","name":"AdminListCommonPageV2 tests renders without crashing for regular user"},{"id":"299","name":"AdminListCommonPageV2 tests renders without crashing for admin user"},{"id":"300","name":"AdminListCommonPageV2 tests renders three commons without crashing for admin user"},{"id":"301","name":"AdminListCommonPageV2 tests renders empty state when backend unavailable, user only"}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport mockConsole from \"tests/testutils/mockConsole\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport axios from \"axios\";\nimport AxiosMock \"AdminCommonsCard-1\")).not.toBeInTheDocument();\n    expect(screen.getByText(\"Download All Stats\")).toBeInTheDocument();\n  });\n});\n"},"src/tests/components/Chat/ChatMessageCreate.test.jsx":{"tests":[{"id":"302","name":"ChatMessageCreate renders without crashing"},{"id":"303","name":"ChatMessageCreate shows an error when the message input is empty"},{"id":"304","name":"ChatMessageCreate calls the correct submit action on successful submission"},{"id":"305","name":"ChatMessageCreate When you fill in the message form and click submit, the right things happen"}],"source":"import React from \"react\";\nimport { render, fireEvent, screen, waitFor } from \"@testing-library/react\";\nimport ChatMessageCreate from \"main/components/Chat/ChatMessageCreate\";\nimport { chatMessageFixtures } from \"fixtures/chatMessageFixtures\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport axios from \"axios\";\nimport { vi } from \"vitest\";\n\ndescribe(\"ChatMessageCreate\", () => {\n  const commonsId = 1;\n\n  const axiosMock = new AxiosMockAdapter(axios);\n  const queryClient = new QueryClient();\n\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/chat/get\")\n      .reply(200, { content: chatMessageFixtures.oneChatMessage });\n  });\n\n  test(\"renders without crashing\", async () => {\n    // arrange\n    const submitAction = vi.fn();\n\n    //act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"ChatMessageCreate submitAction={submitAction} />\n      <"+"/QueryClientProvider>,\n    );\n\n    //assert\n\n    await waitFor(() => {\n      expect(screen.getByText(/Send/)).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(\"ChatMessageCreate-Message\")).toBeInTheDocument();\n    expect(screen.getByTestId(\"ChatMessageCreate-Send\")).toBeInTheDocument();\n\n    expect(screen.getByTestId(\"ChatMessageCreate\")).toHaveStyle(\n      \"display: flex\",\n    );\n    expect(screen.getByTestId(\"ChatMessageCreate\")).toHaveStyle(\n      \"justifyContent: space-between\",\n    );\n    expect(screen.getByTestId(\"ChatMessageCreate\")).toHaveStyle(\n      \"alignItems: center\",\n    );\n  });\n\n  test(\"shows an error when the message input is empty\", async () => {\n    // arrange\n    const submitAction = vi.fn();\n\n    //act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"ChatMessageCreate submitAction={submitAction} />\n      <"+"/QueryClientProvider>,\n    );\n\n    //assert\n    const sendButton = screen.getByTestId(\"ChatMessageCreate-Send\");\n\n    fireEvent.click(sendButton);\n\n    await waitFor(() => {\n      expect(screen.getByText(\"Message cannot be empty\")).toBeInTheDocument();\n    });\n  });\n\n  test(\"calls the correct submit action on successful submission\", async () => {\n    // arrange\n    const submitAction = vi.fn();\n    const messageText = \"Hello, World!\";\n\n    //act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"ChatMessageCreate submitAction={submitAction} />\n      <"+"/QueryClientProvider>,\n    );\n\n    const messageInput = screen.getByTestId(\"ChatMessageCreate-Message\");\n    const sendButton = screen.getByTestId(\"ChatMessageCreate-Send\");\n\n    fireEvent.change(messageInput, { target: { value: messageText } });\n    fireEvent.click(sendButton);\n\n    // Wait for submit action to be called\n    await waitFor(() => {\n      expect(submitAction).toHaveBeenCalledTimes(1);\n    });\n  });\n\n  test(\"When you fill in the message form and click submit, the right things happen\", async () => {\n    const messageText = \"Hello World\";\n    const expectedMessage = {\n      content: \"Hello%20World\",\n      commonsId: \"1\",\n    };\n\n    axiosMock\n      .onPost(\"/api/chat/post?commonsId=1&content=Hello%20World\")\n      .reply(200, chatMessageFixtures.oneChatMessage[0]);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"ChatMessageCreate commonsId={commonsId} />\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(screen.getByText(/Send/)).toBeInTheDocument();\n    });\n\n    const messageInput = screen.getByTestId(\"ChatMessageCreate-Message\");\n    const sendButton = screen.getByTestId(\"ChatMessageCreate-Send\");\n\n    fireEvent.change(messageInput, { target: { value: messageText } });\n    fireEvent.click(sendButton);\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    expect(axiosMock.history.post[0].data).toEqual(\n      JSON.stringify(expectedMessage),\n    );\n\n    await waitFor(() => expect(messageInput.value).toEqual(\"\"));\n  });\n});\n"},"src/tests/pages/AdminViewReportPage.test.jsx":{"tests":[{"id":"306","name":"AdminViewReportPage tests renders correctly for admin user"},{"id":"307","name":"AdminViewReportPage tests back to reports button navigates correctly"},{"id":"308","name":"AdminViewReportPage tests CSV button has correct address"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport AdminViewReportPage from \"main/pages/AdminViewReportPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport reportFixtures from \"fixtures/reportFixtures\";\nimport reportLineFixtures from \"fixtures/reportLineFixtures\";\nimport { vi } from \"vitest\";\n\nconst mockedNavigate = vi.fn();\n\nvi.mock(\"react-router\", async () => ({\n  ...(await vi.importActual(\"react-router\")),\n  useNavigate: () => mockedNavigate,\n  useParams: () => ({\n    reportId: 17,\n  }),\n}));\n\ndescribe(\"Admi expect(\n      await screen.findByTestId(\"user-leaderboard-button\"),\n    ).toBeInTheDocument();\n    const leaderboardButton = screen.getByTestId(\"user-leaderboard-button\");\n    fireEvent.click(leaderboardButton);\n    //expect(mockNavigate).toBeCalledWith({ \"to\": \"/leaderboard/1\" });\n  });\n\n  test(\"No LeaderboardPage for an ordinary user when commons has showLeaderboard = false\", async () => {\n    const ourCommons = {\n      ...commonsFixtures.oneCommons,\n      showLeaderboard: false,\n    };\n    const ourCommonsPlus = {\n      ...commonsPlusFixtures.oneCommonsPlus,\n      commons: ourCommons,\n    };\n    apiCurrentUserFixtures.userOnly.user.commonsPlus =\n      commonsPlusFixtures.oneCommonsPlus[0];\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/commons/plus\", { params: { id: 1 } })\n      .reply(200, ourCommonsPlus);\n    axiosMock\n      .onGet(\"/api/leaderboard/all\")\n      .reply(200, leaderboardFixtures.threeUserCommonsLB);\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PlayPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toEqual(3);\n    });\n    await waitFor(() =>\n      expect(\n        screen.queryByTestId(\"user-leaderboard-button\"),\n      ).not.toBeInTheDocument(),\n    );\n  });\n});\n"},"src/tests/utils/systemInfo.test.jsx":{"tests":[{"id":"312","name":"utils/systemInfo tests useSystemInfo tests useSystemInfo retrieves initial data"},{"id":"313","name":"utils/systemInfo tests useSystemInfo tests useSystemInfo retrieves data from API"},{"id":"314","name":"utils/systemInfo tests useSystemInfo tests systemInfo when API unreachable"}],"source":"import { renderHook, waitFor } from \"@testing-library/react\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport mockConsole from \"tests/testutils/mockConsole\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { useSystemInfo } from \"main/utils/systemInfo\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { vi } from \"vitest\";\n\nvi.mock(\"react-router\");\n\ndescribe(\"utils/systemInfo tests\", () => {\n  describe(\"useSystemInfo tests\", () => {\n    test(\"useSystemInfo retrieves initial data\", async () => {\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            retry: false,\n            staleTime: Infinity,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      var axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/systemInfo\").timeoutOnce();\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingNeither);\n\n      const { result } = renderHook(() => useSystemInfo(), {\n        wrapper,\n      });\n      await waitFor(() => result.current.isSuccess);\n\n      expect(result.current.data.springH2ConsoleEnabled).toBe(false);\n      expect(result.current.data.showSwaggerUILink).toBe(false);\n\n      const queryState = queryClient.getQueryState(\"systemInfo\");\n      expect(queryState).toBeDefined();\n    });\n\n    test(\"useSystemInfo retrieves data from API\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      var axiosMock = new AxiosMockAdapter(axios);\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingAll);\n\n      const { result } = renderHook(() => useSystemInfo(), {\n        wrapper,\n      });\n\n      await waitFor(() => result.current.isFetched);\n\n      expect(result.current.data.springH2ConsoleEnabled).toBe(\n        systemInfoFixtures.showingAll.springH2ConsoleEnabled,\n      );\n\n      expect(result.current.data.showSwaggerUILink).toBe(\n        systemInfoFixtures.showingAll.showSwaggerUILink,\n      );\n\n      expect(result.current.data.oauthLogin).toBe(\n        systemInfoFixtures.showingAll.oauthLogin,\n      );\n\n      expect(result.current.data.sourceRepo).toBe(\n        systemInfoFixtures.showingAll.sourceRepo,\n      );\n\n      queryClient.clear();\n    });\n\n    test(\"systemInfo when API unreachable\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      var axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/systemInfo\").reply(404);\n\n      const restoreConsole = mockConsole();\n      const { result } = renderHook(() => useSystemInfo(), {\n        wrapper,\n      });\n\n      await waitFor(() => result.current.isFetched);\n      expect(console.error).toHaveBeenCalled();\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(/Error invoking axios.get:/);\n      restoreConsole();\n\n      await waitFor(() =>\n        expect(result.current.data).toEqual({\n          springH2ConsoleEnabled: false,\n          showSwaggerUILink: false,\n        }),\n      );\n      queryClient.clear();\n    });\n  });\n});\n"},"src/tests/components/Reports/ReportLineTable.test.jsx":{"tests":[{"id":"315","name":"ReportLineTable tests Has the expected column headers and content"},{"id":"316","name":"ReportLineTable tests Has numeric values right-justified"}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter }    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-cowsBought`),\n    ).toHaveTextContent(\"3\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-cowsSold`),\n    ).toHaveTextContent(\"0\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-cowDeaths`),\n    ).toHaveTextContent(\"0\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-createDate`),\n    ).toHaveTextContent(\"2023-08-07T01:12:54.767+00:00\");\n  });\n\n  test(\"Has numeric values right-justified\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"ReportLineTable reportLines={reportLineFixtures.twoReportLines} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getAllByText(\"$9,745.00\")[0]).toHaveStyle(\n      \"text-align: right;\",\n    );\n    expect(screen.getAllByText(\"3\")[0]).toHaveStyle(\"text-align: right;\");\n    expect(screen.getAllByText(\"100\")[0]).toHaveStyle(\"text-align: right;\");\n    expect(screen.getAllByText(\"3\")[1]).toHaveStyle(\"text-align: right;\");\n    expect(screen.getAllByText(\"0\")[0]).toHaveStyle(\"text-align: right;\");\n    expect(screen.getAllByText(\"0\")[1]).toHaveStyle(\"text-align: right;\");\n    expect(screen.getAllByText(\"2023-08-07T01:12:54.767+00:00\")[0]).toHaveStyle(\n      \"text-align: right;\",\n    );\n  });\n});\n"},"src/tests/components/Reports/ReportHeaderTable.test.jsx":{"tests":[{"id":"317","name":"ReportHeaderTable tests Has the expected column headers and content"},{"id":"318","name":"ReportHeaderTable tests Has all numeric values right-justified"}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport ReportHeaderTable from \"main/components/Reports/ReportHeaderTable\";\nimport reportFixtures from \"fixtures/reportFixtures\";\n\ndescrib )),\n  useNavigate: () => mockedNavigate,\n}));\n\ndescribe(\"TestJobsForm tests\", () => {\n  it(\"renders correctly with the right defaults\", async () => {\n    render(\n      <"+"Router>\n        <"+"TestJobsForm jobs={jobsFixtures.sixJobs} />\n      <"+"/Router>,\n    );\n\n    expect(await screen.findByTestId(\"TestJobForm-fail\")).toBeInTheDocument();\n    expect(\n      await screen.findByTestId(\"TestJobForm-sleepMs\"),\n    ).toBeInTheDocument();\n    expect(screen.getByText(/Submit/)).toBeInTheDocument();\n  });\n\n  it(\"validates that sleepMs is present\", async () => {\n    const submitAction = vi.fn();\n\n    render(\n      <"+"Router>\n        <"+"TestJobsForm jobs={jobsFixtures.sixJobs} />\n      <"+"/Router>,\n    );\n\n    expect(await screen.findByTestId(\"TestJobForm-fail\")).toBeInTheDocument();\n    const submitButton = screen.getByTestId(\"TestJobForm-Submit-Button\");\n    const sleepMs = screen.getByTestId(\"TestJobForm-sleepMs\");\n\n    expect(submitButton).toBeInTheDocument();\n    expect(sleepMs).toHaveValue(1000);\n\n    fireEvent.change(sleepMs, { target: { value: \"\" } });\n    fireEvent.click(submitButton);\n    expect(\n      await screen.findByText(\"sleepMs is required (0 is ok)\"),\n    ).toBeInTheDocument();\n    expect(submitAction).not.toBeCalled();\n    expect(screen.getByTestId(\"TestJobForm-sleepMs\")).toHaveClass(\"is-invalid\"); // tests for mutation to isInvalid={!!errors.sleepMs} idiom\n  });\n\n  it(\"validates that sleepMs is >= 0\", async () => {\n    const submitAction = vi.fn();\n\n    render(\n      <"+"Router>\n        <"+"TestJobsForm jobs={jobsFixtures.sixJobs} />\n      <"+"/Router>,\n    );\n\n    expect(await screen.findByTestId(\"TestJobForm-fail\")).toBeInTheDocument();\n    const submitButton = screen.getByTestId(\"TestJobForm-Submit-Button\");\n    const sleepMs = screen.getByTestId(\"TestJobForm-sleepMs\");\n\n    expect(submitButton).toBeInTheDocument();\n    expect(sleepMs).toHaveValue(1000);\n\n opdown tests renders correctly, with initial value strat2"}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport { MemoryRouter as Router } from \"react-router\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport HealthUpdateStrategiesDropdown from \"main/components/Commons/HealthStrategiesUpdateDropdown\";\nimport healthUpdateStrategyListFixtures from \"fixtures/healthUpdateStrategyListFixtures\";\nimport { vi } from \"vitest\";\n\ndescribe(\"HealthUpdateStrategiesDropdown tests\", () => {\n  it(\"renders correctly, with initial value strat1\", async () => {\n    const register = vi.fn();\n    const healthUpdateStrategies = healthUpdateStrategyListFixtures.simple;\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"HealthUpdateStrategiesDropdown\n            formName={\"aboveCapacityHealthUpdateStrategy\"}\n            displayName={\"When above capacity\"}\n            initialValue={\"strat1\"}\n            register={register}\n            healthUpdateStrategies={healthUpdateStrategies}\n          />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"aboveCapacityHealthUpdateStrategy-select\"),\n      ).toBeInTheDocument();\n    });\n    const selectElement = screen.getByTestId(\n      \"aboveCapacityHealthUpdateStrategy-select\",\n    );\n    expect(selectElement).toHaveValue(\"strat1\");\n\n    expect(\n      screen.getByTestId(\"aboveCapacityHealthUpdateStrategy-strat1\"),\n    ).toHaveAttribute(\"selected\");\n    expect(\n      screen.getByTestId(\"aboveCapacityHealthUpdateStrategy-strat2\"),\n    ).not.toHaveAttribute(\"selected\");\n  });\n\n  it(\"renders correctly, with initial value strat2\", async () => {\n    const register = vi.fn();\n    const healthUpdateStrategies = healthUpdateStrategyListFixtures.simple;\n\n    render(\n      <"+"QueryClientProvider client={new QueryClient()}>\n        <"+"Router>\n          <"+"HealthUpdateStrategiesDropdown\n            formName={\"aboveCapacityHealthUpdateStrategy\"}\n            displayName={\"When above capacity\"}\n            initialValue={\"strat2\"}\n            register={register}\n            healthUpdateStrategies={healthUpdateStrategies}\n          />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"aboveCapacityHealthUpdateStrategy-select\"),\n      ).toBeInTheDocument();\n    });\n    const selectElement = screen.getByTestId(\n      \"aboveCapacityHealthUpdateStrategy-select\",\n    );\n    expect(selectElement).toHaveValue(\"strat2\");\n    expect(\n      screen.getByTestId(\"aboveCapacityHealthUpdateStrategy-strat2\"),\n    ).toHaveAttribute(\"selected\");\n    expect(\n      screen.getByTestId(\"aboveCapacityHealthUpdateStrategy-strat1\"),\n    ).not.toHaveAttribute(\"selected\");\n  });\n});\n"},"src/tests/utils/dateUtils.test.jsx":{"tests":[{"id":"338","name":"dateUtils tests padWithZero tests pads when less than 10"},{"id":"339","name":"dateUtils tests padWithZero tests does not pad with 10 or greater"},{"id":"340","name":"dateUtils tests timestampToDate tests converts properly"},{"id":"341","name":"dateUtils tests daysSinceTimestamp tests calculates days properly"},{"id":"342","name":"dateUtils tests formatTime tests should return empty string for null input"},{"id":"343","name":"dateUtils tests formatTime tests should return `Online now` for less than 2 minutes"},{"id":"344","name":"dateUtils tests formatTime tests should return minutes ago format"},{"id":"345","name":"dateUtils tests formatTime tests should return hours ago format"},{"id":"346","name":"dateUtils tests formatTime tests should return 1 hour ago for 1 hour"},{"id":"347","name":"dateUtils tests formatTime tests should return days ago format"},{"id":"348","name":"dateUtils tests formatTime tests should return 1 day ago for 1 day"},{"id":"349","name":"dateUtils tests formatTime tests should return date string for over a week"}],"source":"import {\n  padWithZero,\n  timestampToDate,\n  daysSinceTimestamp,\n  formatTime,\n} from \"main/utils/dateUtils\";\n\ndescribe(\"dateUtils tests\", () => {\n  describe(\"padWithZero tests\", () => {\n    test(\"pads when less than 10\", () => {\n      expect(padWithZero(0)).toBe(\"00\");\n      expect(padWithZero(1)).toBe(\"01\");\n      expect(padWithZero(9)).toBe(\"09\");\n    });\n\n    test(\"does not pad with 10 or greater\", () => {\n      expect(padWithZero(10)).toBe(10);\n      expect(padWithZero(11)).toBe(11);\n    });\n  });\n\n  describe(\"timestampToDate tests\", () => {\n    it(\"converts properly\", () => {\n      expect(timestampToDate(1653346250816)).toBe(\"2022-05-23\");\n    });\n  });\n\n  describe(\"daysSinceTimestamp tests\", () => {\n    it(\"calculates days properly\", () => {\n      vi.useFakeTimers().setSystemTime(new Date(\"2022-06-01\"));\n      expect(daysSinceTimestamp(1653346250816)).toBe(9);\n    });\n  });\n\n  describe(\"formatTime tests\", () => {\n    it(\"should return empty string for null input\", () => {\n      expect(formatTime(null)).toEqual(\"\");\n    });\n\n    it(\"should return `Online now` for less than 2 minutes\", () => {\n      const oneMinuteAgo = new Date(Date.now() - 60 * 1000).toISOString();\n      expect(formatTime(oneMinuteAgo)).toEqual(\"Online now\");\n    });\n\n    it(\"should return minutes ago format\", () => {\n      const thirtyMinutesAgo = new Date(\n        Date.now() - 2 * 60 * 1000,\n      ).toISOString();\n      expect(formatTime(thirtyMinutesAgo)).toEqual(\"2 minutes ago\");\n    });\n\n    it(\"should return hours ago format\", () => {\n      const threeHoursAgo = new Date(\n        Date.now() - 3 * 60 * 60 * 1000,\n      ).toISOString();\n      expect(formatTime(threeHoursAgo)).toEqual(\"3 hours ago\");\n    });\n\n    it(\"should return 1 hour ago for 1 hour\", () => {\n      const oneHourAgo = new Date(Date.now() - 60 * 60 * 1000).toISOString();\n      expect(formatTime(oneHourAgo)).toEqual(\"1 hour ago\");\n    });\n\n    it(\"should return days ago format\", () => {\n      const twoDaysAgo = new Date(\n        Date.now() - 2 * 24 * 60 * 60 * 1000,\n      ).toISOString();\n      expect(formatTime(twoDaysAgo)).toEqual(\"2 days ago\");\n    });\n\n    it(\"should return 1 day ago for 1 day\", () => {\n      const oneDayAgo = new Date(\n        Date.now() - 24 * 60 * 60 * 1000,\n      ).toISOString();\n      expect(formatTime(oneDayAgo)).toEqual(\"1 day ago\");\n    });\n\n    it(\"should return date string for over a week\", () => {\n      const twoWeeksAgo = new Date(Date.now() - 7 * 24 * 60 * 60 * 1000);\n      expect(formatTime(twoWeeksAgo.toISOString())).toEqual(\n        twoWeeksAgo.toLocaleDateString(),\n      );\n    });\n  });\n});\n"},"src/tests/pages/AdminCreateAnnouncementsPage.test.jsx":{"tests":[{"id":"350","name":"AdminCreateAnnouncementsPage tests renders page without crashing"},{"id":"351","name":"AdminCreateAnnouncementsPage tests correct href for create announcements button as an admin"}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport AdminCreateAnnouncementsPage from \"main/pages/AdminCreateAnnouncementsPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport AdminAnnouncementsPage from \"main/pages/AdminAnnouncementsPage\";\nimport { vi } from \"vitest\";\n\nconst mockedNavigate = vi.fn();\n\nvi.mock(\"react-router\", async () => ({\n  ...(await vi.importActual(\"react-router\")),\n  useParams: () => ({\n    commonsId: 1,\n  }),\n  useNavigate: () => mockedNavigate,\n}));\n der(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"LoginCard />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Log In\");\n    expect(screen.getByText(\"Log In\")).toHaveAttribute(\n      \"href\",\n      \"/oauth2/authorization/google\",\n    );\n  });\n});\n"},"src/tests/components/Jobs/JobsTable.test.jsx":{"tests":[{"id":"355","name":"JobsTable tests renders without crashing for empty table"},{"id":"356","name":"JobsTable tests Has the expected column headers and content"}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport JobsTable from \"main/components/Jobs/JobsTable\";\nimport jobsFixtures from \"fixtures/jobsFixtures\";\n\ndescribe(\"JobsTable tests\", () => {\n  const queryClient = new QueryClient();\n\n  test(\"renders without crashing for empty table\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"JobsTable jobs={[]} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"Has the expected column headers and content\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"JobsTable jobs={jobsFixtures.sixJobs} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedHeaders = [\"id\", \"Created\", \"Updated\", \"Status\", \"Log\"];\n    const expectedFields = [\"id\", \"Created\", \"Updated\", \"status\", \"Log\"];\n    const testId = \"JobsTable\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${fie nfo\")\n      .reply(200, systemInfoFixtures.showingAll);\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n  });\n\n  test(\"renders branch information text and forwards system info to Inspector\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"DeveloperPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByText(\"Github Branch Information\"),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByText(\"The following SystemInfo is displayed in a JSON file.\"),\n    ).toBeInTheDocument();\n\n    const inspectorDiv = await screen.findByTestId(\"mock-inspector\");\n    await waitFor(() => {\n      expect(inspectorDiv).toHaveTextContent(\n        systemInfoFixtures.showingAll.sourceRepo,\n      );\n    });\n\n    await waitFor(() => expect(mockInspector).toHaveBeenCalled());\n    const inspectorProps = mockInspector.mock.calls.at(-1)[0];\n    expect(inspectorProps.data).toEqual(systemInfoFixtures.showingAll);\n  });\n});\n"},"src/tests/pages/ProfilePage.test.jsx":{"tests":[{"id":"358","name":"ProfilePage tests renders correctly for regular logged in user"},{"id":"359","name":"ProfilePage tests renders correctly for admin user from UCSB"}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport ProfilePage from \"main/pages/ProfilePage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\ndescribe(\"ProfilePage tests\", () => {\n  const queryClient = new QueryClient();\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    axiosMock.reset( est name"},{"id":"365","name":"arrayUtils tests getFirstSmallestLargest symbols.bird"},{"id":"366","name":"arrayUtils tests getFirstSmallestLargest symbols.flower"}],"source":"import { getFirstSmallestLargest } from \"main/utils/arrayUtils\";\n\ndescribe(\"arrayUtils tests\", () => {\n  const states = [\n    {\n      abbr: \"CA\",\n      name: \"California\",\n      symbols: {\n        bird: \"California Quail\",\n        flower: \"California Poppy\",\n      },\n    },\n    {\n      abbr: \"OR\",\n      name: \"Oregon\",\n      symbols: {\n        bird: \"Western Meadowlark\",\n        flower: \"Oregon Grape\",\n      },\n    },\n    {\n      abbr: \"NV\",\n      name: \"Nevada\",\n      symbols: {\n        bird: \"Mountain Bluebird\",\n        flower: \"Big Sagebrush\",\n      },\n    },\n    {\n      abbr: \"AK\",\n      name: \"Alaska\",\n      symbols: {\n        bird: \"Willow ptarmigan\",\n        flower: \"Forget-me-not\",\n      },\n    },\n  ];\n\n  test(\"getFirstSmallestLargest abbr\", () => {\n    const { first, smallest, largest } = getFirstSmallestLargest(\n      states,\n      (s) => s.abbr,\n    );\n    expect(first).toBe(\"CA\");\n    expect(smallest).toBe(\"AK\");\n    expect(largest).toBe(\"OR\");\n  });\n\n  test(\"getFirstSmallestLargest name\", () => {\n    const { first, smallest, largest } = getFirstSmallestLargest(\n      states,\n      (s) => s.name,\n    );\n    expect(first).toBe(\"California\");\n    expect(smallest).toBe(\"Alaska\");\n    expect(largest).toBe(\"Oregon\");\n  });\n\n  test(\"getFirstSmallestLargest symbols.bird\", () => {\n    const { first, smallest, largest } = getFirstSmallestLargest(\n      states,\n      (s) => s.symbols.bird,\n    );\n    expect(first).toBe(\"California Quail\");\n    expect(smallest).toBe(\"California Quail\");\n    expect(largest).toBe(\"Willow ptarmigan\");\n  });\n\n  test(\"getFirstSmallestLargest symbols.flower\", () => {\n    const { first, smallest, largest } = getFirstSmallestLargest(\n      states,\n      (s) => s.symbols.flower,\n    );\n    expect(first).toBe(\"California Poppy\");\n    expect(smallest).toBe(\"Big Sagebrush\");\n    expect(largest).toBe(\"Oregon Grape\");\n  });\n});\n"},"src/tests/pages/LoadingPage.test.jsx":{"tests":[{"id":"367","name":"LoadingPage tests renders without crashing when lists return empty list"}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport LoadingPage from \"main/pages/LoadingPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { vi } from \"vitest\";\n\nconst mockNavigate = vi.fn();\nvi.mock(\"react-router\", async () => ({\n  ...(await vi.importActual(\"react-router\")),\n  useParams: () => ({\n    commonsId: 1,\n  }),\n  useNavigate: () => mockNavigate,\n}));\n\ndescribe(\"LoadingPage tests\", () => {\n  const queryClient = new QueryClient();\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    vi.clearAllMocks();\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  test(\"renders without crashing when lists return empty list\", () => {\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock.onGet(\"/api/commons/all\").reply(200, []);\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"LoadingPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const mainDiv = screen.getByTestId(\"LoadingPage-main-div\");\n    expect(mainDiv).toBeInTheDocument();\n  });\n});\n"},"src/tests/pages/AdminStuden
